(36, 83, NULL, NULL, NULL, NULL, NULL, 1, 'Restaurace U Klásků', 'CZE', 'uklasku@seznam.cz', 'www.uklasku.cz', '585 751 908', NULL, 'Slavonínská 59', 'Olomouc', '779 00', 'Slavonínská Ulice 474/59, Povel, 779 00 Olomouc, Česko', NULL, '49.57032230', '17.25242320', NULL, NULL, NULL, '0', '0', '0', '0000', 'kvalitní kuchyně, 8 druhů piv, pořádání soukromých akcí', 'Nekuřácká restaurace, která má v nabídce 8 druhů piv - např. Plzeň 12°, Černá Hora, Lobkowicz. Možnost pořádání soukromých i rodinných akcí. K dispozici 2 terasy, posezení na zahradě s dětským koutkem. Možnost parkování, výborná přístupnost. K dispozici wifi.', '2017-02-03 07:44:44', '2017-02-03 08:50:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1800.00', '13.00', 5, b'1'),
(38, 86, NULL, NULL, NULL, NULL, NULL, 1, 'Restaurace pod Lipami', 'CZE', 'zsbudji@gmail.com', 'http://podlipami.info/', '+420 702 149 988', NULL, 'Zolova 14', 'Olomouc', '779 00', 'Zolova 7/14, Slavonín, 783 01 Olomouc, Česko', NULL, '49.56951711', '17.23258660', NULL, NULL, NULL, '0', '0', '0', '0000', 'Grill, domácí hamburgery, kvalitní suroviny', 'Restaurace Pod Lipami je nově přejmenovaná na GRILL PUB Pod Lipami a to z důvodu grilu na dřevěné uhlí uvnitř restaurace. V září 2015 byla zrekonstruována a znovu otevřena. Tým restaurace chce lidem nabízet příjemné prostředí, osobní přístup a především servírovat kvalitní jídlo. Šéfkuchař a majitel Zdeněk Svoboda si velmi zakládá na dobrém jídle. Má rád všechny kuchyně a všechny různé přípravy jídel, ale připraví Vám jen to, za čím si opravdu stojí.  \n\nZačal dělat domácí hamburgery, protože kombinace čerstvě namletého a dobře dochuceného masa v čerstvě upečené housce je opravdu skvělé jídlo, ale musí tam být ta kvalita, čerstvost a cit. V létě burgery připravoval na grilu a chuť ještě vzrostla, pak griloval i vyzrálé steaky a zeleninu aj. a ta chuť ho natolik pohltila, že se rozhodl, že s grilováním musí pokračovat i přes zimu, to se povedlo s koncem roku 2015.', '2017-02-03 09:15:23', '2017-02-03 09:17:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1600.00', '11.00', 11, b'1'),
(39, 87, NULL, NULL, NULL, NULL, NULL, 1, 'Restaurace Sal de Mar', 'CZE', 'p.antos@nh-hotels.com', 'www.nh-olomouc.eu/restaurace/restaurant-sal-de-mar.html', '+420 585 575 861', NULL, 'Legionářská 1311/21', 'Olomouc', '779 00', 'Legionářská 1311/21, Nová Ulice, 779 00 Olomouc, Česko', NULL, '49.60121520', '17.24706076', NULL, NULL, NULL, '27820998', 'CZ27820998', '0', '0000', 'Moderní gastronomie, hotelový bar, VIP lounge', 'V hotelu NH Olomouc Congress, tedy v těsné blízkosti centra, naleznete stylovou restauraci Sal de Mar. tato moderní designová restaurace je volně propojena s hotelovým barem a její součástí je i VIP lounge pro pořádání akcí v uzavřené společnosti.', '2017-02-06 07:33:04', '2017-02-06 07:35:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1400.00', '17.00', 6, b'1'),
