(44, 97, NULL, NULL, NULL, NULL, NULL, 1, 'Bistro Živá Zahrada', 'CZE', 'centrum@zivazahradaolomouc.cz', 'http://www.zivazahradaolomouc.cz/index.html', '730 691 323', NULL, 'Horní náměstí č.5', 'Olomouc', '779 00', 'Horní nám. 367/5, 779 00 Olomouc, Česko', NULL, '49.59436250', '17.25081760', NULL, NULL, NULL, '04719352', 'CZ04719352', '000', '0000', 'Léčivé šťávy, raw dezerty a dorty, vitariánské pokrmy, pizzy, čaj, káva, víno, živá strava, vegan, smoothie', 'Srdečně Vás zveme do přívětivého prostoru přímo v srdci Olomouce. \nŽivá Zahrada poskytuje klidné místo pro sdílení, setkávání, spočinutí a osobní rozvíjení.\nMůžete se tu těšit na spoustu dobrůtek z čerstvých surovin rostlinného původu, které pro Vás s láskou a radostí přichystáme a které překvapí (nejen) Vaše chuťové buňky. Naším cílem je Vám nabídnout originální delikatesy, které jinde v Olomouci nenajdete.\nNechte se vtáhnout do tajů živé kuchyně a odhalte její nespočetné zázraky!\nNabízíme Vám:\nrůzné druhy čerstvě připravených léčivých šťáv a vymazlených smoothies z dozrálého ovoce\nmlsné raw dorty a dezerty\nživé a čiperné polévky\npestrý sortiment veselých vitariánských hlavních jídel, frajerské pizzy i křupanské krekry\npotkat tu také můžete skupinu rozjímavých čajů, naspeedovanou kávu nebo lahodné a vznešené kvalitní víno.\nV prostorech Živé Zahrady se dále konájí pravidelné lekce jógy, přednášky, workshopy, tvořivé dílny, výstavy, nebo tématické odpoledne a večery. Pořádáme také víkendové kurzy a semináře.\nPokud Vás náš projekt zaujal, neváhejte se přidat k našim fanouškům nebo se přihlašte do našeho newsletteru a odebírejte naše novinky emailem ;)', '2017-02-22 18:51:52', '2017-02-22 18:51:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1300.00', '19.00', 13, b'1'),
(45, 98, NULL, NULL, NULL, NULL, NULL, 1, 'Hotel Milotel', 'CZE', 'recepce@milotel.cz', 'www.milotel.cz', '585 311 357', NULL, 'Hamerská 46', 'Olomouc', '783 71', 'Hamerská 46, 783 71 Olomouc', NULL, '49.82092260', '18.26252430', NULL, NULL, NULL, '000', '000', '000', '0000', 'snídaně, zahrádka,nekuřácká restaurace,hotel', 'V přízemí hotelu Milotel se nachází restaurace, bar a salonek. Kapacita restaurace je 32 míst. Všechna jídla z restaurace si také můžete objednat s donáškou na pokoj. Hotelová restaurace se širokou nabídkou vynikajících jídel.', '2017-02-23 17:25:36', '2017-02-23 17:25:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1900.00', '19.00', 11, b'1'),
