(62, 111, NULL, NULL, NULL, NULL, NULL, 1, 'Hotel Petra', 'CZE', 'rezervace@hotelpetra.cz', 'www.hotelpetra.cz www.facebook.com/Hotel.Petra', '731 526 164', '000', 'Ještědská 680/121', 'Liberec 8 Hanychov', '46008', 'Ještědská 680/121, Dolní Hanychov, 460 08 Liberec, Česko', NULL, '50.74278070', '15.02276170', NULL, NULL, NULL, '28670701', 'CZ28670701', '000', '0000', 'nekuřácká restaurace, bezbariérovost, letní terasa, točené pivo a Kofola, mazlíčci vítáni', 'Hotel Petra je kompletně nekuřácký komplex s bezbariérovou přístupností. Restaurace je cca pro 50 osob, salonek pro 20 osob (vhodný pro pořádání nejrůznějších oslav či školení). V létě terasa pro cca 50 osob. Točené pivo Gambrinus 10, Gambrinus 11, Plzeň 12 a černý Kozel. Točená Kofola. \n\nRodiny s dětmi vítány. K dispozici dětský koutek a dětské hřiště. Vaříme převážně českou kuchyni, ve všední dny 11-14:00 výběr ze dvou polévek a tří obědových meníček, od 14:00 stálý jídelní lístek. \n\nO víkendu stálý jídelní lístek již od 11:00. Občasné páteční živé koncerty. V komplexu se též nachází hotel (ubytování v 46 lůžek v 19 pokojích), Ergocyclingové centrum, prodejna učebnic Geom a soukromá mateřská školka Petra.', '2017-03-07 07:08:07', '2017-03-07 07:08:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '18.00', 14, b'1'),
(63, 112, NULL, NULL, NULL, NULL, NULL, 1, 'Hotel Radnice', 'CZE', 'recepce@hotelradnice.cz', 'www.hotelradnice.cz', '602 222 365', '000', 'Moskevská 11', 'Liberec', '460 01', 'Moskevská 18/11, Perštýn, 460 01 Liberec, Česko', NULL, '50.76812270', '15.05833450', NULL, NULL, NULL, '6454632', 'CZ7652252608', '000', '0000', 'česká kuchyně, polední menu', 'česká kuchyně, polední menu', '2017-03-07 07:32:13', '2017-03-07 07:32:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1700.00', '16.00', 7, b'1'),
(64, 113, NULL, NULL, NULL, NULL, NULL, 1, 'Balada', 'CZE', 'balada.lbc@seznam.cz', 'http://www.balada-liberec.cz/', '485 110 109', '000', 'Moskevská 22/13', 'Liberec', '460 01', 'Moskevská 22/13, Perštýn, 460 01 Liberec, Česko', NULL, '50.76801540', '15.05830270', NULL, NULL, NULL, '000', '000', '0000', '0000', 'česká a mezinárodní kuchyně, speciality, pivo Svijany, svatby, oslavy', 'Srdečně Vás zveme do originálního prostředí restaurace BALADA s více než desetiletou tradicí, kterou naleznete v Liberci, v Moskevské ulici 22/13. Otevřeno pro Vás máme denně od 10:30 do 24:00, v neděli od 12:00 do 22:00.\n\nRestaurace, nacházející se na jedné z hlavních tříd města Liberce, nabízí příjemné a útulné posezení se stylovou dekorací z dob dávno minulých. Kapacita restaurace je 65 osob. V letních měsících je otevřena teráska s kapacitou 25 míst.\n\nV jídelním lístku si můžete vybrat z české i mezinárodní kuchyně, našich specialit a doplnit výběrem českých vín, regionálního piva SVIJANY a širokým sortimentem alko i nealko nápojů.\n\nDovolujeme si Vám nabídnout kompletní služby při zařizování jakékoliv společenské akce, svatební hostiny, rodinné oslavy, promoce či dalších.', '2017-03-08 09:28:43', '2017-03-08 09:28:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '18.00', 8, b'1'),
(65, 114, NULL, NULL, NULL, NULL, NULL, 1, 'Pizzeria Franko', 'CZE', 'gj.karaqi@icloud.com', 'http://www.pizzeriafranko.cz/liberec/', '000', '00', 'Klostermannova 678/17', 'Liberec', '460 01', 'Klostermannova 17, 460 01 Liberec, Česko', NULL, '50.77088770', '15.06808830', NULL, NULL, NULL, '000', '000', '000', '0000', 'čerstvé suroviny, zahrádka, pizza', 'V naší restauraci v Liberci připravujeme veškeré pokrmy z čerstvých surovin. Nabízíme Vám příjemné posezení v naší zahrádce s možností připojení k internetu pomocí WiFi a to zdarma. Dále dbáme na příjemný přístup personálu k zákazníkovi. Moc se budeme těšit na Vaši návštěvu a věříme, že se k nám budete vracet.', '2017-03-08 10:55:45', '2017-03-08 10:55:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '14.00', 12, b'1'),
(68, 115, NULL, NULL, NULL, NULL, NULL, 1, 'Restaurace Kamenný dům Liberec', 'CZE', 'kamennydum@seznam.cz', 'http://www.kamennydum.com/cs/', '485 105 152', '000', 'TŘ. GEN. SVOBODY 49', 'LIBEREC 13', '460 13', 'Gen. Svobody 87/13, Nové Pavlovice, 460 01 Liberec, Česko', NULL, '50.77879680', '15.05387450', NULL, NULL, NULL, '000', '000', '000', '0000', '• hlavní restaurace • dva salónky • velká letní terasa • polední menu • bezplatné parkoviště v objektu • rodinné oslavy • svatby • firemní večírky • příjemné posezení • příjemná obsluha •', '• hlavní restaurace • dva salónky • velká letní terasa • polední menu • bezplatné parkoviště v objektu • rodinné oslavy • svatby • firemní večírky • příjemné posezení • příjemná obsluha •', '2017-03-08 13:45:59', '2017-03-08 13:45:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1500.00', '12.00', 9, b'1'),
(71, 121, NULL, NULL, NULL, NULL, NULL, 1, 'Restaurace PANOPTIKUM', 'CZE', 'restauracePANOPTIKUM@centrum.cz', 'http://www.panoptikum.unas.cz/o_nas_LBC.htm', '723 318 769', '000', 'Barvířská ul.č.8', 'Liberec', '460 07', 'Barvířská 31/8, Jeřáb, 460 07 Liberec, Česko', NULL, '50.76775920', '15.05414830', NULL, NULL, NULL, '000', '000', '000', '0000', 'Kapela ANEX, příjemné prostředí, polední menu', 'Restaurace PANOPTIKUM je oblíbená pro svou neopakovatelnou domáckou atmosféru a výhodnou polohu v centru města.\n\nVybavení a služby\n\nRestaurace s kapacitou 70 míst nabízí stravování formou poledního menu (pondělí – pátek od 11 do 14 hodin), a dále stálý jídelní lístek bohatého výběru. (pondělí – pátek od 14 hod., v sobotu celý den)\nviz Jídelní lístek\n\nDomácká atmosféra restaurace je zárukou příjemně strávených chvil na šálkem odpolední kávy, nebo u sklenky jiného lahodného nápoje či pokrmu.\n\nK pozvání přátel, kolegů či větších společností poslouží oddělené romantické salónky. Je také možnost objednání večírků, svateb či recepcí s živou kapelou (www.kapelaANEX.cz), která hraje k tanci i poslechu.', '2017-03-09 05:18:32', '2017-03-09 05:18:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1500.00', '12.00', 11, b'1'),
(72, 122, NULL, NULL, NULL, NULL, NULL, 1, 'Svijanská hospůdka u Lva', 'CZE', 'svijanskarestaurace@gmail.com', 'http://www.svijanskarestaurace.cz/index.php', '485 256 719', '000', 'Gutenbergova 126/3', 'Liberec V-Kristiánov', '460 05', 'Gutenbergova 126/3, Kristiánov, 460 05 Liberec, Česko', NULL, '50.76878820', '15.06148510', NULL, NULL, NULL, '000', '000', '000', '0000', 'česká a zahraniční kuchyně, pivo Svijany, moravská a Italská vína', 'Naši restauraci provozujeme od ledna roku 2007.\nNabízíme příjemné posezení jen několik desítek metrů od historického centra města s příjemnou a profesionální obsluhou. V letních měsících máte možnost posedět na letní terase v klidné lokalitě s výhledem do nedalekého parku a na liberecký zámeček. Restaurace má kapacitu až 100 osob a otevřeno sedm dní v týdnu.\nV jídelním lístku si můžete vybrat nejen klasiku české kuchyně, ale i zahraniční speciality. Nabízíme také sezónní jídla s čerstvých potravin. V případě vašeho přání vám pokrmy rádi zabalíme s sebou.\nV době obědů se v prostorách celé restaurace nekouří, takže mohou bez obav přijít na oběd i rodiny s dětmi.\nTočíme vynikající pivo pivovaru Svijany, naše restaurace vlastní její certifikát kvality. V nápojovém lístku ale nenajdete jen nabídku piva, ale i kvalitní moravská a italská vína, ať sudová nebo lahvová. Přijďte si prohlédnout náš vinný lístek, pokud budete mít zájem, naše obsluha vám velmi ráda poradí s výběrem.\nDo naší restaurace můžete přijít i se svými pejsky. Rádi obsloužíme i je.\n\nTěšíme se na Vaši návštěvu', '2017-03-09 05:40:57', '2017-03-09 05:45:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '18.00', 7, b'1'),
