(74, 127, 125, 125, 125, NULL, NULL, 1, 'Penzion Česká Chalupa', 'CZE', 'ceska.chalupa@email.cz', 'http://www.penzion-ceskachalupa.cz/cz/restaurace', '732 423 077', '000', 'Bedřichovská 1', 'Liberec', '460 14', NULL, 32, '50.78613950', '15.11151040', NULL, NULL, NULL, '000', '000', '000', '0000', 'salónek pro 50 osob, penzion, hřiště, zahrádka, kluziště', 'Restaurace v našem penzionu slouží nejenom ubytovaným hostům, ale i všem turistům, cyklistům, běžkařům a vůbec návštěvníkům Jizerských hor. \nNabízíme nekuřácké prostředí s domácí kuchyní, dětský koutek, salonek pro 50 osob.\nV létě venkovní posezení na zahradě, stojan na kola pro cyklisty, asfaltové hřiště. V zimě možnost úschovy lyží, kluziště na zahradě.\nSamozřejmostí je využití restaurace a salonku pro svatby, rodinné i firemní oslavy, narozeniny, teambuildingy.', '2017-03-10 09:18:50', '2017-03-10 09:22:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '12.00', 12, b'1'),
(75, 128, 125, NULL, 125, NULL, NULL, 1, 'Restaurace u Cvičáku', 'CZE', 'pp.hlavaty@seznam.cz', 'http://www.restaurace-ucvicaku.cz', '603 845 555', '000', 'Na cvičišti 1294', 'Liberec', '460 14', NULL, 32, '50.78661480', '15.05680320', NULL, NULL, NULL, '000', '000', '000', '0000', 'nekuřácká, kapacita 45 míst, terasa, dětský koutek', 'Naše restaurace se nachází v klidné městské čtvrti Ruprechtice. Dopravit se k nám můžete pěšky, automobilem, ale i městskou hromadnou dopravou. Zastávka autobusové linky č.25 a č.14 se nachází cca 80m od naší provozovny.\n\nPříjemný interiér restaurace zdobí originály zapůjčené z dílny našeho kamaráda Václava Plechatého. Vnitřní prostory restaurace mají kapacitu 45 míst, venkovní zastřešená terasa s výhledem na Ještěd dalších 50 míst. Pro Vaše ratolesti je k dispozici prostorný dětský koutek.\n\nTěšíme se na Vaší návštěvu.\n\nKolektiv restaurace U Cvičáku.', '2017-03-10 09:32:23', '2017-03-10 09:36:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1500.00', '12.00', 9, b'1'),
(76, 129, 125, NULL, 125, NULL, NULL, 1, 'Restaurace CD-Club', 'CZE', 'cd.club@seznam.cz', 'http://www.cd-club.cz/kontakt.php', '608 100 614', '000', 'Hodkovická 52', 'Liberec', '400 06', NULL, 32, '50.74235730', '15.05820950', NULL, NULL, NULL, '000', '000', '000', '0000', 'kapacita 100 míst, salónek, krb, jídlo s sebou, česká kuchyně', 'Restaurace CD Club, která je tu pro Vás již od roku 1990 a nabízí kuřáckou i nekuřáckou část s celkovou kapacitou 100 míst nejen pro obědy či večeře, ale i oddělený salónek s krbem pro pořádání Vašich oslav, svateb, firemních akcí apod. V denní nabídce je okolo 20 jídel převážně české kuchyně. Nabízíme jídla s sebou. Možno objednat telefonicky na tel: 608100614 od 10:00 hodin a my Vám jídla připravíme na domluvenou dobu.', '2017-03-10 09:47:44', '2017-03-10 09:50:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1600.00', '16.00', 14, b'1'),
