(82, 134, 125, 125, 125, NULL, NULL, 1, 'Fresh Pizza Restaurant', 'CZE', 'info@freshpizza.cz', 'http://www.freshpizza.cz/', '778 444 844', '000', 'Fibichova 929', 'LIBEREC 1', '460 01', NULL, 32, '50.77577780', '15.07606090', NULL, NULL, NULL, '000', '000', '000', '0000', 'večírky, svatby, firemní a rodinné oslavy, ubytování, stravenky', 'Výroba a rozvoz pizzy Liberec \n\nVážení návštěvníci, vítáme Vás na stránkách naší restaurace Fresh pizza Liberec. Nachází se v blízkosti zoologické a botanické zahrady na ulici Fibichova 1377 v areálu Libereckého tenisového klubu. Zastávka tramvaje Botanická zahrada.\nRestaurace Fresh Pizza Liberec\nV prostorách restaurace pro Vás rádi připravíme akce všeho druhu, večírky, svatby, firemní a rodinné oslavy. V restauraci je možnost ubytování ve čtyřech dvoulůžkových pokojích s možností přistýlky. Restaurace je nekuřácká a pro děti je k dispozici dětské hřiště. V letních měsících je v provozu teráska. U restaurace je možnost využítí osmi tenisových kurtů. \nRozvoz pizzy zdarma Liberec\nRozvoz pizzy po Liberci a jeho blízkém okolí zdarma. Ostatní dle telefonické dohody.\nPro rychlejší vyřízení objednávky uvádějte číselné označení z naší nabídky.\nPři objednávce uveďte jméno, adresu a telefonní číslo.\nPři placení můžete využít stravenky (SODEXHO, GASTRO PASS, TICKET RESTURANT, CHÉQUE DEJENEUR)\nPři platbě stravenkami vracíme hotovost.\nObjednávky příjmáme do 22:00 hod. na telefoním čísle 778 444 844', '2017-03-11 05:49:57', '2017-03-11 05:51:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1000.00', '14.00', 6, b'1'),
