(86, 138, 125, 125, 125, NULL, NULL, 3, 'Kavárna v zahradě', 'CZE', 'info@kavarnavzahrade.cz', 'http://www.kavarnavzahrade.cz', '725 757 902', '000', 'Tržní náměstí 876', 'Liberec 1', '460 01', NULL, 32, '50.75916430', '14.55473870', NULL, NULL, NULL, '000', '00', '000', '0000', 'nekuřácká, dětský koutek, hřiště pro děti, letní zahrada, oslavy narozenin pro děti i dospělé', 'Naše denní kavárna se nachází v nově zrekonstruované vile na Tržním náměstí č. p. 876 v Liberci (u městského bazénu). Kavárna je vybavena vnitřním dětským koutkem, hřištěm pro děti v zahradě a letní zahrádkou s obsluhou. V kavárně najdete příjemné rodinné prostředí, milou obsluhu, kvalitní italskou kávu značky Covim a jiné občerstvení za rozumné ceny. Můžete si také vybrat z naší nabídky čerstvých dortů, domácího tiramisu, croasantů, zapečených panini či plněné ciabaty. Připojení Wi-fi je samozřejmostí. Jsme nekuřácká kavárna, ale v letních měsících budou vyhrazeny stolečky pro kuřáky na venkovní terase. Nabízíme také uspořádání narozeninových oslav pro děti i pro dospělé.', '2017-03-11 08:35:25', '2017-03-11 08:42:27', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1000.00', '13.00', 12, b'1'),
(87, 139, 125, 125, 125, NULL, NULL, 9, 'Bistro Zuzu Kebab', 'CZE', 'zuzukebab@seznam.cz', 'https://www.facebook.com/zuzukebab/?fref=ts', '722 311 376', '000', 'Husova 23/9', 'Liberec', '460 01', NULL, 32, '50.77052530', '15.06224220', NULL, NULL, NULL, '000', '000', '000', '0000', 'kebab, pizza', 'kebab\npizza', '2017-03-11 09:01:06', '2017-03-11 09:03:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1600.00', '17.00', 13, b'1'),
(88, 140, 125, 125, 125, NULL, NULL, 1, 'Hospůdka U Námořníka', 'CZE', 'info@u-namornika.com', 'http://www.u-namornika.com', '739 918 810', '000', 'Londýnská 108/3', 'Liberec XI-Růžodol I', '460 01', NULL, 32, '50.77413120', '15.04400530', NULL, NULL, NULL, '000', '000', '000', '0000', 'narozeniny, akce, večírky', 'Říká se, že láska prochází žaludkem. Proto věříme, že si naši restauraci zamilujete.\n\nKromě profesionálně vyškoleného personálu se u nás můžete těšit na široký výběr specialit a nápojů. V příjemném prostředí naší restaurace bude i pracovní oběd vždy příjemnou záležitostí a večeře s rodinou či přáteli radostným zážitkem. Uvítá Vás klidná, příjemná atmosféra a vstřícný personál s profesionálním přístupem.\n\nNa kvalitu jídla jsou u nás kladeny vysoké nároky a ke každé objednávce přistupujeme s maximální pozorností a péčí. To jsou hlavní ingredience, díky kterým se k nám budete rádi znovu a znovu vracet.\n\nPřijďte ochutnat to nejlepší z naší kuchyně. Restauraci najdete na adrese Londýnská 108/3, Liberec 1. Pokud si chcete rovnou rezervovat stůl, kontaktujte nás na tel. 739 918 810.\n\nPřijímáme objednávky na soukromé akce, narozeniny, večírky.\n\nVychutnejte si naše jídlo kdykoliv a kdekoliv a nechte si jej dovézt až ke dveřím. Objednávky přijímáme skrze portál na webové adrese damejidlo.cz/buffalo-restaurace', '2017-03-11 09:10:02', '2017-03-11 09:11:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '14.00', 14, b'1'),
(89, 142, 125, 125, 125, NULL, NULL, 1, 'Restaurace Modrá Ryba', 'CZE', 'info@uryby.cz', 'http://uryby.cz/', '734 851 132', '000', 'Libušská 400/115', 'Praha 4 Písnice', '142 00', NULL, 32, '50.00268920', '14.46492490', NULL, NULL, NULL, '000', '000', '000', '0000', 'POLEDNÍ MENU STÁLÉ MENU NÁPOJOVÝ LÍSTEK   PŘÍJEMNÉ POSEZENÍ O NÁS Modrá ryba je kompletně zrekonstruovaná a moderně zařízená rodinná restaurace. Jsme ideálním místem nejen na příjemné posezení u dobrého jídla a pití, ale také na oslavy všeho druhu. Naroze', 'Modrá ryba je kompletně zrekonstruovaná a moderně zařízená rodinná restaurace. Jsme ideálním místem nejen na příjemné posezení u dobrého jídla a pití, ale také na oslavy všeho druhu. Narozeniny, svatební hostiny, rozlučky se svobodou, setkání přátel, srazy sportovních oddílů a mnodo dalších typů akcí. Individuálně pak nabízíme zakázkové občerstvení, dekorace nebo i DJ či kapelu.\n\nNABÍZÍME\nPříjemné posezení\nPodáváme české speciality, hotová jídla a grilovaná masa\nTankové Pivo Gambrinus\nBereme tyto stravenky: Ticket, Gastro, Sodexo\nSportovní přenosy na velkoplošné TV\nPořádáme oslavy všeho druhu, country, večírky, rauty, tombolu, travestie show, disko\nNekuřácký salonek + dětský koutek\nZdarma Wi-Fi internet\nLze platit kreditní kartou', '2017-03-14 04:05:27', '2017-03-14 04:09:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '11.00', 9, b'1'),
(90, 143, 125, NULL, 125, NULL, NULL, 3, 'Kavárna Fantazie', 'CZE', 'spanikova.lucie@seznam.cz', 'https://www.facebook.com/pg/kavarnafantazie/about/?ref=page_internal', '777 925 030', '000', 'Moskevská 27/14', 'Liberec', '460 01', NULL, 32, '50.76785780', '15.05790270', NULL, NULL, NULL, '000', '000', '000', '0000', 'Přijímá rezervace Vítáme i zákazníky bez rezervace Vhodné pro skupiny Vhodná pro děti Catering S obsluhou Venkovní posezení', 'Přijímá rezervace\nVítáme i zákazníky bez rezervace\nVhodné pro skupiny\nVhodná pro děti\nCatering\nS obsluhou\nVenkovní posezení', '2017-03-14 04:42:17', '2017-03-14 04:56:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1200.00', '15.00', 6, b'1'),
(91, 143, 125, 125, 125, NULL, NULL, 2, 'Double Bar', 'CZE', 'info@kavarnafantazie.cz', 'https://www.facebook.com/pg/BarDoubleAA/about/?ref=page_internal', '777 925 030', '000', 'Na Svahu 176/1', 'Liberec', '460 01', NULL, 32, '50.76884220', '15.05343050', NULL, NULL, NULL, '000', '000', '000', '0000', 'Přijímá rezervace Vítáme i zákazníky bez rezervace Vhodné pro skupiny', 'Příjemný bar v centru Liberce.\n\nNabízíme příjemné posezení jak v kuřácké části tak v nekuřáckém salónku pro 30-40 osob.\n\nPro Vaši maximální zábavu je u nás k dispozici jukebox, karaoke, fotbálek, šipky a online vysílání sportovních přenosů.', '2017-03-14 04:44:12', '2017-03-14 05:05:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1000.00', '11.00', 9, b'1'),
(92, 144, 125, 125, 125, NULL, NULL, 1, 'Restaurace LaRocket Liberec', 'CZE', 'info@larocket-liberec.cz', 'http://www.larocket-liberec.cz', '702 180 108', '000', 'Nákladní 344', 'Liberec', '406 07', NULL, 32, '50.75807570', '15.05012650', NULL, NULL, NULL, '000', '000', '000', '0000', '4 druhy točené zmrzliny, Kozel, Gambrinus, Plzeň, Kofola, snídaňové menu, denní menu', 'Zveme Vás k návštěvě restaurace LaRocket, která je mezi lidmi známá také jako „Nádražka“. Restaurace se nachází v areálu vlakového nádraží v Liberci, poblíž tramvajových zastávek a nedaleko autobusového nádraží. Restaurace díky své strategické poloze je tak ideální zastávkou na Vašich cestách a výletech. Od restaurace  Restaurace LaRocket, stejně jako celé liberecké vlakové nádraží, prošla v nedávné době rekonstrukcí, díky které získala zcela novou a moderní podobu. Restaurace je kuřácká, ale s moderním odvětráváním.\n \nV restauraci LaRocket je pro Vás k dispozici 60 míst na sezení u stolů a 3 místa u baru. Hosté si mohou vybírat ze snídaňového, denního menu a nápojového lístku. Věříme, že si u nás vybere každý.\n \nPříznivci dobrého piva uvítají pivní nabídku značek Kozel, Kozel tmavý, Gambrinus a Plzeň. Z nealkoholických nápojů doporučujeme oblíbenou točenou Kofolu. V letních měsících nabízíme nejen pro Vaše nejmladší 4 druhy točené zmrzliny.', '2017-03-14 06:58:44', '2017-03-14 07:01:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1900.00', '19.00', 5, b'1'),
(93, 145, 125, NULL, 125, NULL, NULL, 1, 'La Piazza', 'CZE', 'la-piazza@email.cz', 'http://www.ristorante-lapiazza.cz', '602 202 882', '000', 'nám. Dr. E. Beneše 3/19', 'Liberec', '406 01', NULL, 32, '50.76958130', '15.05750750', NULL, NULL, NULL, '000', '000', '000', '0000', 'Italská restaurace', 'Naší hlavní prioritou je Vaše spokojenost. Proto Vám náš vyškolený personál nabízí jen ta nejlepší jídla a nápoje. K profesionálnímu přístupu přidáváme příjemnou atmosféru naší restaurace a příznivé ceny. Věříme, že u nás budete vždy spokojeni a budete se k nám rádi vracet.\n\nV případě jakýchkoliv dotazů nás neváhejte kontaktovat.\n\n\n\nVíce zde: http://www.ristorante-lapiazza.cz/o-nas/', '2017-03-14 07:11:43', '2017-03-14 07:14:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1400.00', '15.00', 9, b'1'),
(94, 146, 125, 125, 125, NULL, NULL, 3, 'Coffee U2B', 'CZE', 'coffeeu2b@gmail.com', 'https://www.facebook.com/pg/CoffeeU2B/about/?ref=page_internal', '603 849 171', '000', 'Na Poříčí 116/5', 'Liberec', '460 01', NULL, 32, '50.76816790', '15.05504200', NULL, NULL, NULL, '000', '000', '000', '0000', 'Parkování: Ulice a parkoviště  Speciality Nabídka: snídaně, káva a nápoje  Služby Přijímá rezervace Vítáme i zákazníky bez rezervace Vhodné pro skupiny Jídlo s sebou', 'Coffee U dvou buchet s vlastní výrobou domácích koláčů, závinů, cheesecaků i buchet plněných domácí marmeládou. Vychutnejte si parky, vejce, sladké i slané palačinky s domácím karamelem, čokoládou, marmeládou, burákovým máslem nebo mascarponém. Připravíme Vám i řecký jogurt s čerstvým ovocem, zapečené ciabatty, tousty, chleby s domácími pomazánkami. To vše si můžete dopřát s čerstvě mletou kávou, pestrou nabídkou ovocných smoothie, freshů a vín. Nabídka je tvořena sezónním ovocem. Celé moučníky je možné připravit i na objednávku. Zákazník může v klidu vychutnávat kávu a přitom přes prodejní pult sledovat přípravu nabízených výrobků.', '2017-03-14 07:41:51', '2017-03-14 07:43:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1000.00', '19.00', 11, b'1'),
(95, 153, 290, NULL, 199, NULL, NULL, 1, 'U Fasurů', 'CZE', 'pohostinstviufasuru@seznam.cz', 'www.ufasuru.unas.cz', '+420 724 462 212', '+420 724 462 21', 'Pavlíkova 81/72', 'Ořechov (Brno-venkov)', '664 44', NULL, 5, '49.11088340', '16.52338520', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'denně 2 menu, soukromé akce, veřejné akce, sportovní přenosy', 'Přibližně 16km jižně od Brna se nachází obec Ořechov, ve které naší restauraci najdete.\n\nNacházíme se u hlavního tahu vedoucího obcí, několik desítek metrů pod dominantním ořechovským kostelem.\n\nNavštivte nás a poobědvejte v restauraci s příjemnou tradiční atmosférou.', '2017-03-16 18:41:31', '2017-03-23 18:29:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1200.00', '14.00', 9, b'1'),
(96, 154, NULL, NULL, NULL, NULL, NULL, 9, 'Bistro Široká', 'CZE', 'tomasfoltyn@gmail.com', 'https://www.facebook.com/Bistro-%C5%A0irok%C3%A1-172402829818060/', '777 670 844', '000', 'Široká 14', 'Liberec', '460 01', 'Široká 164/14, Nové Město, 460 01 Liberec, Česko', NULL, '50.76807400', '15.05444130', NULL, NULL, NULL, '000', '0000', '000', '0000', 'rodinná atmosféra a prostředí, menu, večírky, oslavy, setkání', 'Naše bistro se zaměřuje nejen na dobré jídlo, pití i kávu, ale také na atmosféru. Na možnost setkání u "rodinného" stolu a stolování s tím spojené.\\Místo, kde Vám bude dobře a budete se zde scházet s přáteli, rodinou... Nabízíme denní nabídku jídel, ale rádi Vám zajistíme občerstvení na nejrůznější akce. Poskytneme příjemný prostor pro večírky, večeře, oslavy, setkání...Stačí se jen domluvit.', '2017-03-18 05:03:46', '2017-03-18 05:03:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1200.00', '18.00', 8, b'1'),
(97, 155, 125, 125, 125, NULL, NULL, 1, 'Studánecký medvěd', 'CZE', 'krecek.pa@seznam.cz', 'http://studaneckymedved.cz/', '605 218 042', '000', 'Hejnická 77', 'Liberec', '460 01', NULL, 32, '50.80976770', '15.03572400', NULL, NULL, NULL, '000', '000', '000', '0000', 'domácí jídlo, kofola, skvělá obsluha', 'Znám jednu Krásnou Studánku, kde kofola jen teče. Jídlo jako na zámku tu kuchař denně peče.\n\nNa medvědí mňamky, k tomu palačinku, zván jsi do Studánky k obědu i na svačinku.\n\nVždy příjemné prostředí se zahrádkou ,ohněm. Zve kolektiv medvědí, s tvojí chutí pohnem.', '2017-03-18 06:43:40', '2017-03-18 06:45:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1200.00', '15.00', 8, b'1'),
(98, 156, 125, NULL, 125, NULL, NULL, 1, 'Ánanda', 'CZE', 'ananda@anandaline.cz', 'http://www.anandaline.cz/', '485 103 741', '000', 'Frýdlantská 210/12', 'Liberec', '460 01', NULL, 32, '50.77068430', '15.05721810', NULL, NULL, NULL, '000', '000', '0000', '0000', 'Vegetariánská restaurace, nekuřácká, zdravá a chutná strava!', '53 míst k sezení\n  nekuřácká restaurace\n  bezbariérový přístup\n  salátový bar, teplá jídla, studený bufet\n  prodej produktů zdravé výživy\n  příjímáme stravenky Sodexo, Ticket a Le Cheque\n \n\n  od 17,30 do 18,00 je 50% sleva na teplá jídla a saláty\n  příprava jídel podle zásad zdravé výživy\n  rychlá obsluha, úspora času\n  kombinace bufetového a samoobslužného prodeje\n  příprava rautů\n \n\n  originální interiér, přírodní dřevo, živé květiny, vodotrysk\n  pravidelná prezentace výtvarníků na stěnách restaurace\n  doprovodné akce zaměřené na témata zdravého životního stylu\n  časopisy o vegetariánství, Bionoviny apod.\n  možnost přečíst si denní tisk\n \n \nZásady pro zdravou restauraci\nANO:\njen čerstvé a BIO potraviny\novocné a zeleninové saláty, čerstvé džusy\nopomíjené obiloviny a luštěniny\npůvodní pšenice našich předků – špalda\npoužíváme slunečnicový olej a čerstvé máslo\nsladíme přírodním cukrem\ndesítky druhů koření\nzapomenutá jídla našich babiček\njídla národů celého světa\nnejlepším nápojem je voda\ndobrá nálada, pozitivní myšlení\n\n \n\nNE:\n\nmaso a vejce\nmražené a konzervované potraviny a polotovary\nvícekrát ohřívaná jídla\nmikrovlnné trouby\npřeslazené a podchlazené nápoje\nalkohol, cigarety\nnebezpečná Éčka a chemické látky\ngeneticky upravované potraviny\nstres, negativita\n\n \n\nVegetariánská strava\nVegetariánská restaurace Ánanda byla založena v roce 2003 a jejím hlavním cílem je představit alternativní způsob stravování. Prezentovat skutečnost, že i bezmasé pokrmy, připravené dle určitých zásad, mohou chutnat výtečně. Stravovací návyky v naší společnosti jsou totiž právě v oblasti spotřeby masných produktů nepřiměřené, a následky z toho plynoucí mohou být pro lidský život velmi nepříjemné.\n\n \n\nNěkolik důvodů pro omezení spotřeby masa:\n\ntýrání zvířat ve velkochovech, při transportech a na jatkách\nnekvalitní, vystresované maso se zbytky antibiotik a hormonů\nnadměrné zatěžování trávicího traktu a celého organismu člověka vede častěji k civilizačním chorobám,\nobdělávání 50% půdy pro výrobu krmných směsí = 2x více zbytkových pesticidů a hnojiv v potravinovém řetězci, negativní vliv na přírodní ekosystémy,\nskrytá cena masa - např. množství rostlinné stravy pro zvířata v USA by stačilo k nasycení poloviny světové populace,\nplýtvání energií a přírodními zdroji při výrobě a zpracování masa\nnadměrné zabíjení živých tvorů.\n \n\nDalší aktivity restaurace\nObčas v prostorách restaurace, ale zejména v Centru životního stylu, které je v patře nad restaurací jsou dále prezentovány a podporovány další aktivity pro zdravý životní styl a práci na sobě. Jedná se např. o irisdiagnostickou poradnu, koncerty alternativní hudby, výuku jazyků, cvičení jógy, kurzy malování, meditace, masáže a další sebezdokonalovací techniky.', '2017-03-18 06:50:51', '2017-03-18 06:52:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1900.00', '19.00', 12, b'1'),
