(101, 159, 126, 126, 199, NULL, NULL, 1, 'Restaurace V Ruthadce', 'CZE', 'vruthardce@seznam.cz', 'http://www.v-ruthardce.cz/101', '607286298', '739 013 510', 'Dačického nám. 15', 'Kutná Hora', '284 01', NULL, 31, '49.94810530', '15.26667270', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'teplá jídla, 120 míst, historický dům, zahrada, prostor pro děti, psi vítáni', 'Stylová středověká restaurace V Ruthardce si Vás dovoluje pozvat na oběd, večeři či posezení s přáteli. V letních měsících můžete strávit příjemné chvíle na zahrádce s jedinečným výhledem, která je oázou klidu v centru Kutné Hory a v zimě se ohřát u krbu nebo pozorovat padající vločky z nové zimní zahrady.', '2017-03-20 08:07:32', '2017-03-23 16:42:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1200.00', '17.00', 5, b'1'),
