(103, 161, 126, 126, 199, NULL, NULL, 1, 'Restaurace U Kata', 'CZE', 'restaurace@ukata.cz', 'http://www.ukata.cz', '327515096', '+420 321 406 09', 'Uhelná 596', 'Kutná Hora', '28401', NULL, 31, '49.94942300', '15.27416500', NULL, NULL, NULL, '13722271', 'CZ5707131859', '115-2579350227', '0100', 'středvěká krčma, uzavřené akce, zahradní posezení, vystoupení kejklířů, gastronomické akce', 'Romantické večeře, místo pro firemní a rodinné oslavy či pestré sezónní gastro akce? Hotelová restaurace U kata - gastronomie na úrovni!', '2017-03-20 13:07:30', '2017-03-23 18:55:16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '15.00', 6, b'1'),
(104, 162, 126, 126, 199, NULL, NULL, 1, 'Restaurace U Růže', 'CZE', 'restaurace@hotelruze.cz', 'http://www.ruzehotel.com/', '327314692', '327314692', 'Zámecká 52', 'Kutná Hora', '284 03', NULL, 31, '49.96123530', '15.28862880', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'hotel, zahrádka, gril, dobové vybavení', 'Vyhlášená a oblíbená kutnohorská restaurace hotelu U Růže nabízí kvalitní české a mezinárodní speciality, ale také oblíbené tradiční pokrmy.\n\nŠéfkuchař denně připravuje bohatou denní polední nabídku jídel a velmi často obměňuje stálý jídelní lístek jednak podle sezónnosti, dostupnosti místních surovin a tradičních krajových a svátkových jídel.', '2017-03-20 13:14:41', '2017-03-25 19:36:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1400.00', '11.00', 12, b'1'),
(105, 163, 126, 126, 152, NULL, NULL, 1, 'Restaurace Rybářská Bašta', 'CZE', 'rybniksveceny@seznam.cz', 'http://svecenyrybnik.cz', '602559833', '602559833', 'Černíny 44', 'Černíny - Kutná Hora', '284 01', NULL, 31, '49.84001640', '15.21883060', NULL, NULL, NULL, '0', '0', '0', '0000', 'stylová restaurace, terasa s výhledem na celý rybník, posezení přímo u vodní plochy', 'Na břehu rybníka pro váš komfort bylo v letošním roce dostavěno zděné rybářské centrum v podobě moderně vybavené Rybářské bašty. Součástí stylové restaurace s dostatečnou kapacitou je prostorná terasa s výhledem na cely rybník a venkovním posezením přímo u vodní plochy, vybavené grily na selátka i ryby a udírnou.', '2017-03-20 13:24:00', '2017-04-11 08:35:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1000.00', '13.00', 7, b'1'),
(106, 164, 126, 126, 199, NULL, NULL, 1, 'Restaurace Mlýn Danemark', 'CZE', 'restaurace@danemark.cz', 'www.danemark.cz', '720976195', '720976195', 'Po Mlýnech 82', 'Kutná Hora', '284 01', NULL, 31, '49.92822290', '15.25219760', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'hotel, lokální suroviny, francouzská vína', 'Restaurace hotelu Mlýn Danemark využívá sezonních, pokud možno lokálně pěstovaných surovin. Přesto však čas od času vyrážíme ochutnat to nejlepší, co nám okolní svět nabízí, a necháváme se našimi zkušenostmi z cest po světě inspirovat. Jednoduchost, kvalita a zdroj potravin jsou hlavními tématy našeho vaření. Na vinném lístku naleznete převážně francouzská vína a šampaňské. Snídaně, obědy a večeře jsou podávány nejrůznějšími způsoby. Restaurace se nachází přímo v našem obývacím pokoji. Zájemcům, kteří nejsou hosty našeho hotelu, doporučujeme předchozí rezervaci', '2017-03-20 13:32:27', '2017-03-25 19:30:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '18.00', 6, b'1'),
(107, 165, 126, 126, 199, NULL, NULL, 4, 'Pizzerie U Šneka Pohodáře', 'CZE', 'info@usneka.cz', 'www.usneka.cz', '327515987', '327515987', 'Vladislavova 333', 'Kutná Hora', '284 01', NULL, 31, '49.95037540', '15.26923280', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'restaurace, free WiFi', 'Rádi vám dovezeme veškerá jídla z našeho jídelníčku po celé Kutné Hoře ZDARMA.', '2017-03-20 13:45:30', '2017-03-25 19:21:54', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1500.00', '12.00', 9, b'1'),
(108, 166, 126, 126, 199, NULL, NULL, 1, 'Barbora Restaurant', 'CZE', 'restaurace@penzionbarbora.cz', 'www.penzionbarbora.cz', '327316327', '327316327', 'Kremnická 909', 'Kutná Hora', '284 01', NULL, 31, '49.94571810', '15.26238980', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'penzion, zdravá výživa, dětský koute, venkovní posezení', 'Restaurace penzionu Barbora je zaměřena na přípravu odlehčené české a mezinárodní gastronomie, jejímž výsledkem je jednoduchost s kombinací kvalitních ingrediencí bez přidávání dochucovacích aditiv . Přípravě pokrmů je věnována maximální péče, použité suroviny  pochází převážně od českých zemědělců.', '2017-03-20 13:51:21', '2017-03-25 19:15:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1900.00', '12.00', 9, b'1'),
(109, 167, 126, 126, 199, NULL, NULL, 11, 'Dobrá čajovna Kutná Hora', 'CZE', 'hora@tea.cz', 'http://www.dckh.cz/', '777028481', '777028481', 'Havlíčkovo náměstí 84/7', 'Kutná Hora', '284 01', NULL, 31, '49.94860130', '15.26775620', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'bez alkoholu, vodní dýmky, venkovní posezení', 'Jsme první lihuprostý podnik v Kutné Hoře. Nyní i s vegetariánskou kuchyní. Máme prostory pro cca 50 lidí, rozdělené dle potřeb a požadavků našich hostů. Máme samozřejmě i oddělené salonky pro kuřáky vodních dýmek, krásná sklepení, či malebnou zahrádku...těšíme se na Vás.', '2017-03-20 13:55:58', '2017-03-25 19:05:49', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1100.00', '11.00', 10, b'1'),
(110, 168, 126, 126, 199, NULL, NULL, 1, 'Staročeská námořní restaurace Kréta', 'CZE', 'restauracekreta@kral.cz', 'www.kral.cz', '327512405', '327512405', 'Kollárova 311', 'Kutná Hora', '284 01', NULL, 31, '49.95038370', '15.26742560', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'nekuřácká restaurace', 'Součástí hotelu Kréta je také útulná restaurace s českou i mezinárodní kuchyní. Všechny prostory jsou nekuřácké. Restaurace je vybavena velkou místností, která je vhodná pro různé druhy oslav a podnikových večírků i sledování sportovních zápasů na velkoplošné obrazovce. V celé budově je zdarma k dispozici Wi-Fi připojení.', '2017-03-20 14:00:13', '2017-03-25 19:01:10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1000.00', '10.00', 5, b'1'),
(111, 169, 126, 126, 199, NULL, NULL, 1, 'Restaurant Hotelu Zlatá Stoupa', 'CZE', 'info@zlatastoupa.cz', 'www.zlatastoupa.cz', '327511540', '327511540', 'Tylova 426/25', 'Kutná Hora', '284 01', NULL, 31, '49.94892200', '15.27228180', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'ubytování, nejlepší steaky', 'Proč lidé chodí za těmi nejkřehčími steaky právě do naší restaurace? Kutná Hora totiž nenabízí jiný podnik, kde si můžete dopřát poctivý steak z perfektně vyzrálého masa. Rozhodli jsme se být první, protože věříme, že na některých věcech se zkrátka nikdy nemá šetřit.\n\nAle o tom se bohužel nedá psát. To musíte zažít.', '2017-03-20 14:04:22', '2017-03-25 18:52:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1300.00', '10.00', 13, b'1'),
