(113, 171, 126, 126, 199, NULL, NULL, 2, 'Barborská Cocktail Bar', 'CZE', 'jiri.vavricka@gmail.com', 'http://barborska.wz.cz/uvod.htm', '605039697', '605039697', 'Barborská ulice 35', 'Kutná Hora', '284 01', NULL, 31, '49.94800530', '15.26561080', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'cocktail', 'Hned při vstupu, na levé straně, Vás mohou zaujmout černobílé fotky našich nejvěrnějších hostů, kteří si opravdu plní na sto procent, někteří i více.\n\nBar se nachází v přední části, kde se také všechno odehrává, vaří, připravuje, experimentuje a provádí i jiné kousky, které patří k barmanství.\n\nV zadních prostorách se nachází odpončinková část baru pro ty hodně unavené s klidným dvorkem, na kterém se bohužel nic neděje.', '2017-03-20 14:14:54', '2017-03-30 10:25:16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1400.00', '10.00', 5, b'1'),
(114, 172, 126, 126, 199, NULL, NULL, 4, 'Pizzerie Bowling Kutná Hora', 'CZE', 'langrova.bowling@seznam.cz', 'http://www.bowlingkutnahora.cz', '774 972 797', '774 972 797', 'Hrnčířská 235', 'Kutná Hora', '284 01', NULL, 31, '49.95786700', '15.28456070', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'bowling, zahrádka, WiFi, dětský koutek, bezbariérový přístup', 'Vlastní bezplatné parkoviště v areálu bowlingového centra\n    Ideální poloha na rozhraní Kutnohorska a Kolínska\n    Bezbariérový přístup\n    8 profesionálních bowlingových drah pro širokou veřejnost i sportovní bowling\n    Z toho 4 dráhy s dětskými mantinely i pro ty nejmenší\n    Skvělé pizzy a další speciality\n    Výborná točená piva od pivovaru Plzeňský Prazdroj\n    Atraktivní moderní interiér\n    Letní zahrádku\n    Hřiště na rekreační beachvolejbal\n    Dětský koutek\n    Wi-Fi\n    Přípravu i vlastní organizaci vašeho bowlingového turnaje\n    A k tomu vhodný raut či občerstvení na míru\n    Ke každému klientovi individuální přístup dle jeho požadavků', '2017-03-20 14:20:55', '2017-03-25 18:11:54', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1900.00', '12.00', 10, b'1'),
