(121, 179, 126, 126, 199, NULL, NULL, 1, 'U Matěje', 'CZE', 'veckerpavel.pv@gmail.com', 'http://www.u-mateje.com', 'veckerpavel.pv@gmail.com', '777287278', 'Václavské náměstí 4', 'Kutná Hora', '284 01', NULL, 31, '49.95065090', '15.26699090', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'steak house, dětské hřiště, gril, koktejly', 'Přijďte si odpočinout od každodenního shonu a dát si pořádný steak nebo jen tak posedět s přáteli nad kávou či dobrým vínkem. Steak house v Kutné Hoře s dětským hřištěm a domácí nabídkou grilovaných specialit Vás bude bavit. Na baru pro Vás budeme připravovat koktejly a kávové speciality.  Příjemné prostředí, rozumné ceny a profesionální personál, to vše dopomáhá k Vaší stoprocentní spokojenosti. Těsíme se na Vaši návštěvu.', '2017-03-20 19:15:31', '2017-03-24 17:52:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1800.00', '11.00', 5, b'1'),
