(123, 181, 126, 126, 199, NULL, NULL, 4, 'Pizzeria Sole Mio', 'CZE', 'solemio@solemio.cz', 'www.solemio.cz/', '327515505', '327515505', 'Česká 184', 'Kutná Hora', '284 01', NULL, 31, '49.94997520', '15.26543190', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'soukromé akce, rozvoz', 'Restaurant  Sole mio byl založen v roce 1998. Najdete ho v centru Kutné Hory,na Václavském náměstí,v těsné blízkosti významné kutnohorské pamětihodnosti, Kamenného domu.\n\nKapacita 50 míst, klimatizované prostředí.\n\nSoučástí prostor je také sklep,který je využíván jako samostatný salónek pro 25 osob.\n\nNabízíme Vám velký výběr kuřecích, vepřových a hovězích minutek, těstovin, pizzy a salátů.', '2017-03-20 19:29:14', '2017-03-24 12:51:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1300.00', '15.00', 14, b'1'),
