(127, 185, 126, 126, 199, NULL, NULL, 1, 'Restaurace Hruškovna', 'CZE', 'info@hruskovna.cz', 'http://www.hruskovna.cz/', '775100070', '775100070', 'Husova 18/61', 'Kutná Hora', '284 01', NULL, 31, '49.94839410', '15.26175040', NULL, NULL, NULL, '71253394', '0', '115-2579350227', '0100', 'nekuřácká restaurace, gastronomické akce, 4 až 6 hlavních jídel denně, bezbariérový přístup, psi vítáni, platba stravenkou', 'Hruškovna je český hostinec s čistým nekuřáckým prostředím v Kutné Hoře, nedaleko chrámu Sv. Barbory a historického centra města.\n\nČepovanému plzeňskému pivu věnujeme tu nejlepší možnou péči, vaříme z čerstvých a kvalitních surovin a Vaše spokojenost je pro nás na prvním místě.\n\nPravidelně pořádáme různé zábavné i gastronomické akce - informace najdete přímo u nás v hostinci nebo na našem Facebooku. Zaparkovat můžete na našem vlastním parkovišti nebo veřejném, které je v bezprostřední blízkosti.', '2017-03-21 13:33:23', '2017-03-24 12:05:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '12.00', 11, b'1'),
(128, 186, 126, 126, 199, NULL, NULL, 1, 'Restaurace Stará Fara', 'CZE', 'dolezalek@starafara.cz', 'www.starafara.cz', '327514403', '327514403', 'Jiřího z Poděbrad 290', 'Kutná Hora', '284 01', NULL, 31, '49.95215230', '15.26965200', NULL, NULL, NULL, '14785960', 'CZ530619137', '115-2579350227', '0100', 'stravování skupin, památková zóna', 'Restaurace Stará fara Kutná Hora\n\n    kapacita 140 míst\n    stravování skupin\n    autobusové parkoviště 30 m\n\nNaše restaurace s celkovou kapacitou 140 míst je ideální zastávkou pro větší turistické skupiny. Již řadu let úspěšně spolupracujeme s významnými světovými cestovními kancelářemi a agenturami. V naší restauraci se mohou stravovat pouze skupiny, nevěnujeme se pasantnímu provozu.\nProvozní doba dle objednávek.', '2017-03-21 13:36:26', '2017-03-24 11:52:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1100.00', '13.00', 5, b'1'),
