(130, 188, 126, 126, 199, NULL, NULL, 1, 'Havířská Bouda', 'CZE', 'info@havirskabouda.cz', 'http://havirskabouda.cz/', '725998989', '725998989', 'Sedlec 35', 'Kutná Hora', '285 03', NULL, 31, '0.00000000', '0.00000000', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'restaurace, turistický penzion, děti vítány, soukromé akce', 'Na tradici z let dávno minulých navazuje znovuobnovená výletní restaurace Havířská Bouda. Návštěvníci tu naleznou nejen stylový interiér a vynikající kuchyni, ale při zvláštních příležitostech mohou i zakusit atmosféru luxusní romantické večeře, vysoko nad rozzářeným městem, ve večerní vyhlídkové restauraci na vrchu rozhledny. Milovníky pohybu jistě potěší půjčovna kol, postupně přibude i dětské hřiště, zvířecí koutek a hornický koutek pro děti malé i větší.', '2017-03-21 13:47:21', '2017-03-24 10:32:33', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '14.00', 6, b'1'),
(131, 189, 126, 126, 199, NULL, NULL, 4, 'Ristorante – Pizzeria Piazza Navona', 'CZE', 'info@piazzanavona.cz', 'http://www.piazzanavona.cz/', '327512588', '327512588', 'Palackého náměstí 90', 'Kutná Hora', '284 01', NULL, 31, '49.94915730', '15.26886500', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'italská kuchyně', 'Veškeré pizzy jsou připravovány dle italských receptur - jediných původních:\n\n    s přirodním rajským protlakem\n    jsou tvrdší a tenčí než imitace "pizz" které se dělají v Čechách\n    KETCHUP NEVEDEME\n\nNabízíme italskou kuchyni, těstoviny, saláty, mořské plody.', '2017-03-21 13:51:43', '2017-03-24 10:19:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '13.00', 8, b'1'),
