(134, 192, 126, 126, 199, NULL, NULL, 10, 'Cukrárna U Kamila', 'CZE', 'marcela.hruskova@comhal.cz', 'http://www.kutnohorska-cukrarna.cz/', '776490038', '602 224 226', 'Komenského nám. 76', 'Kutná Hora', '284 01', NULL, 31, '49.94877210', '15.26666610', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'vlastní výroba', 'Všechny dorty, zákusky, dorty a zmrzliny jsou naší vlastní výroby. Smetanové zmrzliny vyrábíme teplou cestou /pasterizace/, ovocné zmrzliny vyrábíme z ovocného pyré nebo pouze z rozmixovaného ovoce tzv. 100% zmrzliny.\n\nDorty vyrábíme z živočišné šlehačky bez přidaných rostlinných tuků, práškových náhražek nebo mražených polotovarů. Recepty, nad kterými jsme strávili dlouhé hodiny, vždy obsahují něco výjimečného.\n\nNabízíme dorty na zakázku, mini dortíky, perníčky, macarons - makaronky, cake pops - lízátka, cookies - sušenky, cupcakes, které lahodí nejen Vaší chuti, ale i Vašemu oku a zanechají krásnou chuťovou vzpomínku!', '2017-03-21 14:09:58', '2017-03-24 09:10:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1600.00', '15.00', 13, b'1'),
(135, 193, 126, 126, 199, NULL, NULL, 1, 'Scharlota Bar', 'CZE', 'scharlotakh@seznam.cz', 'https://www.facebook.com/Scharlota-Bar-Kutn%C3%A1-Hora-277810782269320/', '776045450', '776045450', 'Kollárova', 'Kutná Hora', '284 01', NULL, 31, '49.95004790', '15.26761630', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'kavárna, restaurace, mezinárodní kuchyně, soukromé akce', 'SCHARLOTA jako taková vznikla 1. 4. 1999. Původně jsme začali jen jako malá kavárna se zmrzlinou, se vší skromností nabídnout našim hostům co nejlepší servis. A i tak, jako roste malé děcko, začali jsme postupně růst i my. Rozšíření kavárny o restauraci vyplynulo s přáním Vás zákazníků. Touha po točeném, správně oroseném pivečku byla výzvou! A tak šel čas a jsme tu my – KAVÁRNA A RESTAURACE SCHARLOTA, která i po těch 16ti letech neztratila pevnou půdu pod nohama a díky našim hostům mohla vyrůst do té největší krásy.', '2017-03-21 14:13:25', '2017-03-24 08:48:53', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1500.00', '13.00', 14, b'1'),
(136, 194, 126, 126, 199, NULL, NULL, 3, 'Kavárna Blues Kafé', 'CZE', 'cd.lokomotiva@seznam.cz', 'http://www.blues-cafe.net/', '602438634', '602438634', 'Jakubská 562', 'Kutná Hora', '284 01', NULL, 31, '49.94860910', '15.26728070', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'drobné občerstvení, bluesová hudba,', 'Jsme netradiční kavárna v srdci Kutné Hory, hned vedle kostela sv. Jakuba. Nabízíme Vám kvalitní kávu a drobné občerstvení (domácí polévky, čerstvé bagety atd). Též domácí jablečný závin, jak ke kávě nebo k dobrému čaji. Posezení u nás Vám zpříjemní bluesová hudba. Navíc si můžete mezitím vybírat z naší nabídky cd a vinylových desek!', '2017-03-21 15:29:36', '2017-03-23 20:20:33', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1900.00', '15.00', 13, b'1'),
(137, 195, 126, 126, 199, NULL, NULL, 3, 'Kavárna U starého kocoura', 'CZE', 'info@kavarna-kutnahora.cz', 'http://www.kavarna-kutnahora.cz/', '777 077 102', '777 077 102', 'Kollárova 309/14', 'Kutná Hora', '28401', NULL, 31, '49.95059740', '15.26719420', NULL, NULL, NULL, '26777134', 'CZ26777134', '115-2579350227', '0100', 'WiFi, nekuřácká kavárna, venkovní posezení', 'Vítejte v naši nekuřácké kavárně s cukrárnou v centru Kutné Hory. U nás můžete posedět v příjemném prostředí s možností venkovního posezení. Máme pro vás připraveny různé druhy dezertů, kávy, koktejlů a dalších nápojů. Těšíme se na Vaši návštěvu!', '2017-03-21 15:33:53', '2017-03-23 20:07:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1000.00', '17.00', 10, b'1'),
(138, 196, 126, 126, 199, NULL, NULL, 3, 'CAFÉ HAVLÍČEK PENZION', 'CZE', 'info@cafehavlicek.cz', 'http://www.cafehavlicekpenzion.cz/', '723 561 530', '608 646 245', 'Havlíčkovo náměstí 572', 'Kutná Hora', '28401', NULL, 31, '49.94875290', '15.26867200', NULL, NULL, NULL, '71259121', '0', '115-2579350227', '0100', 'rodinná kavárna, kvalitní káva, historická budova', 'Café Havlíček je rodinná kavárna, která se nachází v památkově chráněné budově přímo v centru historické Kutné Hory, v bezprostřední blízkosti Vlašského dvora a kostela sv. Jakuba.\n\nNabízíme čerstvě praženou kávu Brasil Santos Lajinha (100% Arabica) od pražské pražírny Mammacoffee. Jedná se o klasickou brazilskou kávu z horské oblasti v okolí města Lajinha v Minas Gerais, s chutí lískových oříšků a podchutí nugátu. Dále nabízíme sypané čaje či kakao, které jsou stejně jako káva z fairtrade produkce.\n\nV nabídce jsou také ledové kávy, domácí limonády, vína a lahvová piva a u nás pečené sladkosti.', '2017-03-21 16:30:45', '2017-03-23 19:11:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1600.00', '17.00', 12, b'1'),
(140, 198, 126, 126, 199, NULL, NULL, 3, 'Café 21', 'CZE', 'j.kuzelova@seznam.cz', 'https://cs-cz.facebook.com/Caf%C3%A9-21-188274308183173/', '607858845', '607858845', 'Komenského náměstí 40/21', 'Kutná Hora', '284 01', NULL, 31, '49.94833900', '15.26527710', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'kavárna, zákusky, hudební produkce, WiFi', 'Jestli se vám zrovna nebude chtít povídat, máme WiFi. Můžete se u nás učit nebo pracovat. Heslo vám řekneme na baru.', '2017-03-21 18:23:15', '2017-03-23 19:22:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1200.00', '19.00', 14, b'1'),
