(142, 202, 152, 152, 152, NULL, NULL, 1, 'Restaurace Na Kovárně', 'CZE', 'polakpa@volny.cz', 'http://gastro-booking.com/index.html#/app/restaurant/142', '+420 603 268 266', '+420 603 268 26', 'Plemenářský podnik 190', 'Pardubice - Nemošice', '530 03', NULL, 44, '50.00752870', '15.80801880', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'restaurace, kavárna, zahrádka', 'Restaurace Na Kovárně v Nemošicích u Pardubic.', '2017-03-22 10:40:24', '2017-03-22 10:47:49', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1300.00', '19.00', 12, b'1'),
(143, 203, 152, 152, 152, NULL, NULL, 1, 'Restaurace Budvarka', 'CZE', 'budvarkapce@seznam.cz', 'http://www.budvarka.ic.cz', '777 600 606', NULL, 'Jana Zajíce 982', 'Pardubice', '530 12', NULL, 44, '50.04386630', '15.80874280', NULL, NULL, NULL, '0', '0', '0000', '0000', 'Restaurace a pivnice Budvarka', 'Vážení hosté,\n\nrádi Vás přivítáme v naší restauraci Budvarka na Dubině v Pardubicích. Máme otevřeno každý den od 10.00 hodin. Stavte se ochutnat novinky z jídelního  lístku. Vaříme pro vás do 21.00\n\nPřejeme příjemné posezení a dobrou náladu\n\n \n\nZveme Vás také do herny Hramat klub - otevřeno NONSTOP!', '2017-03-22 12:32:47', '2017-03-22 12:38:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1200.00', '14.00', 8, b'1'),
(144, 204, 152, 152, 152, NULL, NULL, 1, 'Motel Železné Hory Kojice', 'CZE', 'info@motelzeleznehory.cz', 'http://www.motelzeleznehory.cz', '+420 603 497 889', NULL, 'Chvaletice', 'Chvaletice', '533 12', NULL, 44, '50.03443230', '15.41846200', NULL, NULL, NULL, '0', '0', '0000', '0000', 'Formanka s barem, velký sál s jevištěm a samostatným barem,venkovní domeček se samostatným barem,venkovní stan s grilem', 'V naší restauraci si najde místo k sezení přes 84 hostů. Formanka s barem má kapacitu 36 míst a nekuřácký salonek 48 míst. Kulináři jistě ocení českou kuchyň s denní nabídkou hotových jídel, minutkovou kuchyň a v neposlední řadě nabídku studené kuchyně s dobrotami zejména k pivu.\n\nPro pořádání společenských a kulturních akcí je pro naše hosty připraven velký sál s jevištěm a samostatným barem , který má kapacitu 120 míst a samostatně oddělitelné přísálí, které má kapacitu 50 míst.\n\nSál je kompletně ozvučen, našim hostům umožňuje využívat přístup na internet, projektor nebo satelitní televizní kanály.\nNašim hostům můžeme dále nabídnout venkovní domeček se samostatným barem a kapacitou 12 míst. V domečku je možnost připojení k internetu a sledování televize. Pro návštěvníky, kteří chtějí strávit pobyt na čerstvém vzduchu máme připraven venkovní stan s grilem a kapacitou 15 míst.', '2017-03-22 12:54:29', '2017-03-22 12:59:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1100.00', '18.00', 12, b'1'),
(145, 205, 152, 152, 152, NULL, NULL, 1, 'Restaurace U Jiřího', 'CZE', 'restaurace.ujiriho@seznam.cz', 'http://www.restauraceujiriho.cz', '+ 420 605 155 900', NULL, 'Masarykovo nám. 24', 'Přelouč', '535 01', NULL, 44, '50.03904630', '15.56043250', NULL, NULL, NULL, '0', '0', '0000', '0000', 'Restaurace s tradicí od roku 1992', 'Restaurace U Jiřího - obědy, večeře, pivo Pilsner Urquell, Staropramen, dovoz jídel.', '2017-03-22 13:36:35', '2017-03-22 13:53:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1200.00', '14.00', 7, b'1'),
(146, 206, 126, 126, 152, NULL, NULL, 1, 'Bistro a Grill "Sotto Ponte', 'CZE', 'sottoponte@centrum.cz', 'http://sottoponte.com/', '777765690', NULL, 'Pražská 62', 'Poděbrady', '290 01', NULL, 40, '50.14196910', '15.11707760', NULL, NULL, NULL, '0', '0', '0', '0000', 'interiér, salónek, bistro a gill, pohodové posezení', 'Kořeny našeho moderního bistra sahají až do roku 2008, kdy jsme na pravém břehu řeky Labe poprvé otevřeli rodinnou italskou restauraci. V roce 2016 na základech právě této restaurace vznikl originální koncept Bistro & Grill Sotto Ponte. Uvnitř vás okouzlí osobitý industriální interiér s odděleným salónkem, který můžete využít pro firemní či soukromé akce, nebo jen pro pohodové posezení s přáteli při sledování sportovních událostí. Bistro disponuje také prostornou terasou s příjemným výhledem na Labe. Těšíme se na návštěvu.', '2017-03-22 13:37:26', '2017-04-12 04:03:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1600.00', '18.00', 7, b'1'),
(147, 207, 126, 126, 152, NULL, NULL, 1, 'Restaurace Obora', 'CZE', 'restaurace.obora@seznam.cz', 'http://www.restauraceobora.cz/', '325 610 289', NULL, 'Obora 32', 'Poděbrady', '290 01', NULL, 40, '50.13755450', '15.10380110', NULL, NULL, NULL, '0', '0', '0', '0000', 'poctivé a kvalitní jídlo, krytá terasa, parkovací možnosti', 'NEZTRÁCEJTE VOLNÝ ČAS VAŘENÍM, PŘIJĎTE DO OBORY…\n\nNabízíme: \n\n    poctivé a kvalitní jídlo z čerstvých surovin\n    denní menu za zvýhodněnou cenu\n    oázu klidu v prostředí lesoparku u Labské cyklostezky\n    krytou terasu se zahrádku a venkovním barem\n    vynikající parkovací možnosti\n    dětský koutek pro naše nejmenší návštěvníky\n    pořádání firemních akcí, večírků, rodinných oslav…\n    restauraci přátelskou k domácím mazlíčkům\n    WIFI free\n    separátní salonek pro 8 osob', '2017-03-22 13:41:42', '2017-04-12 03:55:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1100.00', '16.00', 9, b'1'),
(148, 208, 126, 126, NULL, NULL, NULL, 1, 'Restaurace La MAMMA Cucina', 'CZE', 'info@lamamma.cz', 'http://lamamma.cz/', '734201101', NULL, 'Nám. T.G.Masaryka 895/7', 'Poděbrady', '290 01', NULL, 40, '50.14756530', '15.12108850', NULL, NULL, NULL, '0', '0', '0', '0000', 'čerstvost používaných surovin, vyvážená nabídka jídel, variace mořské plody', 'Při přípravě pokrmů je nejdůležitější čerstvost používaných surovin. V restauraci la MAMMA Cucina proto vaříme ze sezónních potravin z velké části dostupných u lokálních dodavatelů, které si pečlivě vybíráme. V aktuálním menu naleznete vyváženou nabídku jídel od vždy čerstvých domácích těstovin přes masa až po variaci mořských plodů. Těšíme se na vaši návštěvu.', '2017-03-22 13:45:45', '2017-04-12 03:51:06', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1000.00', '17.00', 10, b'1'),
(149, 209, 126, 126, 152, NULL, NULL, 1, 'Restaurace v Pivovaře', 'CZE', 'restauracevpivovare@seznam.cz', 'http://restauracevpivovare.cz/', '776383498', NULL, 'Husova 24', 'Poděbrady', '290 01', NULL, 40, '50.14396350', '15.11520030', NULL, NULL, NULL, '0', '0', '0', '0000', 'stylová restaurace, music bikers bar, poděbradský zdroj', 'Nabízíme posezení ve stylové restauraci s kapacitou 280 míst, s bezbariérovým vstupem, venkovní terasou, zahrádkou s výhledem na Labe, vnitřním krbem,dětským koutkem a vlastním parkovištěm. Je zde možnost pořádání velkých akcí jako jsou rauty, svatby, firemní večírky, koncerty apod. Na malé soukromé večírky a akce s menším počtem osob se skvěle hodí naše stylová vinárna s kapacitou cca 40 míst.', '2017-03-22 13:49:00', '2017-04-12 03:42:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1000.00', '18.00', 13, b'1'),
(151, 211, 126, 126, 152, NULL, NULL, 1, 'Lovas & Lovas', 'CZE', 'info@lovas.cz', 'www.lovas.cz', '325611533', NULL, 'Husova 537/II', 'Poděbrady', '290 01', NULL, 40, '50.14909840', '15.11051910', NULL, NULL, NULL, '61632635', 'CZ7410310798', '0', '0000', 'rodinná restaurace, speciality, restaurace s pensionem', 'Vážení hosté\n\nPřijďte si vychutnat atmosféru naší rodinné restaurace Lovas & Lovas v Poděbradech. V našem menu naleznete výběr specialit převážně jižanských kuchyní, ale také i čerstvé ryby, steaky,domácí těstoviny nebo lehké saláty.\nŠéfkuchař\n\nGarentem dobrého jídla je šéfkuchař pan Marek Lovětinský, který společně se svým bratrem Michalem každý den osobně dohlížejí na kvalitu servírovaných jídel a poskytovaného servisu.', '2017-03-22 14:03:52', '2017-04-12 03:34:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1600.00', '17.00', 13, b'1'),
(152, 212, 126, 126, 152, NULL, NULL, 1, 'Restaurace Labská Marína', 'CZE', 'labska-marina@seznam.cz', 'http://www.labska-marina.cz/', '736 787 088', '733538967', 'U Nové vodárny 1457', 'Poděbrady', '290 01', NULL, 40, '50.13970700', '15.13555700', NULL, 'Labská Marína', NULL, '0', '0', '0', '0000', 'restaurace a přístaviště Labská Marína, české ryby, česká kuchyň', 'Restaurace a přístaviště Labská Marína je otevřena od ledna roku 2012. Našim hostům nabízíme možnost kotvení lodí či ubytování v našem penzionu od srpna 2017. Součástí restaurace, která je zaměřena na čerstvé ryby a českou kuchyň, je i antukový tenisový kurt, venkovní gril a udírna, nekuřácká zimní zahrada s krbem, dětské hřiště, posezení na mole přímo u řeky Labe či na zahrádce restaurace, která má kapacitu cca 120 míst. Možnost pořádání svateb, večírků a oslav k různým příležitostem. Bližší informace a Vaše dotazy Vám rádi zodpovíme na naší e-mailové adrese či telefonu. Těšíme se na viděnou!', '2017-03-22 14:15:24', '2017-04-16 06:24:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '16.00', 6, b'1'),
