(154, 214, 126, 126, 152, NULL, NULL, 1, 'Restaurace Basta fidli', 'CZE', 'info@art-hotel.cz', 'art-hotel.cz', '325532920', NULL, 'Tyršova 236/II.', 'Poděbrady', '290 01', NULL, 40, '50.14627430', '15.12378690', NULL, NULL, NULL, '49650149', '0', '0', '0000', 'česká kuchyně, moravská vína, hotel s restaurací', 'Hotelová restaurace nabízí speciality české kuchyně ve spojení s moravskými víny a plzeňským Prazdrojem. Veškerá jídla vznikají ve spolupráci s našimi, pokud možno regionálními dodavateli, z čerstvých a kvalitních surovin. Na stůl dostanete chutné a kvalitní české jídlo bez jakýchkoliv náhražek.', '2017-03-22 14:21:22', '2017-04-12 03:11:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1500.00', '19.00', 14, b'1'),
