(156, 216, 126, 126, 152, NULL, NULL, 1, 'Restaurant Zlaté Časy', 'CZE', 'hotel@hotelgolfi.cz', 'hotelgolfi.cz', '325615073', NULL, 'Na Kopečku 595', 'Poděbrady', '290 01', NULL, 40, '50.14056840', '15.12441410', NULL, NULL, NULL, '0', '0', '0', '0000', 'příjemná komorní atmosfére, lobby bar, salónek, terasa', 'Naše restaurace „Zlaté časy“ si Vás získá pro svou příjemnou komorní atmosféru, kterou podtrhuje kolekce fotografií golfistů z let 1934 - 1936. Restaurace disponuje kapacitou 50 míst, dále lobby barem s 18ti místy. Při větší společnosti lze prostor spojit s přilehlým salónkem. V létě můžete strávit slunečné odpoledne nebo klidný večer na naší terase s romantickým výhledem.', '2017-03-22 14:46:47', '2017-04-12 03:02:42', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1100.00', '18.00', 11, b'1'),
