(158, 218, 126, 126, 152, NULL, NULL, 1, 'Restaurace Na Střelnici', 'CZE', 'penzion@na-strelnici.cz', 'http://www.na-strelnici.cz/', '737174359', NULL, 'Za Vodárenskou věží 1278', 'Poděbrady', '290 01', NULL, 40, '0.00000000', '0.00000000', NULL, NULL, NULL, '0', '0', '0', '0000', 'dobré jídlo, kvalitní gastronomie, restaurace s penzionem', 'Restaurace Na Střelnici je ideálním místem pro milovníky dobrého jídla a kvalitní gastronomie.\n\nV kouzelném prostředí, přímo na břehu Labe, připravují zkušení kuchaři se svým týmem to nejlepší z české a evropské kuchyně.\n\nDenně čerstvé pokrmy z lokálních surovin od malých\n\nfarmářů z okolí doplňuje pečlivě sestavený vinný lístek.\n\n Na restauraci navazuje rozsáhlá zahrádka s dětským koutkem plná prolézaček a houpaček, kterou ocení nejenom rodiny s dětmi.', '2017-03-22 14:56:46', '2017-04-12 02:13:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1900.00', '15.00', 12, b'1'),
(159, 219, 126, 126, 152, NULL, NULL, 1, 'Restaurant & Café Felicitas', 'CZE', 'gastro@laznefelicitas.cz', 'laznefelicitas.cz', '325605200', NULL, 'Nám. T. G. Masaryka 1437/III.', 'Poděbrady', '290 01', NULL, 40, '0.00000000', '0.00000000', NULL, NULL, NULL, '0', '0', '0', '0000', 'moderní restaurace s kavárnou, letní terasa, gastronomické akce', 'Moderní restaurace s kavárnou, letní terasou a kapacitou až 80 osob se nachází v přízemí hotelu a je otevřena denně od 7:00 do 22:00 hodin. Nabízíme mezinárodní kuchyni a širokou nabídku vín z celého světa.\n\nRestaurace je vhodným prostorem pro pořádání rautů, svateb, rodinných oslav či firemních večeří.', '2017-03-22 14:59:32', '2017-04-12 01:55:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1000.00', '10.00', 7, b'1'),
(160, 220, 126, 126, 152, NULL, NULL, 10, 'Cukrárna U Reinvaldů', 'CZE', 'cukrarnaureinvaldu@seznam.cz', 'http://www.cukrarna-ureinvaldu.cz', '325 615 143', NULL, 'nám.Jiřího č.8', 'Poděbrady', '290 01', NULL, 40, '50.87446470', '14.57412260', NULL, NULL, NULL, '0', '0', '0', '0000', 'cukrárna', 'Cukrárna "U Reinvaldů" je jedno z mála míst,které v Poděbradech přetrvává již od r.1938,to je bezmála 80 let od chvíle,kdy Emanuel Reinvald založil cukrářskou výrobnu.Přes všechny změny se vždy výrobna zachovala.V nepříliš dobrém stavu si ji naše rodina převzala před 19 lety a od té doby se stále snažíme zlepšovat kvalitu našich výrobků,dodržovat staré poctivé receptury a přitom držet krok s dobou a přinášet našim zákazníkům i světové novinky a trendy v cukrařině,tak aby Vám chutnalo dnes, tak jako kdysi chutnalo zákazníkům pana Reinvalda.Věříme,že je to na práci našeho dlouholetého cukrářského týmu a výběru kvalitních surovin poznat.Přijdte k nám do cukrárny "U Reinvaldů" a Váš mlsný jazýček ať se o tom přesvědčí sám.\n\nTěšíme se na Vás', '2017-03-22 15:04:15', '2017-04-11 11:10:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1500.00', '12.00', 12, b'1'),
(161, 221, 126, 126, 152, NULL, NULL, 1, 'Café-restaurant penzion Villa A. Málka', 'CZE', 'info@vilaamalka.cz', 'http://www.vilaamalka.cz/', '739996181', NULL, 'Palachova 221/7', 'Poděbrady', '290 01', NULL, 40, '50.14634750', '15.11836340', NULL, NULL, NULL, '0', '0', '0', '0000', 'restaurace, ubytování, wellness, výlety do okolí', 'Nabízíme ubytování se snídaní ve dvoulůžkových pokojích s možností přistýlky a v apartmá, v centru města, s možností parkování v objektu.', '2017-03-22 15:07:29', '2017-04-11 10:57:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '15.00', 14, b'1'),
(162, 222, 126, 126, 152, NULL, NULL, 1, 'Jihočeská restaurace - Hotel Soudek', 'CZE', 'info@hotelsoudek.cz', 'hotelsoudek.cz', '325613191', NULL, 'Palackého 174', 'Poděbrady', '290 01', NULL, 40, '50.14214410', '15.12187980', NULL, NULL, NULL, '0', '0', '0', '0000', 'hotel, poděbrady, ubytování, restaurace', 'V naší Jihočeské restauraci vám nabídneme výbornou krajovou kuchyni, minutková jídla, nebo specialitky našich mistrů kuchařů. Po dobrém jídle vám žízeň uhasí světoznámé pivo „Budvar“ a pro milovníky vín máme skvělá moravská vína z Valtic.', '2017-03-22 15:12:44', '2017-04-11 10:51:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1400.00', '18.00', 13, b'1'),
