(165, 225, 126, 126, 152, NULL, NULL, 1, 'Golf Club Poděbrady', 'CZE', 'office@golfpodebrady.cz', 'http://www.golfpodebrady.cz/restaurace/', '325613262', NULL, 'Na Zálesí 530', 'Poděbrady', '290 01', NULL, 40, '50.13812690', '15.14441440', NULL, NULL, NULL, '0', '0', '0', '0000', 'osmnáctijamkové mistrovské hřiště, restaurace, kavárna', 'Restaurace a kavárna se nacházejí v exkluzivních prostorách vstupní haly, která je architektonickým skvostem v rondokubistickém stylu. K dispozici je přilehlý salonek pro 45 osob. Veškeré prostory byly v roce 2015 rekonstruovány.\n\nKompletní cateringové služby\nCelodenní provoz pro veřejnost\nCatering běhěm golfových turnajů\nFiremní akce a prezentace\nSvatby\nŠkolení\nVenkovní terasa s grilem\nRozvoz občerstvení po hřišti', '2017-03-22 15:30:05', '2017-04-11 10:15:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1800.00', '18.00', 12, b'1'),
(166, 226, 126, 126, 152, NULL, NULL, 1, 'Pivnice U Čiháků', 'CZE', 'ludekcihak@gmail.com', 'http://gastro-booking.com/#/app/pivniceucihaku', '605296044', NULL, 'Jiráskova 163/3', 'Poděbrady', '290 01', NULL, 40, '50.14396710', '15.12340480', NULL, NULL, NULL, '0', '0', '0', '0000', 'pivnice', 'Provoz pivotéky. Čepuje se zde 6 druhů piv, velké množství ostatních značek piva k dostání v lahvovém provedení.', '2017-03-22 15:33:27', '2017-04-11 10:05:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '13.00', 9, b'1'),
(167, 227, 126, 126, 152, NULL, NULL, 1, 'Restaurace Motorest Senice', 'CZE', 'info@motorest-senice.cz', 'http://www.motorest-senice.cz/', '325511645', NULL, 'Hlavní 37', 'Senice', '290 01', NULL, 40, '50.18367690', '15.20712180', NULL, NULL, NULL, '0', '0', '0', '0000', 'MOTOREST SENICE - nekuřácká restaurace, motorest,hotová jídla, hotovky, minutky', 'Náš rodinný motorest provozujeme od měsíce září roku 2002. Naším hlavním cílem je kvalitní, tradiční česká kuchyně a naší specialitou jsou bramboráky, které pro Vás připravujeme dle rodinné receptury s různými druhy náplní.\n\nTyto bramboráky připravujeme přímo pro Vás, až na základě Vaší objednávky. Proto jsou vždy čerstvé, voňavé, křupavé a zlatavé.\n\nPro ty z Vás, kteří nejsou milovníky zlatavých bramborových placek, máme vždy připravenou širokou nabídku jídel, od klasických hotovek, minutkových specialit až po lehké i vegetariánské pokrmy.', '2017-03-22 15:36:49', '2017-04-11 09:51:42', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1400.00', '19.00', 7, b'1'),
(168, 228, 126, 126, 152, NULL, NULL, 1, 'Tuze-extra Music Caffé and Lounge Bar', 'CZE', 'tuzexcaffe@gmail.com', 'http://www.tuze-ex.cz/', '601346013', NULL, 'Jiřího náměstí 3/7', 'Poděbrady', '290 01', NULL, 40, '50.14188650', '15.11786290', NULL, NULL, NULL, '275 36 947', '0', '0', '0000', 'design baru, terasanejstylovější podnik Poděbrad', 'Tuze-ex… caffé&cocktail bar nacházející se přímo na Jiřího náměstí a je jedním z nejstylovějších podniků města Poděbrad. Tento podnik, do kterého rádi zavítají místní, osobnosti, ale i cizinci je podnikem pulzující životem s dlouhým seznamem výborných alkoholický i nealkoholický koktejlů, kvalitní kávou a pestrou nabídkou vín.', '2017-03-22 15:40:34', '2017-04-11 09:24:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1900.00', '16.00', 11, b'1'),
