(170, 230, 126, 126, 199, NULL, NULL, 1, 'Restaurace Klíček', 'CZE', 'info@restauraceklicek.cz', 'http://restauraceklicek.cz/', '727984638', '727984638', 'Husova 62/22', 'Poděbrady', '290 01', NULL, 40, '50.14383510', '15.11532600', NULL, NULL, NULL, '03286045', 'CZ8908081083', '115-2579350227', '0100', 'zdravá výživa', 'Přijďte si zdravě pochutnat a dopřát Vašemu tělu to nejlepší. Nabízíme výběr ze dvou teplých jídel, polévky, saláty, celozrnné pizzy, dezerty a další zdravé doplňky. Vaříme z kvalitních surovin bez „éček“ a ostatních aditiv, pro odlehčení organismu, získání více energie a také vhodnou pro vegetariány a makrobiotiky.\nMimo zdravých pokrmů nabízíme možnost zajímavého vzdělávaní, máte příležitost se zúčastnit kurzů vaření, přednášek, seminářů a výživového poradenství a to vždy se zajímavými hosty.', '2017-03-22 15:48:26', '2017-03-26 16:56:24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1600.00', '17.00', 13, b'1'),
(171, 231, 126, 126, 199, NULL, NULL, 3, 'Kavárna Kafíčko', 'CZE', 'enkamertova@seznam.cz', 'http://kaficko.net/', '776736774', '776736774', 'Na Valech 445', 'Poděbrady', '290 01', NULL, 40, '50.14339920', '15.11804430', NULL, NULL, NULL, '24819433', 'CZ24819433', '115-2579350227', '0100', 'kávové speciality', 'Vítejte na „Kafíčku“ …\n\n… v roce 1997 jsme v Poděbradech ve Fügnerově ulici otevřeli za pomoci přátel „Kafíčko“… od té doby pro Vás stále budujeme něco nového … nyní i na Praze 1 v Truhlářské ulici jsme pro Vás připravili výjimečnou a osobní atmosféru pro milovníky kávy, hudby, umění a posezení s přáteli … proto jsme tu pro Vás od pondělí do neděle … v případě kávových specialit prosíme o strpení, některé vyžadují delší čas na přípravu … děkujeme za pochopení a přejeme příjemné posezení … nezdráhejte se použít naši knihu přání a stížností … Žádáme naše hosty, aby v Kafíčku omezili používání mobilních telefonů …\n\nDěkujeme za návštěvu, s úctou Vaše Kafíčko', '2017-03-22 17:35:09', '2017-03-26 16:46:42', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1400.00', '19.00', 7, b'1'),
(172, 232, 126, 126, 199, NULL, NULL, 1, 'Restaurant Bílá Růže', 'CZE', 'info@bila-ruze.cz', 'http://www.bila-ruze.cz/', '325 616 350', '325 616 350', 'Pražská 16', 'Poděbrady', '29001', NULL, 40, '50.14226470', '15.11674270', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'ubytování, soukromé akce', 'Hotel svou kapacitou nabízí ubytování pro 26 hostů. Restaurační provoz sestává z formanky (40 míst), restaurace (33 míst), salónku (8 míst) a sálu (58 míst), v teplém období roku také z předzahrádky s kapacitou 65 míst k sezení. Tyto prostory poskytujeme taktéž pro firemní školení, svatební a různorodé rodinné oslavy. Pravidelně pořádáme kulinářské a taneční večery se živou muzikou jako například Svatomartinské, zvěřinové či vepřové hody. Nově hotel umožňuje taktéž bezbariérový přístup.', '2017-03-22 17:39:03', '2017-03-26 16:37:29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1200.00', '15.00', 14, b'1'),
(173, 233, 126, 126, 199, NULL, NULL, 3, 'Kavárna Na Zámku', 'CZE', 'nazamku@seznam.cz', 'https://www.penzionnazamku.cz/zamecka-kavarna-na-zamku-podebrady', '325 612 505', '325 612 505', 'Jiřího náměstí 1/I', 'Poděbrady', '290 01', NULL, 40, '50.14271530', '15.11663440', NULL, NULL, NULL, '65740190', 'CZ7606151003', '115-2579350227', '0100', 'kultura. letní zahrádka, denní menu', 'Příjemná kavárna s atmosférou filmových hvězd a letní zahrádkou. Nabízí klidné posezení v areálu zámku s výhledem na první nádvoří a zámeckou zahradu. Můžete si zde zakoupit vstupenky do Divadla Na Kovárně a do Zámeckého biografu.\n\nV době konání akcí jako jsou různé trhy, divadelní představení, divadelní festival, Poděbradské dny poezie, filmový festival, přednášky v biografu či v kavárně samotné je otevírací doba tomu uzpůsobena.', '2017-03-22 17:42:52', '2017-03-26 16:31:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '18.00', 11, b'1'),
(174, 234, 126, 126, 199, NULL, NULL, 1, 'Na Kempu', 'CZE', 'klara222@me.com', 'http://www.na-kempu.cz/', '602330204', '602330204', 'U Nové vodárny 428', 'Poděbrady', '290 01', NULL, 40, '50.13970700', '15.13555700', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'autokemp, dětské hřiště, nekuřácký salonek, gastronmické akce', 'Restaurace se nachází v klidné části autokempu, proto je posezení na naší letní zahrádce uprostřed přírody tím pravým odpočinkem.\n\nNaším přáním je, abyste si pochutnali a rádi se k nám vraceli. Naše kuchyně je proto velmi rozmanitá, aby si vybral opravdu každý. Jídla jsou připravována s kvalitních surovin (maso z českého chovu, čerstvá zelenina). Denně také podáváme hotová jídla (10.30-15.00)\n\nVíce zde: http://www.na-kempu.cz/o-nas/', '2017-03-22 17:46:11', '2017-03-26 16:23:06', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1800.00', '19.00', 7, b'1'),
(175, 235, 126, 126, 199, NULL, NULL, 1, 'Jídelna a rozvoz Jiřka', 'CZE', 'info@jirka-racio.cz', 'http://www.jirka-racio.cz/', '325612154', '325612154', 'Havlíčkova 72', 'Poděbrady', '290 01', NULL, 40, '50.14271390', '15.12008690', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'zdravá výživa, rozvoz', 'Firmu JIŘKA jsme založily v roce 1992 s obrovským nadšením z přesvědčení, že pomocí výživy může každý z nás výrazně ovlivňovat své zdraví, vitalitu a kondici. Naše nabídka stravování pro zdraví je zaměřena nejen pro nadšence v tomto oboru, ale s porozuměním rádi poradíme každému, kdo chce nebo je nucen z různých důvodů své tradiční stravovací návyky usměrnit.\nPřijďte a uvidíte', '2017-03-22 17:50:23', '2017-03-26 16:17:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1900.00', '10.00', 7, b'1'),
(176, 236, 126, 126, 199, NULL, NULL, 1, 'Restaurant Hotel Zámeček', 'CZE', 'kristynatocikova@lazne-podebrady.cz', 'https://www.lazne-podebrady.cz/hotel-zamecek', '325503300', '325503300', 'Husova 232/II', 'Poděbrady', '290 33', NULL, 40, '0.00000000', '0.00000000', NULL, NULL, NULL, '0', '0', '115-2579350227', '0100', 'ubytování', 'Modrý salonek. Jídlo, občerstvení, káva, pití', '2017-03-22 17:55:40', '2017-03-26 16:11:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1400.00', '12.00', 7, b'1'),
(177, 237, 126, 126, 199, NULL, NULL, 1, 'Bar Penzion Sport', 'CZE', 'info@penzionsport.info', 'www.penzionsport.info', '325610057', '325610057', 'Kolínská 236', 'Poděbrady', '290 01', NULL, 40, '50.12841410', '15.11492130', NULL, NULL, NULL, '69010935', '0', '115-2579350227', '0100', 'nekuřácká, letní zahrádka, sukromé akce', 'Pozvěte své blízké při příležitosti oslav a večírků na dobré pití a chutné pokrmy, využijte naši nekuřáckou restauraci s kapacitou vnitřních prostorů cca 25 míst pro uspořádání vlastních akcí. Večírek si můžete užít v interiéru restaurace s výjimečným pohledem na aktuální dění na tenisových kurtech, nebo v létě na naší letní zahrádce. Bude nám ctí Vás hostit!', '2017-03-22 18:00:07', '2017-03-26 15:48:06', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1900.00', '11.00', 11, b'1'),
(178, 238, 126, 126, 199, NULL, NULL, 1, 'Vespa Ristorante', 'CZE', 'ladamuller@seznam.cz', 'http://www.ristorantevespa.cz/178', '737340370', '+420 737 340 37', 'Karlovo nám. 72', 'Kolín', '280 02', NULL, 29, '50.02851900', '15.20189100', NULL, NULL, NULL, '28175379', '0', '115-2579350227', '0100', 'vespa, restaurace, itálie', 'Dovolte,abychom Vás pozvali do nové provozovny společnosti Pizzeria Ristorante Vyžlovka pod názvem Vespa Ristorante.\n\nJak název napovídá, restaurace a její interiér jsou ve stylu legendárního skútru Vespa, který je typický pro Itálii.\n\nPřijďte si užít italskou atmosféru, budeme se na Vás těšit!', '2017-03-22 18:18:06', '2017-03-22 18:43:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1900.00', '19.00', 13, b'1'),
(179, 239, 126, 126, 537, NULL, NULL, 1, 'Restaurace Villa Romantica', 'CZE', 'hotel@villaromantica.cz', 'www.villaromantica.cz', '321623844', '775402607', 'Zborovská 600', 'Kolín', '280 02', NULL, 29, '50.02971160', '15.18140880', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Kvalita, Čerstvost, Výborné jídlo, Terasa v zahradě', 'Nabízíme gastronomii v moderním pojetí a sledujeme trendy. Nemáme tedy nekonečně dlouhý jídelní lístek! Naši kuchaři vše připravují s důrazem na kvalitu a čerstvost. Menu se upravuje několikrát v roce, aby se využilo sezónní nabídky surovin.\nK výbornému jídlu máme připravena i výborná vína.\nRestaurace má kapacitu 50 míst a v letních měsících lze využít pro příjemné posezení terasu v zahradě pro 60 osob.', '2017-03-22 18:21:53', '2017-04-24 16:09:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1600.00', '15.00', 12, b'1'),
(180, 240, 126, 126, 537, NULL, NULL, 1, 'Hostinec U Tří pírek', 'CZE', 'lada@utripirek.cz', 'www.utripirek.cz', '605700715', '605700715', 'Karlovo náměstí 72', 'Kolín', '280 02', NULL, 29, '50.02872410', '15.20175450', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácký hostinec, 12 druhů točených piv', 'Jsme rodinný nekuřácký hostinec v srdci Kolína. Nabídneme Vám 12 druhů točených piv, převážně z malých pivovarů z okolí.\nMěníme naši nabídku jídel denně, výsledkem je poctivá domácí kuchyně z čerstvých surovin. Hostinec má pohodovou atmosféru a letní terasu s úchvatným výhledem na Labe.\nPřijďte nás navštívit!', '2017-03-22 18:25:10', '2017-04-24 16:13:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1200.00', '18.00', 9, b'1'),
(181, 241, 126, 126, 537, NULL, NULL, 1, 'Restaurant penzionu U Rabína', 'CZE', 'penzionurabina@seznam.cz', 'http://www.urabina.cz/restaurace.html', '321724463', '775402607', 'Karolíny Světlé 151', 'Kolín', '280 01', NULL, 29, '50.02762900', '15.19922600', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Nekuřácké restaurace, Příznivé ceny', 'Díky členitosti interiéru mámě dvě nezávislé nekuřácké restaurace s kapacitou 25 míst a 15 míst. \nZa příznivé ceny Vám rádi zpříjemníme oběd či večeři, posezení s přáteli, rodinou, při oslavě narozenin, svatby, výročí, podnikové večírky,\nale i další události. Z našeho bohatého výběru jídel si určitě vyberete.', '2017-03-22 18:29:49', '2017-04-24 16:18:10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1000.00', '14.00', 5, b'1'),
(182, 242, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Mefisto cafe', 'CZE', 'l.hrejsemnou@seznam.cz', 'https://www.facebook.com/mefistocafe/?fref=ts', '720337377', '720337377', 'Karolíny Světlé 139', 'Kolín', '280 02', NULL, 29, '50.02720120', '15.20056780', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Výborná káva, Letní zahrádka', 'Provoz kavárny. Nabízíme zde kávové speciality a koktejly. 150m od kavárny je přímo na náměstí naše letní zahrádka s kapacitou 40 míst. Prodáváme ledovou kávu, ledové jogurty, ledové čaje, 100% domácí limonády a další. V zimní sezoně můžeme nabídnout skvělou horkou čokoládu, svařené víno a různé zimní speciality.\nPro mlsné jazýčky můžeme poskytnout čerstvé dorty dle denní nabídky, zmrzlinový pohár, horké maliny nebo belgické vafle.', '2017-03-22 18:34:42', '2017-04-25 04:43:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1400.00', '17.00', 10, b'1'),
(183, 243, 126, 126, 199, NULL, NULL, 1, 'Lavande Restaurant Kolín', 'CZE', 'pkmanagement@volny.cz', 'http://gastro-booking.com/#/app/Lavande/183', '774251874', '774 251 874', 'Kouřimská 9/a', 'Kolín', '280 02', NULL, 29, '50.02754250', '15.20089940', NULL, NULL, NULL, '02056801', '0', '115-2579350227', '0100', 'vybraná vína, centrum města, čerstvé suroviny', 'Jsme nová restaurace v centru Kolína na jeho krásném a historickém náměstí v budově, která zde stojí již od 13. století. Zajímavostí je, že již v roce 1525 zde rodina Matrasů začala provozovat šenk. Chtěli bychom Vás získat nejen příjemnou atmosférou, ale i kvalitou svého menu, které je připraveno s láskou a jen z čerstvých surovin opravdovými odborníky. Pro milovníky vína nabízíme široký výběr moravských, francouzských, italských a španělských vín, kde je opravdu co ochutnat. Vynikající kávu pro Vás připraví školení baristé. Těšíme se na Vaši návštěvu a rádi bychom, abyste se u nás cítili skvěle, protože dobrá restaurace není jen ta, kde se dobře vaří, ale ta, kde se dobře cítíte...', '2017-03-22 18:39:28', '2017-03-22 18:54:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '15.00', 6, b'1'),
(184, 244, 126, 126, 537, NULL, NULL, 1, 'Restaurant & Café Bar Dolce Vita', 'CZE', 'info@restaurantdolcevita.cz', 'www.restaurantdolcevita.cz', '725596891', '725596891', 'Politických vězňů 44', 'Kolín', '280 02', NULL, 29, '50.02718510', '15.19840450', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace', 'Přijďte se příjemně naladit do NEKUŘÁCKÉ Restaurace & Café Baru DOLCE VITA, která se nachází na adrese Politických vězňů 44, Kolín (vedle Dopravního inspektorátu).', '2017-03-22 18:44:07', '2017-04-24 16:28:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1300.00', '12.00', 7, b'1'),
(185, 245, 126, 126, 537, NULL, NULL, 5, 'Pivnice Budvarka U Radnice', 'CZE', 'info@budvarka-kolin.cz', 'www.budvarka-kolin.cz', '725596891', '725596891', 'Zámecká 109', 'Kolín', '280 02', NULL, 29, '50.02880670', '15.20061160', NULL, 'Prime Catering s.r.o.', 'Starokolínská 287, Kolín 4', '03500667', 'CZ03500667', '115-2579350227', '0100', 'Kapacita 150 míst', 'Original restaurace - pivnice Budvarka U Radnice má kapacitu 150 míst a nachází se na jednom z nejvyhledávanějších míst společenského života Kolína, v přízemí městského společenského domu. Je vybudována podle konceptu Original restaurace - pivnice Budvarka, který vytvořil Budějovický Budvar. Dominantou pivnice je výčep z masivního dubu, mědi a mosazi. V restauraci Budvarka je kladen velký důraz na podávání kvalitně ošetřeného piva, a to především čepovaného. Na jídelním lístku najdete zejména jídla tradiční české kuchyně, pivní speciality, ale i zástupce kuchyně mezinárodní.', '2017-03-22 18:47:26', '2017-04-24 16:35:53', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1700.00', '11.00', 10, b'1'),
(186, 246, 126, 126, 537, NULL, NULL, 1, 'Česká Koruna', 'CZE', 'info@ceskakoruna.cz', 'www.ceskakoruna.eu', '777138133', '777138133', 'Slovenská 1040', 'Kolín', '280 02', NULL, 29, '50.02480410', '15.19160870', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Kvalitní služby, Spokojenost zákazníků', 'Orientuje se na klasickou českou kuchyni, která se vyznačuje specificky českými prvky, jako jsou houskové a bramborové knedlíky, omáčky. Nechybí zde ani kolena, tatarský biftek a úpravy masa na všechny způsoby, včetně grilování.\n \nK české kuchyni neodmyslitelně patří kvalitní české pivo, zastoupené ve značce  Pilsner Urquell, se kterou spolupracujeme od začátku naší firmy. V roce 2004 jsme se dostali do klubu přátel Plzeňského Prazdroje, kde jsme byli na 51 místě ve výtoči piva Prazdroj12º v celé ČR.\n \nKapacita restaurace 70 lidí včetně salonku, venkovní terasa po rekonstrukci nabídne posezení pro 100 našich návštěvníků. Na léto počítáme s pravidelnými akcemi , jako je grilování a pečení nejrůznějších dobrot.\n \nNově jsme pro kuřáky otevřeli BAR-CLUB KORUNA v 1.patře budovy s možností si zahrát POOL kulečník a šipky. Nabídka nápojů a jídel je srovnatelná s restaurací v přízemí.\n \nHlavním cílem firmy je poskytovat  kvalitní služby ke spokojenosti našich zákazníků, kteří se k nám vracejí.\n \nV oblasti tvorby cen, se snažíme udržet ceny na úrovni, která odpovídá kvalitě služeb.', '2017-03-22 18:51:50', '2017-04-24 16:42:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1600.00', '15.00', 6, b'1'),
(187, 247, 126, 126, 537, NULL, NULL, 1, 'Na Patnácti kopách', 'CZE', 'ahtisk@seznam.cz', 'www.restaurace15kop.cz', '774986866', '774986866', 'Polepská 387', 'Kolín', '280 02', NULL, 29, '50.01848650', '15.20760680', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Denní menu', 'Restaurace v Kolíně v ulici Polepská 387. Nabízí: extra salónek, nekuřácká část, parking, pořádání akcí, projektor, rozvoz jídel, TV, vstup se psy. Čepuje se Staropramen. (Restaurace nabízí v pracovní dny od 10:00 denní menu.)', '2017-03-22 19:02:36', '2017-04-24 16:46:27', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1600.00', '19.00', 11, b'1'),
(188, 248, 126, 126, 537, NULL, NULL, 1, 'Pizzerie Pizza Expres Kolín', 'CZE', 'info@pizzakolin.cz', 'www.pizzakolin.cz', '604111117', '604111117', 'Pražská 60', 'Kolín', '280 02', NULL, 29, '50.03000880', '15.18965740', NULL, 'HMT s.r.o.', 'Štíhlická 317, Vyžlovka', '28175379', 'CZ28175379', '115-2579350227', '0100', 'Italská amtosféra', 'Tato provozovna je hlavně zaměřena na rozvoz našich pizz a ostatních jídel po celém Kolíně a přilehlém okolí.\nSamotné prostory ale také nabízejí posezení, byť omezeného počtu hostů, kde si můžete vychutnat celý sortiment našich specialit.\nRozvozy jsou ale hlavní prioritou této provozovny a my se snažíme co nejrychleji přivézt veškeré dobroty až k Vám domů.\nBudeme se snažit zlepšovat naše služby, abyste byli spokojeni a nadále si u nás rádi objednávali.\n\nPrijďte si také užít italskou atmosféru do naší nové restaurace', '2017-03-22 19:07:56', '2017-04-24 16:50:16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1800.00', '15.00', 5, b'1'),
(189, 249, 126, 126, 537, NULL, NULL, 1, 'Zimní stadion Kolín', 'CZE', 'info@zimakkolin.cz', 'www.zimakkolin.cz', '722617200', '722617200', 'Brankovická 1289', 'Kolín', '280 02', NULL, 29, '50.03248490', '15.19941870', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Klasická česká kuchyně', 'Orientuje se na klasickou českou kuchyni, která se vyznačuje specificky českými prvky, jako jsou houskové a bramborové knedlíky, omáčky. Nechybí zde ani kolena, tatarský biftek a úpravy masa na všechny způsoby, včetně grilování. K české kuchyni neodmyslitelně patří kvalitní české pivo, zastoupené ve značce Pilsner Urquell, se kterou spolupracujeme od začátku naší firmy. V roce 2004 jsme se dostali do klubu přátel Plzeňského Prazdroje, kde jsme byli na 51 místě ve výtoči piva Prazdroj 120 v celé ČR.', '2017-03-22 19:11:04', '2017-04-24 16:55:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1200.00', '10.00', 9, b'1'),
(190, 250, 126, 126, 537, NULL, NULL, 1, 'Na Bezovce', 'CZE', 'r.urbach@seznam.cz', 'http://bezovka-vagon-cz.webnode.cz/', '773125396', '773125396', 'Jaselská 177', 'Kolín', '280 02', NULL, 29, '50.02319330', '15.20171630', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Salónek, Živá hudba', 'Nabízí teplá jídla, denní menu a alkoholické i nealkoholické nápoje. K dispozici je 120 míst a salonek pro 40 osob. Pořádají večery s živou hudbou', '2017-03-22 19:14:29', '2017-04-24 17:29:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1400.00', '10.00', 6, b'1'),
(191, 251, 126, 126, 537, NULL, NULL, 3, 'Kavárna Zahrádka Pod věží', 'CZE', 'prevence.stred@diakonie.cz', 'http://www.diakonie-stred.cz/nase-pracoviste/kolin/', '734809130', '734809130', 'Kouřimská 15', 'Kolín', '280 02', NULL, 29, '50.02681060', '15.20096900', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Lahodná káva, Chvíle klidu', 'S obsluhou i provozem kavárny pomáhají klienti s mentálním a kombinovaným handicapem - jedná se o součást pracovní terapie v rámci služby Sociálně terapeutické dílny.\nKromě lahodné kávy si v Kavárně můžete dopřát chvíli klidu v centru Kolína s krásným výhledem na chrám sv. Bartoloměje.', '2017-03-22 19:17:41', '2017-04-24 17:33:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1200.00', '11.00', 6, b'1'),
(192, 252, 126, 126, 537, NULL, NULL, 1, 'Hostinec U Černohlávků', 'CZE', 'info@ucernohlavku.cz', 'www.ucernohlavku.cz', '321 727 885', '777699214', 'Ovčárecká  146', 'Kolín', '282 02', NULL, 29, '50.04788066', '15.21889231', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Tradiční česká jídla, Domácí kvalita', 'Hostinec U Černohlávků najdete na předměstí Kolína části Sendražice. Naše pohostinství Vám nabízí tradiční česká jídla domácí kvality v době oběda. K dispozici naším hostům je lokál ( 40 míst), salonek s barem (50 míst), dále je k dispozici sál s tanečním parketem pro různé společenské akce. Dále nabízíme rozvoz hotových jídel po okolí.', '2017-03-22 19:22:28', '2017-04-24 17:36:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1300.00', '11.00', 11, b'1'),
(193, 253, 126, 126, NULL, NULL, NULL, 2, 'Bar Irish Pub', 'CZE', 'semily.cars@seznam.cz', 'https://www.facebook.com/Irish-Pub-Kol%C3%ADn-1557349041172373/', '776600621', '776600621', 'Zámecká 85', 'Kolín', '282 02', NULL, 29, '50.02875760', '15.19999600', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Irský styl', 'Noční bar v Irském stylu s dlouholetou tradicí, příznivými cenami a příjemnou obsluhou', '2017-03-22 19:27:46', '2017-04-24 17:39:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1900.00', '18.00', 10, b'1'),
(194, 254, 126, 126, 537, NULL, NULL, 1, 'Zlaté slunce', 'CZE', 'vera.tulkova@volny.cz', 'www.restaurace-zlateslunce.cz', '321 726 292', '777690150', 'Chocenice 22', 'Břežany I', '280 02', NULL, 29, '50.03936290', '15.10981810', NULL, 'Pavel Rajtr', 'Nádražní 142, Ostroměř', '67452582', 'CZ7312273199', '115-2579350227', '0100', 'Pestrá nabídka jídel, Rozvoz jídel', 'Příjemné posezení ve stylovém interiéru restaurace naleznete na trase Praha - Kolín (5 km od Kolína). \nKaždý den si vyberete z pestré nabídky jídel. Možnost jídel s sebou, rozvoz jídel dle dohody.\nČepujeme 12° Plzeňský Prazdroj.', '2017-03-22 19:32:38', '2017-04-24 17:44:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '10.00', 10, b'1'),
(195, 255, 126, 126, 537, NULL, NULL, 10, 'Cukrárna Slavie', 'CZE', 'slavickovadagmar@seznam.cz', 'https://www.facebook.com/Cukrárna-Slávie-141339102608648', '321722512', '775402607', 'Kouřimská 113', 'Kolín', '282 02', NULL, 29, '50.02654500', '15.20078550', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', '60 druhů zákusků a minizákusků', 'Nabízíme až 60 druhů zákusků a minizákusků, dorty všech druhů, svatební dorty, dětské dorty, dorty pro dospělé, jogurtové i tvarohové dorty. Přijímáme objednávky na svatby i jakékoliv akce.', '2017-03-22 19:37:08', '2017-04-24 17:49:41', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1500.00', '17.00', 7, b'1');
