(196, 256, 126, 126, 537, NULL, NULL, 3, 'Kavárna Café & Interier Tradice 1894', 'CZE', 'mail@tradice1894.cz', 'https://www.facebook.com/cafe.tradice/', '778001894', '778001894', 'Kouřimská 10', 'Kolín', '282 02', NULL, 29, '50.02737800', '15.20081330', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká kavárna', 'Nekuřácká kavárna v centru Kolína propojená s obchodem interiérových doplňků.', '2017-03-22 19:58:45', '2017-04-24 17:53:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '17.00', 8, b'1'),
(197, 257, 126, 126, 537, NULL, NULL, 1, 'U Tří Mouřenínů', 'CZE', 'rest@utrimoureninu.cz', 'www.utrimoureninu.cz', '321 715 225', '775402607', 'Karlovo náměstí 76', 'Kolín', '282 02', NULL, 29, '50.02860090', '15.20134980', NULL, 'DUCHIEL s.r.o.', 'U Hřiště 831, Kolín V', '24305626', 'CZ24305626', '115-2579350227', '0100', 'Rytířská restaurace, Historické sklepení', 'Útulné prostředí rytířské restaurace, která se nachází v historickém sklepení. Místnosti jsou dobře klimatizované pro letní období, ale zahřejí vás v zimních měsících. Večerní provoz v romantickém vinárenském stylu. Samozřejmostí je nekuřácký salonek.', '2017-03-22 20:02:44', '2017-04-24 17:59:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1200.00', '11.00', 5, b'1'),
(198, 258, 126, 126, 537, NULL, NULL, 2, 'Cafe Bar Monet', 'CZE', 'lenka.bechynova@centrum.cz', 'http://gastro-booking.com/#/app/cafebarmonet', '321721482', '775402607', 'Husova 48', 'Kolín', '282 02', NULL, 29, '50.02815230', '15.20228450', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Přátelská amtosféra, přijatelné ceny', 'Cafe Bar Monet je secesní kavárna s přátelskou atmosférou a příjemnými cenami. V letních měsících je k dispozici zahrádka.', '2017-03-22 20:08:30', '2017-04-24 18:04:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1300.00', '15.00', 11, b'1'),
(199, 259, 126, 126, 537, NULL, NULL, 1, 'Restaurace Vodní svět', 'CZE', 'vaclavvolny@seznam.cz', 'http://www.restaurace-vodni-svet.cz/restaurace', '724552520', '724552520', 'Masarykova 1041', 'Kolín', '282 02', NULL, 29, '50.02221800', '15.19406800', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Aquapark, nekuřácká, Pro rodiče s dětmi', 'Restaurace se nachází uvnitř Aquaparku, je celá nekuřácká a zaměřená na rodiče s dětmi, pro které je určen velký dětský koutek.\nRestaurace se dělí na dvě části: Restaurace s výhledem na bazén, kde je 70 míst k sezení a zastřešenou terasu s kapacitou 80 míst.\nJe zde možné pořádat různé kulturní akce, jako jsou firemní večírky, třídní srazy, svatby, dětské párty, vše s možností zapůjčení projekce. Nabízíme příjemné posezení, dobré jídlo a pití.', '2017-03-22 20:13:24', '2017-04-24 18:07:25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1100.00', '14.00', 10, b'1'),
(200, 260, 126, 126, 537, NULL, NULL, 9, 'Bistro Občerstvení Krmelec', 'CZE', 'lukas.kaninsky@seznam.cz', 'www.krmelec-kolin.cz', '774010210', '774010210', 'Na Hradbách 153', 'Kolín', '282 02', NULL, 29, '50.02791230', '15.19933780', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Rychlé občerstvení, Rozvoz jídla', 'Provoz nekuřáckého rychlého občerstvení. Nabízí zde burgery, bagety, tortilly, pitu, smažená jídla, saláty či kuřecí stripsy a plátky včetně nealkoholických nápojů a dresingů. Zajišťují i rozvoz jídla.', '2017-03-22 20:17:56', '2017-04-24 18:11:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1900.00', '10.00', 8, b'1'),
(201, 261, 126, 126, 537, NULL, NULL, 1, 'SPORTHOTEL RELAX', 'CZE', 'sporthotelrelax@seznam.cz', 'www.sporthotelrelax.cz', '321021705', '777779517', 'Veletov 106', 'Kolín', '282 02', NULL, 29, '50.03299470', '15.30471630', NULL, 'Mgr. Petr Šedina', 'Polepy 64', '48660795', 'CZ6409131179', '115-2579350227', '0100', 'Tradiční česká kuchyně, kontinentální snídaně', 'Pokud máte chuť na sklenku dobrého vína, tak navštivte hotelovou restauraci, která nabízí tradiční českou kuchyni a kontinentální snídaně. Součástí hotelové restaurace je bar a venkovní terasa. K dispozici je salonek s kapacitou 22 míst pro konání školení, seminářů (možnost zapůjčení multimediální projekce) a menších oslav. \nNově jsme pro Vás otevřeli salonek s kapacitou 50 osob vhodný pro pořádání rodinných oslav, menších svateb, rautů, firemních večírků apod.', '2017-03-22 20:58:28', '2017-04-24 18:15:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1900.00', '13.00', 5, b'1'),
(202, 262, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Červených', 'CZE', 'chumlen@centrum.cz', 'www.ucervenych.cz', '321720287', '608157257', 'Vávrova 286', 'Kolín', '282 02', NULL, 29, '50.02219820', '15.20560580', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Klimatizace, Zahradní posezení', 'Rozvoz poledního menu. Velkoplošná projekce, dataprojektor, plátno. Klimatizace. Zahradní posezení', '2017-03-22 21:04:35', '2017-04-24 18:19:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1700.00', '17.00', 12, b'1'),
(203, 263, 126, 126, 537, NULL, NULL, 1, 'Restaurant Harmonie', 'CZE', 'harmonie@kolin.cz', 'www.harmoniekolin.cz', '321712058', '608029852', 'Kmochova 569', 'Kolín', '282 02', NULL, 29, '50.02660682', '15.19690781', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Denní menu, Zimní zahrada', 'Příjemné posezení. Stravování po celý den. Denní menu 11:00 – 14:00. Nabídka jídel z klasické české kuchyně. Široký výběr specialit, ryb a drůbeže. Kapacita 140 míst. Zimní zahrada pro menší oslavy, narozeniny, podnikové večírky (20 míst).', '2017-03-22 21:07:37', '2017-04-24 18:24:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '17.00', 7, b'1'),
(204, 264, 126, 126, 537, NULL, NULL, 1, 'Taverna u Divadla', 'CZE', 'info@tavernaudivadla.cz', 'http://tavernaudivadla.cz/new/', '321712058', '775402607', 'Kutnohorská 51', 'Kolín', '280 02', NULL, 29, '50.02641597', '15.20654180', NULL, NULL, NULL, '775402607', NULL, '115-2579350227', '0100', 'Velký výběr jídel', 'Taverna u divadla nabízí sortiment pokrmů: z ryb, kuřecího, vepřového, hovězího a grilovaného masa, speciality české kuchyně, těstoviny, bezmasá jídla, saláty a dezerty. K dispozici je klimatizovaný salonek pro 24 osob. Na přání zákazníka je možnost rezervace salonku nebo prostory restaurace pro větší společnost. Na akce po domluvě připravují i rauty.', '2017-03-22 21:11:26', '2017-04-24 18:29:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '10.00', 9, b'1'),
(205, 265, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Lojzy', 'CZE', 'restauraceulojzy@seznam.cz', 'www.restauraceulojzy.webuje.cz', '603486501', '603486501', 'Okružní 485', 'Kolín', '282 02', NULL, 29, '50.03512520', '15.20216570', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá kuchyně', 'Provoz restaurace nabízející jídla teplé kuchyně.', '2017-03-22 21:16:38', '2017-04-25 06:17:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '16.00', 8, b'1'),
(206, 266, 126, 126, NULL, NULL, NULL, 1, 'Steak Land', 'CZE', 'info@steakland.cz', 'http://www.steakland.cz/restaurace', '321 693 211', '608283200', 'Na Hradbách 123', 'Kolín', '280 02', NULL, 29, '50.02805850', '15.19882860', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Steaky', 'Protože ke steakům a grilování neodmyslitelně patří železo a kámen, je interiér restaurace realizován v tomto stylu. Restaurace je stavebně oddělena na kuřáckou a nekuřáckou část a nabízí kapacitu až padesáti míst. \nPokud milujete maso, tak si určitě v naší pestré nabídce hovězích a vepřových steaků najdete svého favorita. Maso je vždy čerstvé a pochází z českých a jihoamerických chovů. Najdete zde i maso z chovů dobytka v USA. K dobrému masu samozřejmě patří i víno, naše nabídka Vás zaručeně potěší.', '2017-03-22 21:22:53', '2017-04-25 06:19:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1800.00', '12.00', 11, b'1'),
(207, 267, 126, 126, NULL, NULL, NULL, 5, 'Restaurace Na Sídlišti', 'CZE', 'eliska159@gmail.com', 'není', '605246216', '605246216', 'Benešova 644', 'Kolín', '282 02', NULL, 29, '50.02556710', '15.18678450', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Tanková pivnice', 'Tankovou pivnici s klasickou českou kuchyní nabídne restaurace Na sídlišti.', '2017-03-22 21:27:26', '2017-04-25 06:19:25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1800.00', '15.00', 8, b'1'),
(208, 268, 126, 126, 537, NULL, NULL, 1, 'Restaurant Hotelu Theresia', 'CZE', 'recepce@hoteltheresia.cz', 'www.hoteltheresia.cz', '321 711 117', '724681695', 'Na Petříně 991', 'Kolín', '282 02', NULL, 29, '50.03031090', '15.19053030', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Bohatá nabídka nápojů a pestrý jídelní lístek', 'Bohatá nabídka nápojů a pestrý jídelní lístek. Stavebně oddělené prostory pro kuřáky a nekuřáky. Restaurace - nekuřácká. Lobby bar - prostor pro kuřáky. Dostatečná kapacita umožňuje konání svateb, promocí nebo firemních akcí. Káva Dersut, sypané čaje Bioteaque. Wi-Fi internet zdarma, 2x televize.', '2017-03-22 21:31:09', '2017-04-30 17:51:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '11.00', 14, b'1'),
(209, 269, 126, 126, 537, NULL, NULL, 1, 'Restaurace Mona Lisa', 'CZE', 'r.hermanek@seznam.cz', 'nemá', '774494096', '280 02', 'Legerova 20', 'Kolín', '280 02', NULL, 29, '50.02591190', '15.20009780', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Pestrá nabídka jídel i nápojů', 'Příjemná stylová restaurace v Legerově ulici s pestrou nabídkou jídel i nápojů. Je možné zde uspořádat akce všeho druhu.', '2017-03-22 21:34:56', '2017-04-25 06:20:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1800.00', '11.00', 5, b'1'),
(210, 270, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Kučerů', 'CZE', 'simbek@seznam.cz', 'nemá', '608463836', '608463836', 'Jiráskovo nám. 12,', 'Kolín', '280 02', NULL, 29, '50.03044020', '15.20560410', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Česká kuchyně', 'Nabídka české kuchyně, točeného piva Bernard a vlastní kávy. Možnost pořádání rodinných oslav a společenských akcí. K dispozici je TV. Povolený vstup se psy.', '2017-03-22 21:42:10', '2017-04-25 06:34:41', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1600.00', '14.00', 9, b'1'),
(211, 271, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Pension Vigvam', 'CZE', 'petrbenisek@vigvam.cz', 'www.vigvamresort.cz', '606429568', '606429568', 'Němčice 152', 'Kolín', '280 02', NULL, 29, '50.08172490', '15.29658740', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Dětský koutek, Wifi', 'Stylová nekuřácká restaurace Vám nabízí kvalitní domácí kuchyni a příjemný personál, který Vám ochotně poradí s výběrem jídel. Součástí restaurace je i dětský koutek pro naše nejmenší hosty a místnost s přebalovacím pultem. Kapacita naší restaurace je 40 hostů, využít můžete i free WIFI.\nPokud plánujete menší rodinou oslavu nebo firemní večeři pro partnery, neváhejte využít našeho posezení u kulatého stolu. Pro tyto příležitosti Vám sestavíme speciální servírované menu.\nV letních měsících můžete využít venkovní posezení na terase s obsluhou. Pro děti je zde hřiště s pirátskou lodí a minizoo. Součástí areálu je i rozsáhlé parkoviště.\nPro veřejnost je restaurace otevřena od pátku do neděle. V týdnu je resort využíván firmami na konference, školení, meetingy apod.', '2017-03-22 21:46:50', '2017-04-25 06:21:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1900.00', '17.00', 5, b'1'),
(212, 272, 152, 152, 152, NULL, NULL, 1, 'Restaurace U Vojtěchů', 'CZE', 'info@uvojtechu.cz', 'http://uvojtechu.cz', '+ 420 466 654 434', NULL, 'Pod Lipami 24', 'Pardubice', '530 03', NULL, 44, '50.03556620', '15.80707480', NULL, NULL, NULL, '13178377', '0', '0000', '0000', 'bowling, kulečník, stolní fotbálek, šachy', 'Jde o typicky rodinný podnik s tradicí od roku 1924. Nacházíme se v klidné pardubické části Studánka. Obklopeni zelení se ocitnete na naší zahrádce s 50 místy. Po vstupu do restaurace, která je plně klimatizovaná najdete posezení pro 40 lidí a pro další hosty jsou tu dva salonky po 23 místech (k dispozici dětská židlička). Můžete si u nás zahrát ve vedlejším objektu bowling (2 dráhy), kulečník, stolní fotbal i posedět u sportovních přenosů promítaných na velkoplošné obrazovce. Možnost připojení k WiFi.\n\nKuchyň připravuje jak hotová jídla do 14:00 hod., tak i minutky od 14:00 hod. do 21:00 v neděli, pondělí a úterý, ostatní dny do 22:00.\n\n(Na naší provozovně používáme EET)', '2017-03-23 04:06:19', '2017-03-23 04:16:54', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1800.00', '17.00', 8, b'1'),
(213, 273, 152, 152, 152, NULL, NULL, 1, 'Restaurace - ubytování Přelouč', 'CZE', 'hotelvm@email.cz', 'http://www.hotelvmprelouc.cz', '+420 773 070 110', NULL, 'Dukelské nám. 269', 'Přelouč', '535 01', NULL, 44, '50.03941570', '15.57337160', NULL, NULL, NULL, '25290134', 'CZ25290134', '0000', '0000', 'Ubytování v hotelu s restaurací', 'Naše restaurace Vám nabízí širokou nabídku hotových jídel poctivé české kuchyně, samozřejmě denně čerstvě připravené. Dále nabízíme minutky z vepřového, hovězího, kuřecího a dalších druhů masa, ale také bezmasé pokrmy. Jistě uvítáte osobní přístup našeho personálu.\n\nKapacita našeho restauračního zařízení je cca 70 míst v restauraci a dalších cca 60 míst je k dispozici na letní zahrádce.', '2017-03-23 04:28:54', '2017-03-23 04:32:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1800.00', '19.00', 8, b'1'),
(214, 274, 152, 152, 152, NULL, NULL, 1, 'Restaurace Zahrada Chvaletice', 'CZE', 'petrsimek77@seznam.cz', 'https://www.facebook.com/Restaurace-Zahrada-Chvaletice-324200761122139', '702 027 905', NULL, 'V Telčicích 246', 'Chvaletice', '533 12', NULL, 44, '50.03547780', '15.42211110', NULL, NULL, NULL, '0', '0', '0000', '0000', 'Restaurace se zahradou.', 'Přijímáme rezervace s obsluhou\nVenkovní posezení', '2017-03-23 04:50:23', '2017-03-23 08:38:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1600.00', '13.00', 13, b'1'),
(215, 275, 152, 152, 538, NULL, NULL, 1, 'Penzion a restaurace Blatenský dvůr', 'CZE', 'blatenskydvur@seznam.cz', 'www.blatensky-dvur.cz', '722 230 723', '722 230 723', 'Blato 76', 'Mikulovice', '53002', NULL, 44, '49.99033700', '15.76495600', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'letní terasa, salonek, ubytování, večery s hudbou, příprava rautů', 'Penzion a restaurace Blatenský dvůr byl vybudován a otevřen v roce 2009 v obci Blato nacházející se v těsné blízkosti měst Pardubice a Chrudim. Jestliže hledáte místo, kde se můžete výborně najíst, něco řádně oslavit nebo třeba jen příjemně posedět, jistě oceníte služby naší nově otevřené stylové restaurace s dvěma letními terasami, příjemným personálem a kvalitní kuchyní. K dispozici jsou také salonky s kapacitou 30 míst, které si můžete rezervovat pro události jako jsou rodinná oslava, společenský raut, svatební hostina, malé plesy či firemní akce.', '2017-03-24 06:31:58', '2017-04-27 03:55:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1800.00', '14.00', 9, b'1'),
(216, 276, 125, 125, 125, NULL, NULL, 3, 'CrossCafe', 'CZE', 'ccprl@crosscafe.cz', 'https://www.crosscafe.cz/kavarny/prazska/', '778 435 950', '000', 'Pražská 11/13', 'Liberec', '460 07', NULL, 32, '50.76825150', '15.05731730', NULL, NULL, NULL, '000', '000', '000', '0000', 'káva, zásuvky, lampičky, pejsci vítáni, wifi', 'V kavárnách máme spoustu zásuvek, lampiček a samozřejmě wifi bez hesla. Můžete přijít se svým miláčkem - i tím čtyřnohým.\n\nPrvní kavárnu jsme otevřeli v roce 2007. Uplynulo téměř 10 let a nám se podařilo spustit dalších 20 kaváren. Nyní zlepšujeme den lidem v šesti městech ČR.\n\nZatímco se část populace staví proti používání slova pikolo v kavárenském prostředí, my jsme se rozhodli ho v kavárnách CrossCafe “legalizovat”. U nás ho každý může používat jako oficiální název pro espresso. Líbí se nám, když si člověk mele svou.', '2017-03-24 13:49:31', '2017-03-24 14:00:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '17.00', 5, b'1'),
(217, 277, 125, 125, 125, NULL, NULL, 2, 'Boca Bar Liberec', 'CZE', 'boca.bar.liberec@email.cz', 'https://www.facebook.com/pg/bocabarliberec/about/?ref=page_internal', '720 187 399', '000', 'Široká 34', 'Liberec', '460 07', NULL, 32, '50.76882200', '15.05300300', NULL, NULL, NULL, '000', '000', '000', '0000', 'koktejly, prémiový alkohol, soukromé a firemní večírky', 'Jsme koktejlový bar s širokou nabídkou koktejlů, ale i ostatního prémiového alkoholu. Je možné u nás pořádat jak soukromé, tak firemní večírky.\nPřijímá rezervace\nVítáme i zákazníky bez rezervace\nVhodné pro skupiny\nS obsluhou', '2017-03-24 14:29:40', '2017-03-24 14:30:44', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1300.00', '13.00', 8, b'1'),
(218, 278, 125, 125, 125, NULL, NULL, 1, 'La Bonaccia Pizza Ristorante', 'CZE', 'info@labonaccia.cz', 'http://www.labonaccia.cz/', '773 626 509', '000', 'Nad Slují 89', 'Liberec', '460 01', NULL, 32, '50.80551140', '15.06068910', NULL, NULL, NULL, '000', '000', '000', '0000', 'polévky, saláty, noky, špagety, ryby, maso, moučníky, nápoje a mnoho dalšího...', 'Malá rodinná restaurace na okraji Liberce, v příjemném prostředí se zahrádkou. Vhodné místo pro rodinné oslavy, svatby nebo jen setkání s přáteli. Posezení uvnitř i venku, příjemná obsluha a jídla jen z čerstvých surovin.\n\nSpecializujeme se na italskou kuchyni, pizzy připravujeme v klasické zděné peci na dřevě. Kromě nich vám můžeme nabídnout mnoho dalších dobrot:\n\npolévky\nsaláty\nnoky\nšpagety\nryby\nmaso\nmoučníky\nnápoje\na mnoho dalšího...\nLehké, zdravé, chutné a hlavně vždy čerstvé, to je základní myšlenka a úkol naší restaurace. Připravujeme pro vás speciality italské kuchyně vyrobené z těch nejkvalitnějších a pečlivě vybíraných surovin.', '2017-03-24 14:33:25', '2017-03-24 14:35:54', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '10.00', 8, b'1'),
(219, 279, 125, 125, 125, NULL, NULL, 2, 'Top Star Dance Club Bar', 'CZE', 'kameraboy@seznam.cz', 'http://www.topstarclub.cz/', '777 888 451', '000', 'Mariánská 587', 'Liberec', '460 01', NULL, 32, '50.77059540', '15.05757580', NULL, NULL, NULL, '000', '000', '000', '0000', 'třípatrová diskotéka, disco parket, koktejlový bar, retro parket, dance party', 'Top Star je jediná třípatrová diskotéka v Liberci. V suterénu najdete DISCO parket, v přízemí je koktejlový bar a v 1.patře najdete RETRO parket. Každý pátek a sobotu máme pravidelné RETRO and DANCE PARTY..\nKlub je určen VŠEM, kteří se rádi baví, tančí a jsou v POHODĚ.', '2017-03-24 15:14:06', '2017-03-24 15:19:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1000.00', '16.00', 7, b'1'),
(220, 281, 125, 125, 125, NULL, NULL, 3, 'Organza cafe a bar', 'CZE', 'cafeorganza@gmail.com', 'http://www.organza-cafe.cz', '605 050 116', '000', 'Široká 166/16', 'Liberec', '460 01', NULL, 32, '50.76832570', '15.05418790', NULL, NULL, NULL, '000', '000', '000', '0000', 'italská zrnková káva', 'Miscela dOro znamená v překladu zlatý výběr. Jedná se o vynikající italskou zrnkovou kávu praženou s akcentem Sicílie, bohatou na chuť a současně s plným tělem, výrazným aroma a smetanovou pěnou na povrchu.\nO výrobci\n\nMiscela dOro Coffee je rodinným bohatstvím sicilské rodiny Urbano od roku 1946, která po malém množství začala s pražením pečlivě vybrané zelené zrnkové kávy. Rodina do své značky vložila technické znalosti o kávě, hluboce zakořeněné v provinčním území, v kombinaci s citlivostí na požadavky svých zákazníků. Druhá generace se v roce 1970 nadále soustředila na vnitrostátní trh. Dodávala rodinnou značku do specializovaných obchodů a supermarketů, což vyústilo v rozšíření produktové řady a navýšení povědomí o této značce. S příchodem třetí generace v roce 1990 došlo k automatizaci pražíren, díky čemuž mohla značka Miscela dOro expandovat také na zahraniční thy. Zároveň došlo k re-brandingu, který nyní cílí na náročnější zahraniční zákazníky. Od roku 2006 je propagace značky svěřena do rukou mistra kreativity Oliviera Toscaniho, jehož úkolem je přiblížit zákazníkům koncept této pražené, který je založen především na kvalitě, eleganci a jednoduchosti.\n\nCharakteristika kávy\n\nvysoce kvalitní zrnková káva\npůvod: převaha vysoce kvalitní kávy Arabica ze střední a Jižní Ameriky, robusta z Asie\npoměr: Arabica/ Robusta 80/20\nvůně a chuť: aromatická, sametová, jemná, středně kyselá, vynikající chuť', '2017-03-29 08:09:43', '2017-03-29 08:12:05', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1200.00', '18.00', 9, b'1'),
