(223, 284, 125, NULL, 125, NULL, NULL, 1, 'Coyote Diners a Bar', 'CZE', 'info@coyote-diner.cz', 'http://www.coyote-diner.cz/liberec', '722 168 036', '000', 'Nákladní 865', 'Liberec', '460 07', NULL, 32, '50.76082530', '15.04810780', NULL, NULL, NULL, '000', '000', '000', '0000', 'americká kuchyně', 'Naše restaurace se zabývá především americkou kuchyní a používá co nejvíce originálních surovin, které se v americké kuchyni používají a dají se sehnat na českém trhu. Zakládáme si na čerstvosti a kvalitě surovin, které se pak odráží na chuti pokrmů.\nNaší snahou je zachovat pocit příjemného a rodinného prostředí dineru. Oproti tomu klasickému však klademe velký důraz na bar a jeho obsluhu. Zákazníci u nás mohou ochutnat originální nebo klasické koktejly, namíchané zkušenými barmany. Zkrátka pokud chcete ochutnat kousek Ameriky, zastavte se u nás!', '2017-03-29 12:54:27', '2017-03-29 12:56:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '10.00', 13, b'1'),
(224, 284, NULL, NULL, NULL, NULL, NULL, 1, 'U Vodníka', 'CZE', 'info@hostr.cz', 'http://www.terasauvodnika.cz', '721 305 987', '000', 'Křižíkova 235/6', 'Liberec 9', '460 07', 'Křižíkova 235/6, Janův Důl, 460 07 Liberec, Česko', NULL, '50.75704620', '15.04133940', NULL, NULL, NULL, '000', '000', '000', '0000', 'terasa, rybníček na koupání, velká kapacita, gril, páteční živá hudba', 'Součástí naší terasy je rybník o rozměrech 40x30m, ve kterém jsou ryby a kde se dá i koupat. Posezení u nás najde 150 hostů, z toho 100 hostů v zastřešené časti a pro dalších 50 hostů jsou k dispozici lavice se stoly na volné ploše.\n\nNa našem grilu pro Vás rádi připravíme různé pochoutky.\n\n \n\nPříjemné posezení na terase u rybníka\nMůžete si u nás pochutnat na specialitách na grilu, výborné točené pivečko, páteční živá hudba a mnoho dalšího … těšíme se na vaši návštěvu.\n \n\n\n\nPro děti je k dispozici kolotoč, pískoviště a minizoo, takže i maminky s dětmi u nás mohou najít své útočiště. Naše terasa se nachází ve sportovním areálu, který slouží k volnočasovému vyžití. K dispozici jsou dva antukové kurty, jeden je využíván na volejbal a nohejbal, druhý pro tenis. Přímo u těchto prostor je volné parkování pro cca 50 aut.\n\n \n\nOTEVŘENO DENNĚ PŘI PŘÍZNIVÉM POČASÍ OD 15:00 HODIN.', '2017-03-30 02:09:48', '2017-03-30 02:09:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1600.00', '12.00', 7, b'1'),
(225, 285, 125, 125, 125, NULL, NULL, 2, 'Jimmy´s divadelní klub', 'CZE', 'info@jimmys.cz', 'http://www.jimmys.cz', '720 187 399', '000', 'Dr. E. Beneše 22', 'Liberec', '460 01', NULL, 32, '50.77018750', '15.05772930', NULL, NULL, NULL, '000', '000', '000', '0000', 'retro zábavy, klubový bar, jakostní vína', 'Divadelní klub Jimmy´s\nByl otevřen v roce 1991. Od svého založení se klub zaměřoval spíše na střední i vyšší věkovou kategorii hostů. V tomto trendu pokračuje i v současnosti a nabízí příjemné posezení nejen pro návštěvníky divadelních představení, ale především navazuje na tradici víkendových retro zábav s výběrem té nejlepší hudby dob minulých. Klubový bar nabízí nejen široký výběr jakostních vín, ale i prémiové destiláty těch nejlepších značek.\nDo divadelního klubu si dovolujeme nevpouštět hosty, kteří jsou nevhodně oblečeni. Tím se rozumí sportovní oděv, pracovní oděv, nebo jinak nevhodný. Klub je prozatím kuřácký. Kouření je zakázáno pouze na tanečním parketu.', '2017-03-30 02:25:40', '2017-03-30 02:27:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '14.00', 9, b'1'),
(226, 286, 125, 125, 125, NULL, NULL, 9, 'BistRawVeg', 'CZE', 'info@bistroveg.cz', 'https://www.bistrawveg.cz/raw-bistro-restaurace', '739 000 739', '000', 'Palachova 1404', 'Liberec', '460 01', NULL, 32, '50.76881220', '15.06004720', NULL, NULL, NULL, '000', '000', '000', '0000', 'rodinný podnik, raw, vegan, vitarián, čerstvé suroviny, bez lepku, bez laktózy, cukru a chemických aditiv', 'Chtěli jsme změnu. Chtěli jsme mít možnost stravovat se chutně, zdRAWě, s radostí. Chtěli jsme se cítit vitálně, plní energie. Chtěli jsme dodávat svému tělu jen to nejlepší v co nejpřirozenější podobě.\n\nA díky RAW stravování jsme zjistili jak a pomocí bistRAWveg toto šíříme i mezi vás smiley.\n\nA  JAK TO VŠECHNO ZAČALO?\n\nVěřte nebo ne, ale někdy se k podnikání dojde intuicí a třeba i změnou stravovacích návyků jako to bylo u nás.\n\nJmenuji se Stanislav a v roce 2014 jsem změnil svůj dosavadní jídelníček a dokonce absolvoval třicetidenní hladovku a zhubnul téměř o 30 kg. Záhy jsem zjistil, že se cítím mnohem spokojenější a že mi stačí méně spánku, a přitom jsem plný energie. Jsou lidé, kteří takový pust mohou brát jako hrdinství, jiní naopak jako čiré bláznovství. Mne motivoval k dalšímu podnikání.\n\nS manželkou Petrou jsme si uvědomili, že najíst se rychle a zdravě je v současném veřejném stravování dost těžké. Existuje sice řada bufetů s rychlým občerstvením, ale o zdravou stravu v nich nejde ani náhodou.\n\nA tak se zrodil nový gastronomický projekt a také současně tři značky, které bylo potřeba graficky jasně propojit. Čímž vzniklo neobvyklé slovo „bistRAWveg“, což je obchodní název sítě zdravých vitariánských bister, "RAWveg" je značka výrobku a "Zelená vidlička", která v logu tvoří dvojité W, je zase název distribuční sítě, kterou tedˇ firma Zdraví začíná jídlem s.r.o. rozvíjí. Cizí slovo „RAW“ znamená syrový.\n\nProjekt reaguje na nové trendy, podle kterých má každý vědět, co má na talíři, od tud: „U nás víte, co jíte“.\n\nMyslíme si, že se nám podařilo vytvořit logo, jež působí zdravě a svěže, je lehce stravitelné jako naše RAW strava a také lehce zapamatovatelné smiley\n\nZvolili jsme koncept stravovacího zařízení pro obchodní nákupní centra, protože právě tam chodí v současnosti podle našeho názoru většina lidí.\n\nPrvní bistraw se zrodilo 1.4.2015 v Liberci, další pak 1.11. 2015 v Hradci Králové. Třetí vznikne co nevidět v pražském nákupním centru Černý Most.\n\nRoste počet návštěvníků bister, ale také zákazníků, kteří si pravidelně objednávají rozvoz jídla do zaměstnání anebo domů. Stejně tak roste i počet distribučních míst a měst, kam naše RAWveg produkty zavážíme.\n\nAktivně propagujeme myšlenku „zdravého zeleného dne“. Tedy aby kdokoliv z nás jedl jeden den v týdnu pouze rostlinnou stravu. Čím více lidí se k této výzvě připojí, tím lépe pro jejich zdraví smiley \n\nLidé by si měli na jídle pochutnat a přitom mít současně i odpovědný vztah k sobě a přírodě.\nJe to jedna z cest, jak žít v budoucnosti bez civilizačních nemocí. Naší filozofií lze shrnout do jedné věty: „Za vlastní zdraví si neseme odpovědnost sami a k tomu patří také uvážlivost ve stravování“.\n\nCo znamená RAW stravování? \n\nZpracování rostlinných surovin způsobem, který jim ponechá maximum enzymů i vitamínů živých, tedy aktivních. Jedná se o tepelně neupravovanou stravu a nápoje. Maximální teplota při zpracovávání je 42°C.  RAW stravování nepracuje s živočišnými výrobky. Vše obsahuje jen rostlinné suroviny. Rostlinné složky dokážou výživově i chuťově dokonale zastat máslo, mléko, vejce či maso.\n\nRAW potrava nezatěžuje organismus. Naopak, naplňuje jej energií a vitalitou. Vyzkoušejte RAW stravování. Co vás čeká? Zmizí problémy s nadváhou, výrazně se omezí vznik civilizačních chorob, tělo se začne pročišťovat, ba přímo omlazovat. RAW stravování vám může přinést vnitřní klid, ale to už zacházíme do osobního nadšení. Neslibujeme zázraky, ale především příjemné posezení u jídla, které chutná nejen jazyku, ale i celému tělu. A to je naše filosofie, náš cíl.\n\nNaše základní hodnoty:\n\nčerstvé suroviny rostlinného původu (ovoce, zelenina, bylinky, klíčky, oříšky, semínka)\n​šetrná příprava, která nezničí hodnotu potravin jejich zpracováním\nnaprosté vyloučení lepku, laktozy, rafinovaného cukru, chemických aditiv\n​a hlavně, chceme si to užívat :)\nSyrová, živá potrava, jež tělu dodá maximum živin, energie, dokonalého chuťového požitku a i dostatečné zasycení.', '2017-03-30 02:39:53', '2017-03-30 02:43:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1800.00', '18.00', 5, b'1'),
(227, 287, 125, 125, 125, NULL, NULL, 3, 'Arte Café Lázně', 'CZE', 'info@art-cafe-liberec.cz', 'https://www.facebook.com/pg/ARTCAFELIBEREC/about/?ref=page_internal', '776 575 757', '000', 'Masarykova 723/14', 'Liberec', '460 01', NULL, 32, '50.77382170', '15.06780620', NULL, NULL, NULL, '000', '000', '000', '0000', 'Denní kavárna, nekuřácké a bezbariérové prostředí v budově Oblastní galerie Liberec - Lázně. Sezónní posezení na terase, WiFi. Široká nabídka dezertů, zmrzliny, domácích limonád, horkých nápojů a výborné kávy.', 'Denní kavárna, nekuřácké a bezbariérové prostředí v budově Oblastní galerie Liberec - Lázně. Sezónní posezení na terase, WiFi. Široká nabídka dezertů, zmrzliny, domácích limonád, horkých nápojů a výborné kávy.', '2017-03-30 02:47:10', '2017-03-30 02:48:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1700.00', '18.00', 7, b'1'),
(228, 291, 125, NULL, 125, NULL, NULL, 1, 'Nostalgia Restaurant', 'CZE', 'gastro@centrumbabylon.cz', 'https://www.centrumbabylon.cz/nostalgia-restaurant-8.html', '485 249 965', '000', 'Nitranská 1', 'Liberec', '460 12', NULL, 32, '50.76024510', '15.05262680', NULL, NULL, NULL, '000', '000', '000', '0000', 'italská kuchyně', 'Od předkrmu až po závěrečnou Grappu si u nás vychutnáte tu pravou italskou kuchyni.\n\nVy i Vaše ratolesti jistě oceníte dětský koutek a možnost zapůjčení dětských židliček.\n\nRestaurace Nostalgia je také ideálním místem na klidné posezení nad sklenkou dobrého vína.\nJejich nabídku naleznete ve vinném lístku níže.\n\n \n\nBuon appetito!', '2017-03-31 08:25:53', '2017-03-31 08:27:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1100.00', '10.00', 12, b'1'),
(229, 292, 125, 125, 125, NULL, NULL, 1, 'Jizerka', 'CZE', 'jechova@centrumbabylon.cz', 'https://www.centrumbabylon.cz/jizerka.html', '485 249 959', '000', 'Nitranská 1', 'Liberec', '460 12', NULL, 32, '50.76024510', '15.05262680', NULL, NULL, NULL, '000', '000', '000', '0000', 'česká kuchyně, mezinárodní kuchyně, salátový bar, zákusky, self-service', 'Speciální nabídka restaurace Jizerka!\n \nOd pondělí do pátku jsou pro Vás připraveny 2 druhy menu za 89 Kč a jedno menu za 80 Kč. Každé menu obsahuje polévku a hlavní chod z nabídky restaurace Jizerka.\n \nPřejeme všem dobrou chuť!', '2017-03-31 08:36:33', '2017-03-31 08:37:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1600.00', '16.00', 9, b'1'),
(230, 293, 125, 125, 125, NULL, NULL, 1, 'Staročeská Rychta', 'CZE', 'obchod@centrumbabylon.cz', 'https://www.centrumbabylon.cz/staroceska-rychta.html', '485 249 955', '000', 'Nitranská 1', 'Liberec', '460 12', NULL, 32, '50.76024510', '15.05262680', NULL, NULL, NULL, '25022962', 'CZ25022962', '000', '0000', 'Tradiční, česká kuchyně, hospoda, dobré pivo', 'Tradiční česká hospoda Staročeská rychta s pivem jako křen a českou kuchyní. Prostředí je jako stvořené pro pořádání srazů a přátelských setkání.\n \nVe vybrané dny vysílání důležitých sportovních utkání! Přijďte fandit a posedět u dobrého piva. V případě zájmu je k pořádání Vaší akce možné zajistit hudební program nebo harmonikáře. Stylové prostředí a usměvavá obsluha Vám zajistí příjemné posezení, které si budete chtít brzy zopakovat.', '2017-03-31 08:42:25', '2017-03-31 08:43:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1500.00', '16.00', 10, b'1'),
(231, 294, 125, 125, 125, NULL, NULL, 1, 'Babu Burger', 'CZE', 'marketing@centrumbabylon.cz', 'https://www.centrumbabylon.cz/babu-burger-1.html', '485 249 955', '000', 'Nitranská 1', 'Liberec', '460 12', NULL, 32, '50.76024510', '15.05262680', NULL, NULL, NULL, '25022962', 'CZ25022962', '000', '0000', 'Burger, plemeno Angus', 'Nekuřácká restaurace BABU BURGER v CENTRU BABYLON fastfoodového typu se specializací na hamburgery.\n \nHlavní nabídkou jsou  burgery z pravého hovězího masa plemene Angus z českého chovu, burgery kuřecí či vegetariánské a samozřejmostí je čerstvá zelenina a omáčky v několika chuťových variantách.\n \nV naší nabídce najdete také oblíbené chuťovky, jako jsou cibulové kroužky, salát coleslaw nebo grilovaná zelenina.', '2017-03-31 08:48:13', '2017-04-03 01:37:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1400.00', '13.00', 7, b'1'),
(232, 295, 125, 125, 125, NULL, NULL, 2, 'Barovna', 'CZE', 'market@barovna.cz', 'http://barovna.cz', '774 654 420', '000', 'Barvířská 275/16', 'Liberec', '460 07', NULL, 32, '50.76828110', '15.05285910', NULL, NULL, NULL, '000', '000', '000', '0000', 'bar, hry, nekuřácká, seznámení', 'Barovna je unikátní spojení baru a klubovny nacházející se v centru Liberce, v Barvířské ulici.SONY DSC\n\nNápad otevřít Barovnu vznikl 24. 12. 2015. Přemýšleli jsme o místě, kde\nbychom mohli organizovat nejrůznější společenské akce, ale žádné nesplňovalo všechny naše představy. To byl moment, kdy jsme se rozhodli otevřít Barovnu.\n\nK čemu slouží Barovna:SONY DSC\n\nJe to místo, kde se můžete pobavit u nejrůznějších společenských her\nJe to místo, kam můžete přijít i sami a udělat si nové přátele – obsluha vás ráda s někým seznámí\nJe to místo s přátelskou atmosférou, čistým a světlým prostředím a skvělými lidmi\nMůžete zde nejen posedět s přáteli, ale třeba si i zahrát:\n\nStolní tenis\nŠipky\nPexeso\nKarty\nStolní hry\nŠachy\nVše vám navíc rádi půjčíme!\n\nProč přijít do Barovny?\n\nBarovna je nekuřácká\nKrásné světlé prostředí s kombinací bílé barvy a dřeva\nUsměvavý personál (opravdu usměvavý!)\nPřátelské prostředí – hosté se u nás znají\nSpousta možností zábavy', '2017-04-02 01:46:06', '2017-04-02 01:48:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '11.00', 7, b'1'),
(233, 296, 125, 125, 125, NULL, NULL, 2, 'Legenda Music Bar', 'CZE', 'info@legenda-bar.com', 'http://legenda-bar.com', '773 984 995', '000', 'Františkovská 233/6', 'Liberec 2', '460 02', NULL, 32, '50.76688960', '15.05003330', NULL, NULL, NULL, '000', '000', '000', '0000', 'bar, terasa', 'bar, terasa, legendární kocour ;-) Před lety si nás našel a zabydlel se na terase, nyní přichází jen, když je mu ouzko, kocour Macík.\nKdyž se k němu nebudete mít, tak se bude lísat alespoň k vašemu batohu. Macík je prostě legendární součástí našeho baru.', '2017-04-02 01:53:02', '2017-04-02 01:55:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1400.00', '16.00', 14, b'1'),
(234, 297, 125, 125, 125, NULL, NULL, 2, 'Single Bar', 'CZE', 'martin.hes@seznam.cz', 'https://www.facebook.com/Single-Bar-161585930659699/?fref=ts', '723 425 687', '000', 'Na Svahu 176/1', 'Liberec', '460 01', NULL, 32, '50.76884220', '15.05343050', NULL, NULL, NULL, '000', '000', '000', '0000', 'Bar v centru Liberce, velký výběr alkoholu a kočky za barem!', 'Bar v centru Liberce, velký výběr alkoholu a kočky za barem!', '2017-04-02 01:58:55', '2017-04-02 01:59:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1400.00', '17.00', 10, b'1'),
(235, 298, 288, NULL, 288, NULL, NULL, 1, 'Restaurace a Penzion Lutena', 'CZE', 'info.penzion-lutena@seznam.cz', 'www.lutena.cz', '778 745 574', '778766413', 'Karvinská', 'Dolní Lutyně', '73553', NULL, 26, '49.89910960', '18.43446960', NULL, NULL, NULL, '03422445', 'CZ03422445', '0000000000000000', '0000', 'Bezvadná Restaurace', 'Restauraci a Penzion Lutena\nNachází se v Dolní Lutyni, poblíž měst Bohumín, Orlová a Karviná. Obec, rozprostírající se v nížině řeky Olše, byla dle úsudků archeologů obydlená už v pozdní době kamenné, tedy před více než 5000 lety. První písemná zmínka o  místě s latinským názvem „Luthina“ pochází z roku 1305 a váže se k soupisu desátků vratislavského biskupství. V průběhu staletí nesla obec mnoho názvů v souvislosti s historickými událostmi, které měnily její ráz – od Luthiny, Luthynie Theutonicum, Teuto Lutynie, Lutuny, Deutsche Leute a Deutschleithen, přes Luten, odkud pochází název našeho podniku Lutena, až po název Dolní Lutyně, který byl oficiálně uznaný a úředně potvrzený po skončení druhé světové války, 1. února 1946.\nRestaurace a Penzion Lutena je místem, kde dbáme na vysokou kvalitu služeb a profesionální přístup. Můžete očekávat milý, rychlý personál i řadu vybraných specialit. Členitost vnitřních prostor je ideální nejen pro příjemné posezení na klasickém obědě či večeři, ale spolu s bezproblémovým parkováním nabízí ty nejlepší podmínky pro pořádání oslav, svateb, firemních akcí, prezentací, školení apod. V letních měsících se přímo nabízí využití velké terasy a zahrádky. Pro hosty i Vaše obchodní partnery máme k dispozici ubytovací kapacity v horních patrech.\nNově jsme pro Vás také otevřeli náš Gril bar, kde se můžete těšit na příjemné venkovní posezení a grilování s našimi kuchaři. \nNaše kuchyně je inspirovaná českou tradicí a také přesvědčením, že dobrou restauraci dělají kromě dobrého týmu lidí také prvotřídní čerstvé suroviny. Náš jídelní lístek je proto koncipován jak ze sezónních potravin, tak také ze surovin, jejichž dodavatele si pečlivě vybíráme a dokonce i z těch, které pro Vás sami pěstujeme.\nDůkladný výběr dodavatelů ať už čerstvého masa, ryb, zeleniny či ovoce a důraz na to, abychom Vám servírovali poctivou domácí kuchyni bez zbytečných umělých dochucovadel, je cesta, kterou hodláme pokračovat. Pevně věříme, že na své si přijdou také zastánci zdravého životního stylu i osoby, které preferují vegetariánskou stravu. Samozřejmě jsme schopni vyjít vstříc osobám s bezlepkovou dietou.', '2017-04-04 06:12:30', '2017-04-04 06:37:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1500.00', '10.00', 11, b'1'),
(236, 299, 288, 288, 288, 288, NULL, 1, 'Golf Resaturant Lipiny', 'CZE', 'info@golflipiny.cz', 'www.golflipiny.cz', '725044292', '734443326', 'Ostravská2066/31', 'Karviná', '73301', NULL, 26, '49.85340610', '18.53254880', NULL, NULL, NULL, '0000', '00000', '000000', '0000', 'příiemné posezení', 'Snídaňové i obědové menu, možnost pořádání rodinných oslav, firemních večirků a jiných akcí.', '2017-04-04 07:14:10', '2017-04-04 07:30:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '17.00', 9, b'1'),
