(239, 304, 302, 302, 538, 302, NULL, 1, 'Le Cafe', 'CZE', 'lecafe@lecafe.cz', 'www.lecafe.cz', '420 608 721 410', '608 721 410', 'Prameny 801', 'Karviná', '73401', NULL, 26, '49.85302310', '18.55672730', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'letní terasa, italská jídla, pivní speciál', 'Naše restaurace jsou ideálním místem pro pracovní snídaní, oběd nebo rodinnou večeři. Čeká na Vás stylový interiér s příjemným posezením, letní terasa a kulinářské speciality našich kuchařů.\nMimo tradiční italská jídla jako je pizza, těstoviny, saláty připravujeme také speciality mezinárodní kuchyně. V pracovní dny nabízíme DENNÍ MENU. \nPřinášíme Vám jedinečnou nabídku českého a zahraničního piva. Mezi širokou škálou značek nechybí originální pivní speciál – Stella Artois. Navíc náš nápojový lístek obsahuje bohatý sortiment nealko a alko nápojů, vín, whisky nebo míchaných drinků. Na své si přijdou rovněž milovníci kávy.', '2017-04-05 04:35:38', '2017-04-27 04:22:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'zavolat zitra v 10:00', NULL, '130.00', '1400.00', '13.00', 8, b'1'),
