(244, 307, 126, 126, 537, NULL, NULL, 1, 'Restaurant Na Statku', 'CZE', 'restaurantnastatku@seznam.cz', 'www.restaurantnastatku.cz', '495490495', '777660678', 'Pražská tř. 29/146', 'Hradec Králové - Kukleny', '500 04', NULL, 16, '50.20238662', '15.78297912', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vynikající kuchyně, příjemná obsluha a bohatý výběr jídel', 'Restaurant na statku patří mezi nejoblíbenější restauranty v Hradci Králové především díky velice příjemnému interiéru. Restaurant s otevřeným krbem nabízí ve stylovém prostředí vynikající kuchyni, příjemnou obsluhu a bohatý výběr jídel. Svou polohou a vynikající dostupností je tím pravým místem pro soukromé a firemní akce.\nRestaurant na Statku Vám nabízí ubytování ve dvou pokojích umístěných v horní části restaurantu. Pokoje jsou vybaveny televizí, vlastní kuchyňskou linkou, koupelnou a WC. \nMožnost platby kreditní kartou.', '2017-04-06 05:02:20', '2017-04-19 14:34:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1900.00', '18.00', 8, b'1');
