(245, 308, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Kocoura', 'CZE', 'jirkasimerda@seznam.cz', 'www.ukocourahk.cz', '777189849', '777189849', 'Štefánikova 11', 'Hradec Králové', '500 11', NULL, 16, '50.18814280', '15.83918530', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, letní zahrádka s obsluhou', 'Útulná nekuřácká restaurace na Moravském Předměstí, v provozu i příjemná letní zahrádka s obsluhou. Nabízíme denní polední menu, dále široký sortiment teplých a studených jídel, nápojů a velmi pěkné prostředí k pořádání menších rodinných oslav. Těšíme se i na Vaši návštěvu!', '2017-04-06 07:20:32', '2017-04-19 14:56:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '16.00', 6, b'1'),
(246, 309, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Lva', 'CZE', 'ulva.pardubice@gmail.com', 'www.ulva.cz', '725741167', '725741167', 'Bratranců Veverkových 2707', 'Pardubice - Zelené Předměstí', '530 02', NULL, 16, '50.03498560', '15.77096166', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Plně klimatizovaná, bezbariérová a nekuřácká restaurace, čerstvé a poctivě připravené pokrmy, sezónní speciality, široký sortiment vín', 'Restaurace U Lva v Pardubicích zahájila provoz v roce 1998 a postupně si získala řadu spokojených zákazníků nejenom mezi obyvateli města Pardubic a jeho návštěvníky, ale i mezi známými osobnostmi. \n\nNaše plně klimatizovaná, bezbariérová a nekuřácká restaurace nabízí 45 míst. Dalších 20 míst je pro Vás připraveno v odděleném salónku. V letních měsících je možné posedět v příjemném a klidném prostředí venkovní zahrádky plné zeleně, kde se nachází dalších 50 míst. \n\nPochutnat si můžete na vždy čerstvých a poctivě připravených pokrmech, kterou doplňuje naše nabídka sezónních specialit, poledního menu a široký sortiment tuzemských i zahraničních vín. Velké oblibě se těší připravovaná degustační menu. \n\nPravidelně pořádáme gastronomické akce, o kterých informujeme v sekci aktuality. \n\nPro Vaše zahraniční hosty máme k dispozici jídelní a nápojový lístek v anglickém a německém jazyce. \n\nPřijímáme platební karty i většinu stravenek.', '2017-04-06 07:24:46', '2017-04-19 15:08:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1200.00', '14.00', 9, b'1'),
(247, 310, 126, 126, NULL, NULL, NULL, 4, 'Restaurace IL Toro', 'CZE', 'restaurace@il-toro.cz', 'www.il-toro.cz', '495710849', '777341821', 'Brněnská 700/25', 'Hradec Králové', '500 06', NULL, 16, '50.19454942', '15.84803895', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Italská kuchyně, Pizza & Pasta, Svatby a Rauty, Živá hudba', 'Naše restaurace Vám nabízí své služby ať už v podobě\npoledního menu nebo příjemného posezení s přáteli, tak možností cateringových služeb\nv podobě rautů, svatebních hostin, promocí, oslav narozenin,\nvenkovního grilování a všeho, co Vás jen napadne.\n\nV restauraci také pořádáme každý pátek a sobotu vystoupení živé kapely.\nTermíny hraní najdete na našich stránkách nebo u personálu za barem.\nPo celé restauraci je Wi–Fi síť. Do restaurace můžete vzít také Vašeho čtyřnohého miláčka.\nVěříme, že zde budete spokojeni a přejeme Vám dobrou chuť.\n\n\nTým restaurace Il Toro', '2017-04-06 07:28:09', '2017-04-19 15:30:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1500.00', '12.00', 14, b'1'),
(248, 311, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Popular Steak', 'CZE', 'promo@cafepopular.cz', 'www.cafepopular.cz', '737888941', '737888941', 'Mostecká 279/1', 'Hradec Králové', '500 03', NULL, 16, '50.20994120', '15.82915232', NULL, 'ARCH DEVELOP s.r.o.', 'Paříkova 910/9a, 190 00 Praha 9', '24797120', 'CZ24797120', '115-2579350227', '0100', 'Špičkový gastronomický zážitek, Elegantní prostředí, Čerstvost a kvalita', 'Restaurant Popular Steak Bar & Sushi nabízí prvotřídní servis a především špičkový gastronomický zážitek vykouzlený z kvalitních surovin v elegantním prostředí vytříbeného interiéru. \n\nNekuřácká restaurace se nachází v centru města Hradec Králové. Součástí restaurace je také letní zahrádka a bezdrátové připojení Wi-fi. Malí labužníci ocení speciální dětské menu. Nabízíme Vám také originální dárkové certifikáty v hodnotě 500 a 1000 Kč pro každou příležitost. \n\n\nNajdete u nás největší nabídku čerstvých ryb a možných sushi kombinací, které zaujmou každého a každý si může poskládat to na co právě má chuť. Za zmínku stojí i část japonské teplé domácí kuchyně, která je u nás připravována podle tradičních receptů. \n\nNekuřácká restaurace je k dispozici hostům pro účely společenských a firemních akcí, jako jsou degustace vín, tiskové konference, svatební hostiny, třídní srazy, firemní večírky, oslavy narozenin, meetingy, atd.', '2017-04-06 07:30:50', '2017-04-19 15:48:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1300.00', '11.00', 11, b'1'),
(249, 312, 126, 126, 537, NULL, NULL, 2, 'Náplavka cafe', 'CZE', 'lubos@naplavkahk.cz', 'www.naplavkahk.cz', '608979556', '608979556', 'Náměstí 5.května 835', 'Hradec Králové', '500 02', NULL, 16, '50.21411109', '15.82668092', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Café & music bar, Místo kultury, umění, společné zábavy a posezení', 'Nový café & music bar v Hradci Králové, jehož cílem je znovu probudit zapomenuté Genius Loci Hradecké náplavky jako místa kultury, umění, společné zábavy a posezení. \n\nCafé bar je v prostorách funkcionalistické budovy architekta Josefa Fňouka. Svojí rekonstrukcí a obnažením betonových konstrukčních prvků vrátil prostor do původní podoby. Vzhledem k tradici a poloze na břehu řeky Labe jsme jako nejrozumnější volbu názvu zvolili jednoduše NãPLAVKA. Stejně tak byl i předem udán směr vizuálního stylu. \n\nRádi bychom do kulturního života NãPLAVKY zapojili umělce, studenty a kreativní skupiny lidí z Královehradeckého kraje.', '2017-04-06 07:33:44', '2017-04-19 15:57:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1900.00', '18.00', 10, b'1'),
(250, 313, 126, 126, 537, NULL, NULL, 2, 'Hendrix Cafe Bar', 'CZE', 'info@hendrixcafe.cz', 'www.hendrixcafe.cz', '491611402', '603359953', 'Velké náměstí 153/9', 'Hradec Králové', '500 03', NULL, 16, '50.20957787', '15.83188077', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Cocktails, Spirits, Mixology, American Kitchen', 'Bar v našem pojetí je místo, kde se bavíme, kde kolegy bereme spíš jako kamarády, než pouhé spolupracovníky, kde se těšíme na každého nového hosta. Jsme umělci stejně tak, jako Vincent Van Gogh, jen na rozdíl od něj tvoříme umělecká díla z alkoholu, bitterů, esencí, ovoce a dalších ingrediencí. Náš bar je místo, kde úsměv a upřímný pozdrav krásného dne bereme ne jako samozřejmost, ale jako požehnání dobromyslné sudičky. To vše a mnohem víc se pro nás, barmany a personál, skrývá za slovem bar. \n\nTěšíme se na Vás\nHendrix Café Bar', '2017-04-06 07:36:16', '2017-04-19 16:29:49', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1200.00', '11.00', 8, b'1'),
(251, 314, 126, 126, 537, NULL, NULL, 1, 'Restaurace Park Golf', 'CZE', 'inondinovic@seznam.cz', 'www.parkgolf.cz', '775572244', '775572244', 'Roudničská 730', 'Hradec Králové', '500 11', NULL, 16, '50.17516350', '15.82762976', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', '5. nejkrásnější restaurace podle Maurera, 47. nejkvalitnější restaurace v ČR 2016', '5. nejkrásnější restaurace podle Maurera, 47. nejkvalitnější restaurace v ČR 2016', '2017-04-06 08:20:48', '2017-04-19 16:29:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '14.00', 9, b'1'),
(252, 315, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Na Hradě', 'CZE', 'nahrade@centrum.cz', 'www.restaurace-nahrade.cz', '603873667', '603873667', 'Špitálská 175/5', 'Hradec Králové', '500 03', NULL, 16, '50.20994882', '15.83277014', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Tankové pivo, Tradiční česká jídla, Zastřešený Dvoreček, Sklepeníčko s vlastním výčepem a krbem', 'Hospoda Na Hradě je jedna z mála původních a nejstarších hospod a hospůdek na starém městě v Hradci Králové s právovarečnou historií datovanou již od 15.století (viz O restauraci). Tradice a poloha hospůdky přímo vybízí setkat se s přáteli při obědě, večeři nebo jen tak si posedět či  zaskočit "NA JEDNO..". Vybíráme ty nejlepší produkty domácích výrobců proto při volbě piva jasně zvítězil Plzeňský Prazdroj , který je u nás výborně ošetřen a čepován přímo z tanků na několik způsobů. Nejlépe si ho vychutnáte "na hladinku", může být čepován klasicky na dvakrát a  nebo jako "šnýtek", záleží jen na Vás co preferujete. Naši kuchaři připravují tradiční česká jídla z výhradně čerstvých surovin od místních dodavatelů. Hospoda je rozdělena na původní kuřácký lokál s výčepem pro 60 hostů. Další uvedené prostory restaurace jsou zcela nekuřácké. Salónek pro 30 hostů, zastřešený Dvoreček pro 30 hostů , Sklepeníčko s vlastním výčepem a krbem pro dalších 30 hostů. Nově jsme pro vás otevřeli salónek pro 12 osob s velkým oválným stolem.', '2017-04-06 08:24:03', '2017-04-19 16:57:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1000.00', '12.00', 6, b'1'),
(253, 316, 126, 126, 537, NULL, NULL, 1, 'Restaurace Stěna', 'CZE', 'restauracestena@seznam.cz', 'http://www.stenahk.cz/restaurace.htm', '744807774', '744807774', 'Brněnská 302', 'Hradec Králové', 'Hradec Krá', NULL, 16, '50.19842303', '15.84566609', NULL, 'DAP SPORT s.r.o.', 'Blodkova 256/76, Hradec Králové - Třebeš', '27496406', 'CZ27496406', '115-2579350227', '0100', 'Restaurace Lezecká stěna', 'Restaurace Lezecká stěna', '2017-04-06 08:27:43', '2017-04-19 17:14:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1700.00', '13.00', 8, b'1'),
(254, 317, 126, 126, NULL, NULL, NULL, 2, 'Paradise Bar', 'CZE', 'paradisebar@seznam.cz', 'nemá', '495512331', NULL, 'Velké náměstí 158', 'Hradec Králové', '500 03', NULL, 16, '50.20958174', '15.83180480', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Coctailový bar, míchané nápoje', 'Paradise je coctailový bar na starém městě v Hradci Králové. V nabídce nespočet míchaných nápojů, alkoholických i nealkoholických nápojů, kávy, 24 teplých a 12 studených čokolád, fresh jogurty, mascarpone, tiramisu atd.', '2017-04-06 08:31:00', '2017-04-19 17:38:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1400.00', '10.00', 5, b'1'),
(255, 318, 126, 126, NULL, NULL, NULL, 3, 'Cafe Na kole', 'CZE', 'info@cafenakole.cz', 'www.cafenakole.cz', '495512331', NULL, 'Velké náměstí 130/24', 'Hradec Králové', '500 03', NULL, 16, '50.21008064', '15.83552469', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Výběrová káva, Dobroty k jídlu i k pití', 'Jsme kavárna s výběrovou kávou v Hradci Králové.\nNabízíme espresso a další kávové nápoje připravené z kávy z předních českých a zahraničních pražíren. Kromě kávy máme spoustu dalších dobrot k jídlu i k pití a příjemně se u nás tráví čas.', '2017-04-06 08:36:01', '2017-04-19 17:46:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1600.00', '18.00', 5, b'1'),
(256, 319, 126, 126, 537, NULL, NULL, 1, 'Restaurace Na Soutoku', 'CZE', 'restaurace@nasoutoku.eu', 'www.nasoutokuhk.cz', '731419145', '731419145', 'U labe 427', 'Hradec Králové', '500 02', NULL, 16, '50.20069280', '15.82121110', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stylová restaurace, kousek od centra města', 'Restaurace Na Soutoku je stylová restaurace v Hradci Králové. Restaurace se nachází jen kousek od centra města v příjemném prostředí u řeky a nabízí mnoho různých dobrot k zakousnutí.', '2017-04-06 08:38:25', '2017-04-20 08:55:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '17.00', 5, b'1'),
(257, 320, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Assenza', 'CZE', 'jbodlak@aquarko.cz', 'www.aquarko.cz', '495490490', '725740863', 'Švehlova 443', 'Hradec Králové', '500 02', NULL, 16, '50.21109827', '15.82574273', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Denní kavárna, Široký výběr rozlévaných vín', 'Denní kavárna s nabídkou tapas, domácích dezertů, domácího pečiva a zmrzliny. Široký výběr rozlévaných vín ze středomoří a kvalitní káva.', '2017-04-06 11:16:34', '2017-04-20 09:12:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1400.00', '19.00', 10, b'1'),
(258, 321, 126, 126, 537, NULL, NULL, 1, 'Restaurace  U jabloně', 'CZE', 'kzikmunda@seznam.cz', 'www.u-jablone.cz', '601015033', '601015033', 'Tylovo nábřeží 367/10', 'Hradec Králové', '500 02', NULL, 16, '50.21106987', '15.82721728', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', '102 položek v jídelním lístku, letní zahrádka, klimatizace', 'Restauraci U Jabloně najdete v Hradeci Králové na ulici Tylovo Nábřeží 367. Vybrat si můžete ze 102 položek v jídelním lístku. Nabízí: catering, extra salónek, klimatizace, letní zahrádka, nekuřácká část, parking, pořádání akcí, sportovní přenosy.', '2017-04-06 11:20:06', '2017-04-20 09:27:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1200.00', '17.00', 5, b'1'),
(259, 322, 126, 126, 537, NULL, NULL, 1, 'Restaurant penzionu Drink club', 'CZE', 'tomasjirku83@seznam.cz', 'www.ubytovanihk.cz', '605463936', '605463936', 'Bratří Štefanů 1129/44', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21545609', '15.85673294', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Velký výběr jídel, Celoroční zahrádka', 'Nová kuchyně, která nabízí velký výběr jídel. Všechny pokrmy jsou vždy čerstvě připravovány. Nově jsou v nabídce i "polední meníčka". Dále si vyberete z mnoha nápojů alko, či nealko. Vaříme pondělí až neděle (snídaně, svačiny, obědy a večeře)\n\nChuťovky k pivu a vínu, na objednávku připravíme pamlsky dle chuti. Velký výběr kávy, piva a vína. Letní zastřešená a zimní plně vytápěná zahrádka pro celoroční provoz.\nKuřácké i nekuřácké prostředí - stavebně odděleno.', '2017-04-06 11:24:04', '2017-04-20 09:31:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1300.00', '13.00', 11, b'1'),
(260, 323, 126, 126, NULL, NULL, NULL, 4, 'Restaurace Pizzeria Dolce Vita', 'CZE', 'info@dolcevitahk.cz', 'www.dolcevitahk.cz', '495515078', '777530540', 'Čelakovského 505/4', 'Hradec Králové', '500 02', NULL, 16, '50.21235774', '15.82375480', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Italské jídlo, Zahrádka, Wi-fi', 'Nabízíme italskou pizzu, těstoviny, saláty, rizota, steaky, českou klasiku, chuťovky k pivu, alkoholické i nealkoholické nápoje. Podáváme obědy a večeře. Zajišťujeme catering. K dispozici je venkovní zahrádka se 140 místy a s dětským hřištěm, parkoviště, WiFi připojení k internetu.\nDalší služby:\nParkoviště, Wi-Fi, Platba kartou, Zahrádka, Salonek, Nekuřácký prostor', '2017-04-06 11:27:11', '2017-04-20 09:41:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1600.00', '12.00', 7, b'1'),
(261, 324, 126, 126, 537, NULL, NULL, 1, 'Hospoda Pod Strání', 'CZE', 'info@podstrani.cz', 'www.podstrani.cz', '495260627', '608446923', 'Milady Horákové 549', 'Hradec Králové - Třebeš', 'Hradec Krá', NULL, 16, '50.18547747', '15.84738693', NULL, 'Pod Strání, s.r.o.', 'Roháčova 188/37, PSČ 130 00, Praha 3 - Žižkov', '64254127', 'CZ64254127', '115-2579350227', '0100', 'Hospoda, Tankové pivo, Vinárna, Bowling', 'Co u nás najdete? Dobré jídlo po celý den s oroseným půllitrem výborného tankového piva - Pilsner Urquel, Gambrinus 10°, Kozel 11°. Restauraci - pivnici se samostatným salonkem (1.patro). Stylovou vinárnu s podiem pro kapelu a tanečním parketem (1.patro) Denní a noční restauraci v přízemí (bowling, kulečník, sázková kancelář, letní zahrádka s točenou zmrzlinou a nekuřácká klimatizovaná zimní zahrada s dětským koutkem a otvíratelnými výlohami).\nCo Vám nabízíme? Tradiční českou hotovkovou a minutkovou kuchyni doplněnou různými chuťovkami k pivu. Možnost uspořádat svatbu, oslavu, sraz, firemní večírek, školení, prezentaci či raut ve stylové vinárně s ozvučením a promítacím plátnem. Rozvoz obědů v termoboxech, systém firemního a podnikového stravování. Sledování sportovních přenosů na velkoplošné projekci či velkých LED TV.', '2017-04-06 11:32:34', '2017-04-20 09:56:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1300.00', '17.00', 11, b'1'),
(262, 325, 126, 126, 537, NULL, NULL, 1, 'Restaurace Inflagranti', 'CZE', 'inflagranti.hk@seznam.cz', 'www.inflagrantihk.cz', '495585082', '731023123', 'Československé armády 219/24', 'Hradec Králové', '500 03', NULL, 16, '50.21044710', '15.83790330', NULL, 'Restaurace Inflagranti s.r.o.', 'Pod Strání 535/17, Hradec Králové - Třebeš', '28830636', 'CZ28830636', '115-2579350227', '0100', 'Restaurant grill, Denní menu', 'Restaurace umístěná naproti krajskému soudu v Hradci Králové. Kromě stálého jídelního lístku nabízí i denní menu. Možnost pořádání večírků, svateb, rautů, smutečních hostin apod. Lze platit stravenkami a platebními kartami.', '2017-04-06 11:35:33', '2017-04-20 10:01:35', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1500.00', '15.00', 14, b'1'),
(263, 326, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Dvora', 'CZE', 'u.dvora@tiscali.cz', 'www.udvorahk.cz', '773886145', '773886145', 'Hradecká 619', 'Hradec Králové', '500 12', NULL, 16, '50.19657091', '15.83524801', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Atrium, Zahrádka, Velkoplošná projekce', 'Restaurace s otevírací střechou (Atrium), Pivnice. V letních měsících přístupná zahrádka se samoobsluhou. V kuchyni lze objednat z velké nabídky hotových a minutkových jídel (ceny již od 33,90 Kč). Snídaně k dispozici nad 30 osob. Pro fanoušky sportovních přenosů velkoplošná projekce v pivnici', '2017-04-06 11:40:31', '2017-04-20 10:09:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1400.00', '19.00', 8, b'1'),
(265, 327, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Svatého Jana', 'CZE', 'mukarovska@gmail.com', 'www.usvatehojana.cz', '495436125', '602620135', 'Spojovací 72', 'Hradec Králové - Svobodné Dvory', '500 11', NULL, 16, '50.22396840', '15.77953384', NULL, 'Martin Mukařovský', 'Spojovací 72/46, Hradec Králové - Svobodné Dvory', '44680589', 'CZ5711131393', '115-2579350227', '0100', 'Česká a mezinárodní kuchyně, Čerstvost a kvalita, Salónek', 'Restaurace s kapacitou 65 míst je zaměřena převážně na českou kuchyni. V jídelním lístku však naleznete i kuchyni mezinárodní, oblíbené minutky a také naše speciality. \nKaždý všední den připravujeme polední menu, kdy si můžete vybrat ze tří jídel.    \nPokrmy zhotovujeme z čerstvých a kvalitních surovin a naší snahou je příprava vlastních produktů nikoliv polotovarů. Vyzkoušejte naši palačinku s domácí marmeládou, je opravdovým zážitkem. \nSalónek zvaný "Citrónek" s kapacitou 65 míst nabízí klidné prostředí pro uspořádání soukromé akce, svatby, rodinné oslavy či školení. \nRestaurace i salónek jsou nekuřácké. \nPřijďte si k nám pochutnat, těšíme se na Vaši návštěvu.', '2017-04-06 11:46:07', '2017-04-20 10:24:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1700.00', '12.00', 13, b'1'),
(266, 328, 126, 126, 537, NULL, NULL, 1, 'Restaurace Vulkán', 'CZE', 'ydenda.c@atlas.cz', 'www.vulkanhk.cz', '495521564', '724148699', 'Chelčického 280', 'Hradec Králové', '500 02', NULL, 16, '50.21390470', '15.81568460', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Kvalitní kuchyně, Vína z oblasti Čejkovic, Degustace, Salónek', 'Restaurace Vulkán se nachází v centru města, kousek od vlakového a zároveň i od autobusového nádraží v Chelčického ulici 280. Vítáme všechny, kdo si potrpí na kvalitní českou i zahraniční kuchyni, nabídneme Vám hotová jídla i speciality kuchyně.\nZaručeně si vyberete z bohaté nabídky odrůdových jakostních vín, pozdních sběrů, které pocházejí z oblasti Čejkovic. Ochutnejte také vynikající stáčená vína přímo z Čejkovic (např. Rulandské Šedé, Veltlínské Zelené, atd. viz nápojový lístek).\nKvalita a nabídka vín je konzultována s odborníky při pravidelných ochutnávkách vín. V podobě akcí se budou konat i degustace vín z různých vinařství, které budete moci ohodnotit sami.\nRestaurace Vulkán nabízí příležitost k odpočinku, rodinným oslavám, svatbám, ale i rautům a podnikovým večírkům a mnoha jiných událostem. V příjemném prostředí můžete poobědvat i povečeřet s přáteli či s rodinou. Pro akce je možné, využít salónek do max. počtu 25 lidí. Atmosféru dokresluje příjemná hudba, věnovat se Vám bude milá a ochotná obsluha. \nNa závěr nám dovolte popřát Vám příjemný gastronomický zážitek při návštěvě naší restaurace Vulkán.', '2017-04-06 11:48:56', '2017-04-20 10:35:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1300.00', '19.00', 13, b'1'),
(267, 329, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Královny Elišky', 'CZE', 'reditel@hotelukralovnyelisky.cz', 'www.hotelukralovnyelisky.cz', '495518052', '603577087', 'Malé náměstí 117', 'Hradec Králové', '500 03', NULL, 16, '50.21083330', '15.83642396', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Denní menu, Akce "šité na míru"', 'Restaurace v Hradci Králové je připravena uspokojit všechny náročné hosty bez výjimky. Kromě denních menu, které jsou velice oblíbené a hojně navštěvované, nabízíme speciální menu na sobotu. Chcete si od vaření doma odpočinout? Naše restaurace se na vás těší také o víkendech.\nRádi pro Vás zajistíme SVATEBNÍ HOSTINY, RODINNÉ OSLAVY, NAROZENINY, KŘTINY, PROMOCE, GRILOVACÍ PÁRTY, RAUTY, FIREMNÍ AKCE a VEČÍRKY a akce "šité na míru" dle Vašich přání.\nOd pondělí do soboty nabízíme zvýhodněná polední menu!', '2017-04-06 12:17:13', '2017-04-20 10:50:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1400.00', '16.00', 5, b'1'),
(268, 330, 126, 126, 537, NULL, NULL, 11, 'Dobrá Čajovna', 'CZE', 'texl.daniel@seznam.cz', 'nema', '773488060', '773488060', 'Masarykovo náměstí 396/15', 'Hradec Králové', '500 02', NULL, 16, '50.21184693', '15.82535195', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Čajovna', 'Provoz čajovny. Marka tato registrovaná již tradičně znamená garanci nejvyšší kvality čajů zde podávaných, rovněž tak volně prodávaných i v rozličných originálních škatulkách adjustovaných. Kvalita tato nejvyšší jest dána dvěma jednoduchými, tím zásadnějšími však regulemi: - čerstvost čajů jest ručena Spolkem milců čaje, directním to přívozcem z čajových zahrad celého světa. Příprava, podávání i prodej čajů jest v Dobré čajovně v rukách vysoce odborných tovaryšů, v čajových vědách široce orientovaných a rozličných postupů, grifů, kejklů a tajemství znalých. Způsob podávání čajů jest inspirován tradicemi k Orientu se vížícími.', '2017-04-06 12:21:31', '2017-04-20 10:59:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '16.00', 6, b'1'),
(269, 331, 126, 126, NULL, NULL, NULL, 2, 'Centralbar', 'CZE', 'bar@biocentral.cz', 'www.biocentral.cz', '778474599', '778474599', 'Třída Karla IV. 774', 'Hradec Králové', '500 02', NULL, 16, '50.21420640', '15.82277390', NULL, 'Centrální kino s.r.o.', 'Třída Karla IV. 774, Hradec Králové', '28856376', 'CZ28856376', '115-2579350227', '0100', 'S pitím do sálu, Take away, Zahrádka, Wifi', 'Bar a kavárna s atmosférou v centru města přímo před vstupem do Bia Central.\nProstor je nekuřácký, kuřáci si přijdou na své na zahrádce nebo po 21. hodině ve dvoraně. \nVeškeré na baru zakoupené nápoje je možno konzumovat v sále kina buď v lahvičce nebo v kelímku. Bezdrátové připojení na internet zdarma.\nBetonová zahrádka - prostor pro grilování s přáteli nebo na opalovačku. Kousek dvorku pro Vás. Naše malá zahrádka s mátou a meduňkou. Ideální místo pro kafe a cigára. \nOtevřena každý den do 22 hodin při příznivém počasí.\nIdeální na rande nebo pokec. Možnost rezervace pro skupiny (mimo exponované termíny) dle domluvy s obsluhou baru. \nMožnost promítání na plátno po předchozí domluvě.', '2017-04-06 12:25:42', '2017-04-24 04:23:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1100.00', '12.00', 13, b'1'),
(270, 332, 126, 126, 537, NULL, NULL, 1, 'Hospudka U Mlejna', 'CZE', 'hospudkaumlejna@seznam.cz', 'www.penzionumlejna.cz', '739016225', '739016225', 'Zámostí  261', 'Hradec Králové - Malšovice', '500 09', NULL, 16, '50.20688340', '15.85482650', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stylový interiér, Piva regionálních pivovarů, Zahrádka, Dětské hřiště, Kolárna', 'Hospůdka byla vybudována v budově hospodářského stavení zdejšího bývalého vodní mlýna, který je také označován jako nejstarší budova v Malšovicích. \nStylově zařízený interiér s dominantou mlýnského kola, nabízí útulné nekuřácké prostředí pro všechny milovníky dobré kuchyně, výborného piva regionálních pivovarů a širokou nabídkou ovocných destilátů.\nHospůdka je pro svou klidnou polohu vyhledávána k nejrůznějším rodinným a firemním akcí, ale i k příjemnému posezení ve dvou. Svými vnitřními prostory poskytne zázemí pro 50 hostů a dalších 90 míst na letní zahrádce s prostorným dětským hřištěm.\nDále je pro naše hosty  k dispozici prostorné parkoviště, stojany na kola, uzamykatelná kolárna a samozřejmostí je připojení WIFI v celém areálu.\nPersonál hospůdky je připraven Vám poskytnout veškeré informace a pomoc při plánování Vašich rodinných oslav, promocí, svateb, rodinných a školních srazů, smutečních hostin ale i firemních večírků, školení, seminářů atd.', '2017-04-06 12:29:46', '2017-04-20 11:25:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1300.00', '16.00', 6, b'1'),
(271, 333, 126, 126, 537, NULL, NULL, 1, 'Restaurace Tandoor', 'CZE', 'infoindicka@seznam.cz', 'www.indicka-hradec-kralove.cz', '608456000', '608456000', 'Špitálská 183', 'Hradec Králové', '500 03', NULL, 16, '50.21045101', '15.83266647', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Indická a Nepálská restaurace, Indická kuchyně', 'Naši kuchařští mistři pocházejí přímo z Indie a Nepálu. Jejich specialitou je úprava jehněčího masa. Na výbornou však připraví maso vepřové, kuřecí, rybí či tygří krevety.\nV našem poledním i stálém jídelním menu najdete jídla jak s masem tak pokrmy pro zapřísáhlé vegetariány. \nVšechna jídla jsou připravována tradiční metodou. Maso i domácí chléb Nan a Chapati se upravují bez použití olejů, jídlo tedy neobsahuje přepálené tuky ani dochucovadla obsahující glutamany a barviva. Indické omáčky se nezahušťují, svou hustotu získají redukcí, jsou tedy vhodné pro zákazníky s bezlepkovou dietou. Můžete ochutnat například vynikající curry omáčku.\nStálý jídelní lístek je sestaven tak, aby jste měli možnost poznat jídla celé Indické Republiky (federace). Na jednom místě, v naší restauraci, najdete pokrmy centrální Indie, severních, přímořských i jižních států federace.', '2017-04-06 12:34:56', '2017-04-20 11:40:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1000.00', '12.00', 5, b'1'),
(272, 334, 126, 126, 537, NULL, NULL, 9, 'Bistro Choosy', 'CZE', 'petr.novak@cubalibre.cz', 'www.choosy.cz', '739010443', '739010443', 'Velké náměstí 137/17', 'Hradec Králové', '500 03', NULL, 16, '50.20987675', '15.83470469', NULL, 'CaffeIN HK s.r.o.', 'Piletická 486, Hradec Králové - Věkoše', '01660659', 'CZ01660659', '115-2579350227', '0100', 'Denně čerstvé bagety, sendviče, Domácí burgery', 'V CHOOSY připravujeme všechny výrobky ručně a každý den pouze z čerstvých surovin bez přidávání jakýchkoliv dochucovadel, chemických a konzervačních látek. Pečivo dopékáme několikrát denně, tak abyste si jej mohli zakoupit co nejčerstvější. Veškeré pokrmy u nás vyrábíme a prodáváme. Můžete také využít nákupu take-away s 10% slevou, nebo si je nechat dovézt až domů nebo do práce naší delivery službou.', '2017-04-06 12:37:44', '2017-04-20 12:25:10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1400.00', '15.00', 9, b'1'),
(273, 335, 126, 126, 537, NULL, NULL, 1, 'Restaurace Férová Palačinkárna', 'CZE', 'martina.telecka72@gmail.com', 'www.ferovapalacinkarna.cz', '725992199', '725992199', 'Masarykovo náměstí 396/15', 'Hradec Králové', '500 02', NULL, 16, '50.21177484', '15.82536000', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Rodinný podnik, Domácí palačinky, Kvalita', 'Férová palačinkárna je místem, kde si můžete v klidu a pohodlí vychutnat domácí palačinku připravovanou vždy s úsměvem. K té vám nabídneme fairtradovou kávu nebo třeba domácí ovocnou limču. Na své si u nás přijde jak jedlík typické české sladké kuchyně, tak i vegan či bezlepkář. \n\nJaká jsou naše kréda? \nJsme rodinným podnikem, kde má každý člen své místo. \nPropojování generací a zájem o lepší mezilidské vztahy. \nUpřednostňujeme lokální suroviny nebo ty, které byly získány ohleduplným způsobem. \nKvalita u nás vyhrává nad kvantitou. \nA především férové chování k vám - našim zákazníkům, zaměstnancům a v neposlední řadě také k přírodě. \n\nPřijďte se přesvědčit... :-)', '2017-04-06 12:41:41', '2017-04-20 12:36:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1000.00', '19.00', 11, b'1'),
(274, 336, 126, 126, NULL, NULL, NULL, 5, 'Pivnice Doors', 'CZE', 'radekdvere@seznam.cz', 'neni', '731712675', '731712675', 'třída Edvarda Beneše 1431/5', 'Hradec Králové', '500 12', NULL, 16, '50.19478524', '15.84062169', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Široká nabídka piv', 'Pohodový podnik, kam zavítat na širokou nabídku skvělých piv, ať už od velkých nebo malých pivovarů.', '2017-04-06 12:45:12', '2017-04-20 12:47:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1100.00', '12.00', 11, b'1'),
(275, 337, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Vintage', 'CZE', 'hakaso@seznam.cz', 'https://www.facebook.com/Vintage-cafe-1310731805645081/', '774303155', '774303155', 'Gočárova třída 687', 'Hradec Králové', '500 02', NULL, 16, '50.21039090', '15.82388925', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Kavárna', 'Kavárna s příjemným posezením, vynikajícím štrůdlem a zákusky', '2017-04-06 14:00:52', '2017-04-20 14:11:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1600.00', '10.00', 8, b'1'),
(276, 338, 126, 126, 537, NULL, NULL, 1, 'Restaurace Městské Lázně', 'CZE', 'mestskelaznehk@seznam.cz', 'www.lazne-hradec.cz', '604137651', '604137651', 'Eliščino nábřeží 842/3', 'Hradec Králové', '500 03', NULL, 16, '50.21438470', '15.82884930', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vynikající kuchyně, Kvalitní obsluha, Terasa', 'Historie Městských lázní sahá až do 30. let minulého století, kdy zde bylo vybudováno jedno z nejmodernějších plaveckých zařízení svého druhu v celé zemi i širokém okolí. Tuto krásnou dobu dodnes připomíná i interiér restaurace, která je pro svou charakteristickou atmosféru oblíbeným místem jak pamětníků starých časů, tak i mladší generace hostů vyhledávajících příjemné prostředí s kvalitní obsluhou a vynikající kuchyní.\nRestaurace - stejně jako celý areál lázní - je striktně nekuřácká, její návštěva je tedy vhodná i pro rodinky s dětmi, pro které máme připravený malý dětský koutek, v němž mohou v klidu řešit všechny životně důležité a neodkladné záležitosti svého dětského království.\nPatříte-li do tábora lidí, kteří si svou kávu či pivo bez cigarety opravdu patřičně nevychutnají, po celý rok je otevřená terasa, na níž je kouření povoleno, v létě navíc zařízená příjemným posezením ve stínu slunečníků.\nK dispozici je i salónek vhodný pro pořádání soukromých setkání a srazů, slavnostních obědů či večeří, ale i firemních akcí a večírků, o celkové kapacitě cca 30 míst. Pro zvláštní příležitosti je samozřejmě možné zarezervovat i kompletně celou restauraci (celkem cca 60 míst).\nVšechny služby jsme vám připraveni poskytnout po sedm dní v týdnu, a to včetně oblíbených poledních menu, která nabízíme i o víkendu!\nAť už vás k nám zavedou důvody jakékoliv, vězte, že u nás jste vždy vítanými a váženými hosty a bude pro nás potěšením vyjít vám a vašim požadavkům maximálně vstříc.', '2017-04-06 14:03:42', '2017-04-20 14:19:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1500.00', '10.00', 10, b'1'),
(277, 339, 126, 126, NULL, NULL, NULL, 1, 'Restaurant hotelu Tereziánský dvůr', 'CZE', 'terezianskydvur@eahotels.cz', 'http://www.hotelterezianskydvur.com/', '495505812', '775402607', 'Jana Koziny 336', 'Hradec Králové', '500 03', NULL, 16, '50.20823575', '15.83725816', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Moderní prostorová restaurace', 'EA Hotel Tereziánský dvůr**** je vybaven prostornou restaurací s vnitřní kapacitou do 80 osob a velkou terasou, dva bary a kavárnu.\n\nOriginální restaurace a bar v černo-bílém barevném ladění s bodovým světlem je umístněna na prvním poschodí nad hotelovou recepcí. Objemné obloukovité schodiště s rubínově červeným mramorem a bezrámovým zasklením ústí do jednolitého patra gastronomických provozů.\n\nDesignově je restaurace řešena ohýbaným stropem a podsvíceným bílým světlem na černé tvarované překližce s holografickou fólií. Denním světlem prosvětlený prostor může být i zatemněn a získat tak vznešeně romantickou atmosféru s čistými liniemi. Barový pult je ozvláštněn zlatou metalickou mozaikou v pozadí a květináči se zelenými prvky.\nAtmosféra a oblíbenost restaurace se neodmyslitelně odráží od personálu a ostříleného šéfkuchaře.\n\nV případě potřeby pro větší kapacitu hostů poslouží kavárna jako dodatečný restaurační prostor s přilehlým, plně vybaveným barem.\n\nProsklené stěny restaurace nabízí překrásný výhled na zahradu lemující terasu a střechu velkokapacitního parkoviště.\n\nVenkovní a vnitřní prostory restaurace jsou ideálními místy pro setkávání, obchodní jednání, firemní, rodinné, společenské a kulturní akce včetně pořádání svateb.', '2017-04-06 14:07:46', '2017-04-20 14:45:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1400.00', '16.00', 12, b'1'),
(278, 340, 126, 126, NULL, NULL, NULL, 1, 'Bowling bar 69', 'CZE', 'info@bb69.cz', 'www.bb69.cz', '775042668', '775042668', 'Collinova 421', 'Hradec Králové', '500 03', NULL, 16, '50.21593095', '15.83091579', NULL, 'Daniel Rezek', 'Riegrova 741, Česká Skalice', '68229984', 'CZ8105183240', '115-2579350227', '0100', 'Nekuřácká restaurace, Bowling, Zahrádka', 'Bowling bar 69 je moderní nekuřácká restaurace v Hradci Králové, nacházejicí se v lokalitě Aldis. Restaurace nabízí široký výběr z domácí i zahraniční gastronomie, kvalitních vín a nápojů. V době obědů připravuje polední menu za rozumné ceny. Restaurace disponuje kvalitním audio-video systémem, vhodným k pořádání seminářů a firemních prezentací. Restaurace dále zajišťuje rauty, svatby a další soukromé, či firemní akce. Návštěvníci podniku si zde můžou zahrát bowling a v létě i petanque. V letních měsících je na terase otevřena příjemná zahrádka.', '2017-04-06 14:11:19', '2017-04-20 15:10:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1300.00', '14.00', 10, b'1'),
(279, 341, 126, 126, NULL, NULL, NULL, 1, 'Restaurant Hotelu Pod Věží', 'CZE', 'hotel@pod-vezi.cz', 'www.pod-vezi.cz', '495514932', '602583210', 'VELKÉ NÁMĚSTÍ 165', 'Hradec Králové', '500 03', NULL, 16, '50.20909951', '15.83149453', NULL, 'Jana Vacková', 'Velké náměstí 165/2, Hradec Králové', '47506032', 'CZ485814216', '115-2579350227', '0100', 'Moderní restaurace, Kvalitní gastronomický zážitek', 'Moderně vybavená restaurace hotelu Vacek "Pod Věží" Hradec Králové nabízí široký výběr jídel z české a mezinárodní kuchyně a také velmi pestrý výběr nápojů. Kapacita restaurace je 40 až 50 míst. Restaurace je zařízena v moderním stylu, což v kombinaci s pestrým výběrem jídel z našeho jídelního lístku společně s kuchařským uměním našich kuchářů zaručuje kvalitní gastronomický zážitek.', '2017-04-06 14:49:47', '2017-04-20 15:18:33', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '11.00', 9, b'1'),
(280, 342, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Petr', 'CZE', 'pension.petr@email.cz', 'www.penzionpetr-hk.cz', '495541571', '724135297', 'Bratří Štefanů 125', 'Hradec Králové', '500 03', NULL, 16, '50.21573040', '15.85732910', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Příjemná atmosféra, Profesionální přístup', 'V příjemném prostředí naší restaurace bude i pracovní oběd vždy příjemnou záležitostí a večeře s rodinnou či přáteli radostným zážitkem. Uvítá vás klidná příjemná atmosféra se vstřícným personálem a profesionálním přístupem. To jsou hlavní ingredience, díky kterým věříme, že se k nám budete rádi znovu a znovu vracet.', '2017-04-06 14:53:04', '2017-04-20 15:30:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1400.00', '11.00', 9, b'1'),
(281, 343, 126, 126, NULL, NULL, NULL, 1, 'Penzion a restaurant U Růže', 'CZE', 'restauraceuruze@seznam.cz', 'www.uruze.cz', '702016700', '702016700', 'Pražská tř. 71/123', 'Hradec Králové', '500 04', NULL, 16, '50.20266730', '15.78702450', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Rodinná restaurace, Tradiční česká kuchyně, Denní menu', 'Naše rodinná restaurace U Růže v Hradci Králové nabízí stylové prostředí nejen pro obědy a večeře, ale i pro oslavy, promoce, svatby, rauty a firemní večírky. Restaurace je založena převážně na tradiční české kuchyni, doplněnou o prvky moderní gastronomie. V restauraci klademe důraz na přípravu jídel z čerstvých surovin, upřednostňujeme maso z českých chovů.\nPřijďte ochutnat naše speciality, posadit se v příjemných prostorách rodinné restaurace a nechte se obsloužit ochotným personálem.Pro početnější skupiny nabízíme možnost rezervace sálu s 45 místy k sezení, velkého sálu s 40 místy nebo malého salónku, ve kterém se nachází 20 míst k sezení.', '2017-04-06 14:56:18', '2017-04-20 15:37:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1900.00', '19.00', 13, b'1'),
(282, 344, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Švagerků', 'CZE', 'rehoso@seznam.cz', 'www.restauraceusvagerku.cz', '495534046', '777249355', 'Všehrdova 194', 'Hradec Králové', '500 02', NULL, 16, '50.21057770', '15.80996540', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá kuchyně, Polední menu, Zahrádka', 'Restaurace U Švagerku Vám nabízí možnost příjemného posezení v Hradci Králové. Kuřácký prostor u výčepu je stavebně oddělen od nekuřácké jidelny pro cca 30 osob. Možnost propojení s dalšími dvěma salonky až pro 40 a 90 osob.\nLze zde pořádat oslavy, svatební hostiny, večírky, rauty, smuteční hostiny a školení.\nPři hezkém počasí Vás navíc zveme k posezení na venkovní zahrádce s využitím pro děti.', '2017-04-06 14:58:53', '2017-04-20 15:43:41', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1200.00', '14.00', 8, b'1'),
(283, 345, 126, 126, NULL, NULL, NULL, 1, 'Restaurant Klub Escobara', 'CZE', 'info@escobara.cz', 'www.escobara.cz', '495211777', '603277834', 'tř. Karla IV. 612', 'Hradec Králové', '500 02', NULL, 16, '50.21340694', '15.82435136', NULL, 'AEROSTYL s.r.o.', 'Baťkovo náměstí 625/1, Hradec Králové', '25286498', 'CZ25286498', '115-2579350227', '0100', 'Polední menu', 'Restaurace byla zbudována na místě bývalé dětské obuvi. Krom základního pití a stálého jídelního lístku nabízí v pondělí až pátek dvě polední menu a na víkend vždy připravují zajímavou nabídku jídel v ještě zajímavějších cenových relacích. Restaurace se zabývá i cateringem a to v restauraci nebo na místě, které si zvolíte. Pořádají se tu svatby, podnikové večírky, uzavřené společnosti atd.', '2017-04-06 15:02:31', '2017-04-20 15:53:42', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1000.00', '18.00', 7, b'1'),
(284, 346, 126, 126, 537, NULL, NULL, 1, 'Sport Cafe', 'CZE', 'sportcafe@quick.cz', 'www.sport-cafe.cz', '495514202', '773400600', 'Velké náměstí 151/10', 'Hradec Králové', '500 01', NULL, 16, '50.20955576', '15.83234135', NULL, 'SPORT CAFE, s.r.o.', 'Velké náměstí 151/10, Hradec Králové', '25932101', 'CZ25932101', '115-2579350227', '0100', 'Polední menu, Rozvoz jídla, Objednávky online', 'Příjemná restaurace a kavárna v centru Hradce Králové. Nabídka poledních menu i specialit české kuchyně včetně rozvozu.', '2017-04-06 15:05:58', '2017-04-20 15:59:27', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1900.00', '16.00', 7, b'1'),
(285, 347, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Letců', 'CZE', 'uletcu@uletcu.cz', 'www.uletcu.cz', '732144667', '732144667', 'Jana Černého 109', 'Hradec Králové - Věkoše', '503 41', NULL, 16, '50.23197740', '15.83447260', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Česká i zahraniční kuchyně, Pokrmy z ryb, Zahrádka', 'Nabídneme Vám chutné jídlo v "Pilotově formance", samozřejmostí je oddělený prostor pro nekuřáky, v letních měsících můžete pojíst na venkovní zahrádce a když se ochladí, podáváme obědy v nekuřáckém Clubu RUNWAY 96. Dovolíme si Vám nabídnout na denním jídelním lístku klasická jídla české i zahraniční kuchyně, ale i jinde méně často nabízené pokrmy z ryb. Komu by naše denní nabídka nestačila, může si vybrat i z obsáhlého stálého jídelního lístku, který se snaží uspokojit snad všechny Vaše možné chutě.', '2017-04-06 15:08:29', '2017-04-20 16:06:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1200.00', '16.00', 8, b'1'),
(286, 348, 126, 126, NULL, NULL, NULL, 1, 'Hospůdka U Hrušky', 'CZE', 'hruska.j10@seznam.cz', 'www.uhrusky.majestat.cz', '603706024', '603706024', 'Opletalova 328', 'Hradec Králové', '500 03', NULL, 16, '50.21248395', '15.83525859', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Klimatizace, Letní zahrádka, Nekuřácká část', 'Příjemné posezení v Hradci Králové.\nVlastnosti podniku: extra salónek, klimatizace, letní zahrádka, nekuřácká část, pořádání akcí, točená Kofola.\nJe dovolen vstup se psy. A je možno si zahrát silverball, fotbálek nebo šipky.', '2017-04-06 15:11:43', '2017-04-20 16:14:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1100.00', '14.00', 14, b'1'),
(287, 349, 126, 126, NULL, NULL, NULL, 1, 'Atlanta bar', 'CZE', 'broz@atlantabar.cz', 'www.atlantabar.cz', '495515431', '603461398', 'Švehlova 504', 'Hradec Králové', '500 02', NULL, 16, '50.21140749', '15.82569268', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Polední menu, Míchané nápoje', 'Bar a restaurace Atlanta je zavedenou firmou již více než 25 let. Jde o podnik vedený se zájmem poskytovat co nejlepší služby na co nejvyšší úrovni.\nRestaurace Atlanta nabízí velký výběr jídel domácí i zahraniční kuchyně. Specialitou restaurace je široká nabídka salátů z čerstvé zeleniny připravovaných s různými druhy a úpravou masa.\nPravidelně pořádáme tématické kuchyně a tak hosté mohou ochutnat např. mexické, slovenské nebo krkonošské speciality připravované profesionály, kteří jídlo pro Vás chystají s nejvyšší péčí.', '2017-04-06 15:14:18', '2017-04-20 16:21:49', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1500.00', '18.00', 12, b'1'),
(288, 350, 125, 125, 125, NULL, NULL, 11, 'Čajovna U Kamenný Želvy', 'CZE', 'petr.wittmayer@gmail.com', 'http://www.kamenna-zelva.wz.cz/index.htm', '774669266', '000', 'BAAROVA 1158/7', 'Liberec 1', '460 01', NULL, 32, '50.77154420', '15.06495980', NULL, NULL, NULL, '000', '000', '000', '0000', 'čaje, vodní dýmky', 'čaje, vodní dýmky', '2017-04-07 06:37:56', '2017-04-07 06:40:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1300.00', '13.00', 12, b'1'),
(289, 351, 125, 125, 125, NULL, NULL, 2, 'Mamitas Coctail Bar Liberec', 'CZE', 'info@mamitas.cz', 'http://www.mamitas.cz', '776 000 285', '000', 'Rumunská 123/3', 'Liberec 1', '460 01', NULL, 32, '50.76789090', '15.05998290', NULL, NULL, NULL, '000', '000', '000', '0000', 'cocktail a plážový ba, dvě patra, alkohol, rumy, koňaky', 'AMITAS COCKTAIL BAR LIBEREC\nPo mnohaletém cestování po Severní a Střední Americe, sbírání zkušeností po tamních nejznámějších cocktailových a plážových barech, vznikla myšlenka vytvořit obdobný bar v Liberci. Začal se psát rok 2007 a s ním začalo budování prostor baru. První hosté zavítali do ojedinělého, dvoupatrového, ryze cocktailového baru, již v 9.11.2007.\n\nV nabídce je připraveno více než 70 alkoholických i nealkoholických cocktailů, velké množství různých druhů alkoholů, od prémiových vodek, přes stařené rumy, 100% tequily až po výběrové koňaky, ze všech možných koutů světa.\n\nKaždý den si můžete naše drinky vychutnat ve speciální Happy Hour, která probíhá mezi 19:00 - 20:00. Všechny objednané alkoholické drinky dostanete hned 2 za cenu 1.\n\nNa Vaši návštěvu se těší celý tým barmanů a barmanek Mamitas Bar Liberec.', '2017-04-07 06:43:07', '2017-04-07 06:45:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1500.00', '14.00', 10, b'1');
