(290, 352, 125, 125, 125, NULL, NULL, 4, 'La Piccola Perla', 'CZE', 'la.piccola.perla@email.cz', 'http://www.lapiccolaperla.cz', '224 282 537', '000', 'Perlová 1', 'Praha 1', '110 00', NULL, 50, '50.08368430', '14.42117750', NULL, NULL, NULL, '000', '000', '000', '0000', 'Italské pokrmy, polední menu, Italské domácí speciality, romantické večeře', 'Vítejte na stránkách restaurace, která pro Vás každý den připravuje oázu klidu a výtečných italských pokrmů v Perlově ulici v centru Prahy. Pizzerie La Piccola Perla Vám v rušných pracovních dnech nabízí únik před pracovním stresem v podobě lahodných pokrmu, které nabízí denní polední menu. O víkendech si u nás můžete vychutnávat skutečné italské domácí speciality, připravované pouze s čerstvých surovin a zpříjemnit si tím víkendové procházky v centru Prahy. \n\nStejně tak jako perla, tak i mi se snažíme oslnit a zpříjemnit romantické chvilky strávené s blízkými a milovanými lidmi při romantické večeři v příjemném prostředí. V našich prostorách pizzerie La Piccola Perla naleznete klimatizovánu nekuřáckou část restaurace pro 60 osob. Myslíme i na kuřáky, pro ně máme 25 míst, kde se mohou oddávat své neřesti a společně s cigaretou vychutnávat třeba výtečnou italskou kávu. \n\nTěšíme se na Vás\nPizzerie La Piccola Perla Praha', '2017-04-07 06:52:10', '2017-04-07 06:54:05', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1400.00', '10.00', 12, b'1'),
