(293, 355, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Salieri Café', 'CZE', 'cafe@salieri.cz', 'www.salieri.cz', '603904711', '603904711', 'Švehlova 504/16', 'Hradec Králové', '500 02', NULL, 16, '50.21125900', '15.82582360', NULL, 'Coffee & Soul s.r.o.', 'Švehlova 504/16, Hradec Králové', '04584309', 'CZ04584309', '115-2579350227', '0100', 'Café, Fresh bar, Relax', 'V Salieri café si i při plném obsazení užijete pohodovou atmosféru.\nBavte se a relaxujte!\nPřipravili jsme pro Vás nové menu, které obsahuje více našich domácích produktů s láskou dělaných:) Domácí pečený čaj zhotovený ze směsi ovoce a koření, úžasná malinová limonáda, slaný dort quiche, sezónní smoothie Kiwina, sezónní pomerančový fresh se zázvorem, štrůdl s mandličkami…', '2017-04-07 11:59:42', '2017-04-20 16:43:03', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1900.00', '15.00', 14, b'1'),
(294, 356, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Coffe Čtyřlístek', 'CZE', 'leona.simlova.hk@seznam.cz', 'www.coffeectyrlistek.cz', '777613979', '777613979', 'Tř. Karla IV. 610', 'Hradec Králové', '500 02', NULL, 16, '50.21346041', '15.82227359', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vlastní výrobna dezertů, Berbariérový přístup, Předzahrádka', 'Kavárna Coffee Čtyřlístek se nachází v centru města Hradec Králové. Nabízí bezbariérový přístup a v sezoně i venkovní předzahrádku. Hlavním produktem je káva Julius Meinl 1862 Premium s bohatou tradicí. Kavárna disponuje vlastní výrobnou zákusků i dezertů, které si můžete vychutnat na místě, nebo si je třeba odnést domů. Kavárna nabízí i širokou škálu alkoholických a nealkoholických nápojů. Za zmínku stojí Africká vína a čerstvé limonády vlastní výroby podle originálních receptur.', '2017-04-07 12:04:07', '2017-04-20 16:57:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1900.00', '18.00', 9, b'1'),
(295, 357, 126, 126, 537, NULL, NULL, 9, 'Bistro u dvou přátel', 'CZE', 'hana.simackova@skokdozivota.cz', 'www.skokdozivota.cz', '724461102', '724461102', 'Soukenická 55 - Pivovarské nám', 'Hradec Králové', '500 03', NULL, 16, '50.20799810', '15.82984530', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Bezbariérové, Dětský koutek, Koutek pro nejmenší', 'Přijměte naše pozvání k posezení v BISTRU u dvou přátel! \n\nJsme sociální podnik obecně prospěšné společnosti SKOK do života. Náš pracovní tým tvoří z velké části pracovníci s mentálním postižením. Všichni bez rozdílu chceme svým talentem a nadšením maximálně přispět ke spokojenosti našich zákazníků.\n\nUvnitř Bistra na vás čeká moderní vybavení laděné v zelené odpočinkové barvě. Posedět můžete také venku. Pro rodiče s dětmi máme k dispozici koutek se stavebnicemi Lego a Duplo. Pro ty nejmenší  je připraven přebalovací pult a kojící koutek.\n\nCelý prostor Bistra je plně bezbariérový, dostupnost je zajištěna přes Regiocentrum Nový Pivovar, kde můžete také zaparkovat. Ceny za parkování jsou přiměřené vzhledem k poloze v centru města. \nPro ty, kteří potřebují připojení k internetu, nabízíme v našem Bistru Wifi zdarma.\nProstor lze flexibilně přizpůsobit firemním a školícím akcím, součástí našeho vybavení je dataprojektor a flipchart.\n\nKapacita bistra je 30 míst.', '2017-04-07 12:07:19', '2017-04-20 17:05:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1400.00', '11.00', 7, b'1'),
(296, 358, 126, 126, NULL, NULL, NULL, 10, 'Cukrárna Lucka', 'CZE', 'hofman.miloslav@seznam.cz', 'neni', '774625414', '774625414', 'třída SNP 640/12', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21767387', '15.85261036', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vlastní výroba', 'Prodávají zde cukrářské výrobky vlastní výroby.', '2017-04-07 12:10:55', '2017-04-20 17:11:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1100.00', '18.00', 11, b'1'),
(297, 359, 126, 126, NULL, NULL, NULL, 10, 'Cukrárna Jadran', 'CZE', 'hanastupkova15@seznam.cz', 'www.cukrarna-jadran.cz', '731478468', '731478468', 'Úprkova 313', 'Hradec Králové', '500 09', NULL, 16, '50.20422380', '15.85610780', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vlastní výroba, 7dní v týdnu, Zmrzlina plná ovoce', 'Naše firma funguje v Hradci Králové již od roku 1992. S touto tradicí a zkušenostmi jsme zde pro všechny milovníky klasických i netradičních sladkostí, pro ty, kteří milují lahodnou chuť čerstvých dortů a zákusků. \nJsme pyšní na to, že jsme cukrárna s vlastní výrobou, vlastními recepturami a přesvědčením o kvalitě každého jednotlivého výrobku.\nPrávě zmiňovaná kvalita je při výrobě a volbě surovin pro finální podobu a chuť výrobků tím nejdůležitějším faktorem. Při výrobě náplní používáme zásadně „pravou" živočišnou šlehačku.\n\nNaší předností je otevírací doba sedm dní v týdnu od 10 do 17 hodin, včetně státních svátků a možnost výroby šlehačkových dortů na počkání do 15 min.\n\nVelký výběr zákusků po celý den i před zavírací dobou. Zmrzlina vlastní výroby plná ovoce.', '2017-04-07 12:13:42', '2017-04-20 17:17:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1600.00', '19.00', 14, b'1'),
(298, 361, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Secese', 'CZE', 'vladimir.mlejnek@cpihotels.com', 'www.hotelcernigovhradeckralove.com/cs/restaurant_bar', '495814292', '725758668', 'Riegrovo náměstí 1494', 'Hradec Králové', '500 02', NULL, 16, '50.21442290', '15.81350320', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vyhlášená kuchyně', 'Hotelová restaurace s 220 místy a vyhlášenou kuchyní, otevřená denně od 11:00 do 14:30.', '2017-04-09 10:21:43', '2017-04-21 02:44:05', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1600.00', '16.00', 7, b'1'),
(299, 362, 126, 126, 537, NULL, NULL, 5, 'Zadrobílkův hostinec Na Staré', 'CZE', 'medved.moto@seznam.cz', 'neni', '721974484', '721974484', 'Velká 36/85', 'Hradec Králové', '503 41', NULL, 16, '50.23102880', '15.84828223', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá kuchyně, Zahrádka', 'Nabízí zde jídla teplé kuchyně a alkoholické i nealkoholické nápoje. K dispozici je 72 míst a zahrádka pro 60 osob.', '2017-04-09 10:26:53', '2017-04-20 17:36:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1000.00', '19.00', 11, b'1'),
(300, 363, 126, 126, NULL, NULL, NULL, 2, 'Orlice bar', 'CZE', 'jacob.kalensky@seznam.cz', 'neni', '604857933', '604857933', 'Bratří Štefanů 131/46', 'Hradec Králové', '500 03', NULL, 16, '50.21546520', '15.85696270', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Studená kuchyně, Zahrádka', 'Provoz baru s nabídkou studené kuchyně, alkoholických a nealkoholických nápojů. Kapacita je 50 míst. K dispozici je zahrádka a dětské hřiště.', '2017-04-09 10:30:13', '2017-04-20 17:42:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1500.00', '10.00', 10, b'1'),
(301, 364, 126, 126, 537, NULL, NULL, 5, 'Pivnice U Báby', 'CZE', 'kuchynskespotrebice@seznam.cz', 'www.hospodaubaby.cz', '495444111', '777833844', 'Dykova 1328', 'Hradec Králové - Pražské předměstí', '500 02', NULL, 16, '50.20312800', '15.81228140', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Točená Kofola, Zahrádka, Gril, Dětské hřiště, Wifi', 'Rádi bychom Vás pozvali k příjemnému posezeni... Točíme Plzeňský Prazdroj, Velkopopovický kozel 11,Staropramen 10 a Kofolu. Samozřejmě je v nabídce spousta dalších alko i nealko nápojů. Posedět můžete na zahrádce, nebo v hospůdce a k tomu si dát nějakou mňamku z grilu a svoje ratolesti přenechat dětskému hřišti, kde najdou jak skluzavku, tak i houpačky s pískovištem a velkou tabulí, kde můžou vyzkoušet svoje malířské dovednosti. Pobavit se také můžete u elektronických šipek, internetu, či sledování přímých přenosů na plátně nebo velkoplošné televizi v hospůdce. WiFi zdarma.', '2017-04-09 10:35:13', '2017-04-20 17:47:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1200.00', '11.00', 13, b'1'),
(302, 365, 126, 126, 537, NULL, NULL, 1, 'Restaurace Grilbar Splávek', 'CZE', 'olca.michajlikova@seznam.cz', 'www.hrazkasplavek.cz', '606225903', '606225903', 'Na Hrázce 215', 'Hradec Králové - Malšovice', '500 09', NULL, 16, '50.19952277', '15.86002277', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Gril, Zahrádka', 'V restauraci Splávek můžete ochutnat spoustu specialit z grilu, ať už přímo v interiéru restaurace nebo na zahrádce.', '2017-04-09 11:52:25', '2017-04-20 17:55:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1300.00', '17.00', 14, b'1'),
(303, 366, 126, 126, 537, NULL, NULL, 1, 'Restaurace Hnízdo snů', 'CZE', 'janarbter@seznam.cz', 'www.hnizdosnu.cz', '608024616', '608024616', 'Úzká 208/5', 'Hradec Králové', '500 03', NULL, 16, '50.21037032', '15.83457241', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Zajímavá zábava', 'Hnízdo snů je projektem tří snílků, kteří chtějí, abyste se v našem Hnízdě cítili útulně a v naší restauraci Vám chutnalo. \nŠiroká nabídka teplých i studených rautů, oslav či slavnostních obědů s možností ubytování. Možnost projekce na velké plátno v příjemném prostředí až pro čtyřicet lidí. Salónek pro Váš třídní sraz či poklidné posezení s přáteli s kapacitou až šestnáct míst. Rádi se Vám přizpůsobíme a vymyslíme řešení i pro netradiční akce i mimo otevírací dobu.', '2017-04-09 11:55:38', '2017-04-20 18:04:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1200.00', '15.00', 14, b'1'),
(304, 367, 126, 126, 537, NULL, NULL, 3, 'Hradecká kavárna', 'CZE', 'heneova.unihome@volny.cz', 'www.hradeckakavarna.cz', '606094710', '606094710', 'Komenského 240', 'Hradec Králové', '500 03', NULL, 16, '50.20985100', '15.83777230', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'MöVENPICK', 'Švýcarská káva MöVENPICK vysoké kvality ve všech variantách, výborná švýcarská zmrzlina MöVENPICK, lahodná rozlévaná španělská vína z oblasti Valencie - na to vše se můžete těšit při návštěvě Hradecké kavárny.', '2017-04-09 11:58:31', '2017-04-20 18:11:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '18.00', 13, b'1'),
(305, 368, 126, 126, 537, NULL, NULL, 3, 'Literární kavárna KMHK', 'CZE', 'kavarna@knihovnahk.cz', 'www.knihovnahk.cz', '495075052', '702088528', 'Wonkova 1262/1a', 'Hradec Králové', '500 02', NULL, 16, '50.21648430', '15.82161730', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Káva, Čaje, Limonády, Domácí zákusky', 'Vybrali jsme pro Vás to nejlepší. Kávu Seladon Espresso Classico s velmi silnou, intenzivní chutí a výraznou krémovitou pěnou. Výběrové čaje Oxalis Oxabag z nejlepších čajových zahrad světa – z Číny, Indie a Japonska. Domácí limonády Lemonade Tea – 100% sirupy vyráběné z výběrového ovoce. Exkluzivní zmrzlinu Giroma Gelato dle klasických italských receptur, jedinou v Hradci Králové. Domácí zákusky z lokální cukrárny Sladký ráj Všestary, vyráběné podle původních receptur. Čerstvě připravované zeleninové a ovocné saláty. Nejlepší vína z vinařství Lahofer.', '2017-04-10 01:58:42', '2017-04-21 02:48:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1500.00', '18.00', 11, b'1'),
(306, 369, 126, 126, 537, NULL, NULL, 3, 'Kavárna Cafe Dílna', 'CZE', 'cafedilna@seznam.cz', 'www.cafedilna.cz', '775274433', '775274433', 'Komenského 266/3', 'Hradec Králové', '500 02', NULL, 16, '50.20798660', '15.83247330', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Domácí dezerty, Wifi, Zahrádka, Chyttrý kvíz', 'Přijďte objevit bohatou chuť filtrované kávy a domácích desertů, které pro Vás s láskou čerstvé připravujeme a pečeme. V naší útulné nekuřácké kavárně si můžete také vychutnat espresso, capuccino, latte, kvalitní čaje, chutné víno… Přijďte posedět v tvůrčí atmosféře tradičních řemesel. K dispozici je Wi-Fi a zahrádka. Teplé nápoje Vám rádi připravíme sebou. Těšíme se na Vás.', '2017-04-10 02:01:23', '2017-04-21 03:26:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1400.00', '10.00', 5, b'1'),
