(308, 371, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Pírků', 'CZE', 'ucto.hulkova@gmail.com', 'www.upirku.cz', '603797083', '603797083', 'Dubinská 48', 'Hradec Králové - Svinary', '500 09', NULL, 16, '50.20996460', '15.90313940', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Tradiční český hostinec, Okolo cyklostezky, Nekuřácké místo', 'Tradiční český hostinec ve městě Hradec Králové, místní části Svinary. Hostinec je oblíbeným cílem cyklistů, kteří brázdí okolní cyklostezky. \nNově jako nekuřácké místo!  \nČeká na Vás denní nabídka hotových jídel. O víkendech pořádáme různé akce typu grilování, hody a pod. \nSamozřejmostí jsou nejlepší česká piva - Plzeň a Rohozec! \nOslavy, setkání s příteli, rauty, promoce pro nás nejsou žádný problém!', '2017-04-10 02:08:00', '2017-04-21 03:40:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '16.00', 13, b'1'),
