(313, 376, 126, 126, 537, NULL, NULL, 1, 'Restaurace Pavlína', 'CZE', 'martinjahelka@seznam.cz', 'www.biricka.hostuju.cz', '495268097', '724919186', 'Na Biřičce 877', 'Hradec Králové', '500 08', NULL, 16, '50.17107980', '15.85713160', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá kuchyně, Letní terasa, Grilování, Jukebox', 'Příjemné posezení v klidném a útulném prostředí blízko rybníka. Obědy, večeře. Rychlá a milá obsluha. Venkovní posezení na letní terase s možností grilování. Jukebox a elektronické šipky. Dataprojektor s možností sledování sportovních utkání. Kapacita na pořádané akce 50 míst.', '2017-04-10 02:40:23', '2017-04-21 04:29:44', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '12.00', 5, b'1'),
(314, 377, 126, 126, 537, NULL, NULL, 1, 'Restaurant Grill Duran', 'CZE', 'info@duran.cz', 'www.duran.cz', '495272750', '608945865', 'Sekaninova 398/2', 'Hradec Králové - Moravské Předměstí', '500 11', NULL, 16, '50.18411650', '15.82863840', NULL, 'Duran Grill, spol. s r.o.', 'Sekaninova 398/2, Hradec Králové - Moravské Předměstí', '28812697', 'CZ28812697', '115-2579350227', '0100', 'Nekuřácký restaurant, Catering na míru, Originální gastronomie', 'Restaurant Grill Duran se vyznačuje širokou nabídkou vynikajících jídel a vín domácí i zahraniční produkce. Prostředí restaurantu je vhodné jak pro posezení s přáteli, pořádání soukromých oslav, banketů a večírků, tak pro firemní jednání, semináře, školení a konference. V letních měsících restaurant disponuje velkou letní zahradou s kapacitou cca 150 míst. Venkovní prostředí je ideální pro pořádání zahradních party. V zimním období je hostům k dispozici kapacita 240 míst ve vnitřních prostorách.', '2017-04-10 02:42:59', '2017-04-21 04:38:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1500.00', '18.00', 10, b'1'),
(315, 378, 126, 126, NULL, NULL, NULL, 10, 'Cukrárna Collinetta', 'CZE', 'rezervace@atlantabar.cz', 'www.atlantabar.cz/collinetta-cukrarna/', '495515431', '775402607', 'V kopečku', 'Hradec Králové', '500 02', NULL, 16, '50.21005980', '15.83129550', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vlastní výroba, Zahrádka', 'Útulná cukrárna s milou obsluhou v kopečku na hlavní cestě na Velké náměstí v Hradci Králové.\nMezonetově uspořádané posezení nabízí možnost příjemného strávení volných chvil u kvalitních zákusků či dortů naší vlastní výroby s kávou mnoha druhů z celého světa. Doporučujeme, aby jste ochutnali naši kávu ALFREDO . Jedná se o 100% směs Arabica s jemnou pěnou a vytříbenou chutí.\nCukrárna Collineta je ideální pro návštěvu rodiny po odpolední procházce městem. Nabízíme velký výběr skvělé zmrzliny vlastní výroby, kterou můžete ochutnat ve velké nabídce zmrzlinových pohárů, nebo v kornoutku.\nV letním období možnost posezení na venkovní zahrádce v historickém jádru města Hradce Králové.', '2017-04-10 06:02:52', '2017-04-21 05:58:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '15.00', 5, b'1'),
(316, 379, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Slávka', 'CZE', 'ladislavrybin@volny.cz', 'neni', '495513648', '605773865', 'Víta Nejedlého 1216/2', 'Hradec Králové', '500 03', NULL, 16, '50.21069620', '15.84366880', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Zahrádka', 'Provoz restaurace. Nabízí zde studenou kuchyni, pizzy, minutky, alkoholické i nealkoholické nápoje včetně stáčených vín. Kapacita je 50 míst s možností využití letní zahrádky a pořádání společenských akcí.', '2017-04-10 06:06:59', '2017-04-21 14:33:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1100.00', '16.00', 14, b'1'),
(317, 380, 126, 126, 537, NULL, NULL, 4, 'Pizzerie Pizza Express', 'CZE', 'pizzahradeckralove@seznam.cz', 'www.pizzahradeckralove.cz', '773226606', '773226606', 'Nádražní 1704/4', 'Hradec Králové - Pražské předměstí', 'Hradec Krá', NULL, 16, '50.21668330', '15.81243220', NULL, 'SUK 002, s.r.o.', 'Bořivojova 878/35, Praha 3 - Žižkov', '25965867', 'CZ25965867', '115-2579350227', '0100', 'Italská pizza, Wifi, Expresní rozvoz', 'V naší nabídce najdete 38 originálních italských pizz. Všechny pizzy jsou vyráběny od základu dle tradičních italských receptur. Nabízíme pizzu o průměru 32 cm a extra velkou pizzu o průměru 45 cm.Dále nabízíme široký sortiment nápojů z produkce firem Pepsi, Budweiser Budvar, káva Lavazza.\nPro naše zákazníky v pizzerii je možnost připojení k internetu prostřednictvím Wi-Fi zdarma.\nSamozřejmostí je expresní rozvoz pizzy a nápojů až k vám do domu, 15 hodin denně, 7 dní v týdnu.', '2017-04-10 06:18:45', '2017-04-21 14:39:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1200.00', '12.00', 13, b'1'),
(318, 381, 126, 126, 537, NULL, NULL, 10, 'Cukrárna Sladký ráj', 'CZE', 'info@sladkyrajhk.cz', 'www.sladkyrajhk.cz', '774379973', '774379973', 'Bratří Štefanů 994', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21806290', '15.87734060', NULL, 'Zuzana Vaisová', 'Baarova 1381/17, Hradec Králové - Slezské Předměstí', '12975958', 'CZ5859091359', '115-2579350227', '0100', 'Vlastní výroba, Káva', 'Provoz cukrárny a kavárny, vlastní výroba zákusků, dortů, chlebíčků, jednohubek, obložených mís a svatebních koláčků. Nabídka kávy a kávových nápojů.', '2017-04-10 06:21:05', '2017-04-21 14:46:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1300.00', '17.00', 12, b'1'),
(319, 382, 126, 126, 537, NULL, NULL, 4, 'Restaurace Piyya Luigi', 'CZE', 'pizzaluigihk@seznam.cz', 'www.pizzaluigi.cz', '602604040', '602604040', 'V Kopečku 86', 'Hradec Králové', '500 03', NULL, 16, '50.21009910', '15.83120910', NULL, 'Pizza Luigi s.r.o.', 'V Kopečku 86/11, Hradec Králové', '05539331', 'CZ05539331', '115-2579350227', '0100', 'Čerstvé a kvalitní suroviny, Polední menu, Rozvoz', 'Každý den připravujeme zajímavou polední nabídku, specialitu podniku 1/4 pizzy do ruky, vynikající sandviche Fresh Paninni, kvalitní kávu Lavazza a velmi milou obsluhu. Vážíme si našich zákazníků, kterým vždy nabízíme možnost zvýhodněné objednávky ve formě akcí, speciálních nabídek a slev. \n\nDOVEZEME VÁM PIZZU, KAM SI BUDETE PŘÁT. NECHCETE VAŘIT A LEDNIČKA JE PRÁZDNÁ? VEČÍREK? PARTY? NAROZENINY? MÁME PRO VÁS ŘEŠENí. VYBERTE SI A ZAVOLEJTE NÁM, DOVEZEME PIZZU AŽ K VÁM. ROZVOZ PO HRADCI KRÁLOVÉ JE ZDARMA. \n\nDoufáme, že si naši pizzu vyrobenou jen z čerstvých a kvalitních surovin a ingrediencí oblíbíte a budete se tak k nám stále vracet ! Přejeme Vám dobrou chuť a příjemně strávené chvíle s PIZZA LUIGI!', '2017-04-10 07:49:21', '2017-04-21 14:53:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1900.00', '16.00', 5, b'1'),
(320, 383, 126, 126, 538, NULL, NULL, 3, 'Kavárna Cross Cafe', 'CZE', 'pultarova@crosscafe.cz', 'crosscafe.cz', '608899957', '608899957', 'Ledecká 2207/19', 'Plzeň', '32300', NULL, 16, '49.77101370', '13.37354990', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'káva, dorty, wifi', 'Jsme česká síť kaváren původem z Plzně. Chcete se odměnit? Najdete nás na dobře dostupných místech. Stačí zaskočit do své nejbližší kavárny a vychutnat si pohodlí, příjemnou atmosféru a voňavou kávu. Prostě jako doma...', '2017-04-10 08:08:15', '2017-04-27 06:25:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1700.00', '18.00', 13, b'1'),
(321, 384, 126, 126, 537, NULL, NULL, 2, 'Music club Axor', 'CZE', 'jan.ales@seznam.cz', 'www.axorclub.cz', '722777111', '722777111', 'Třída SNP 733', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21725330', '15.85131330', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Koktejly, VIP salón', 'Music Club Axor Hradec Králové - stylový clubu v centru Hradce Králové.\nZ naší široké nabídky koktejlu si jistě vyberete Váš oblíbený nápoj. Naleznete zde nejširší nabídku alkoholických i nealkoholických nápojů.\nAkce nejen v pátek a sobotu! Každý pátek a sobotu pro Vás připravujeme speciální program. Můžete se těšit na GO GO tanečnice, barmanské show a především kvalitní muziku od našich profesionálních DJ´s.\nNabízíme 100 pohodlných míst k sezení ve stylově zařízeném interiéru. K pořádání slavnostních akcí jako jsou narozeniny, svátky, jubilea atd., nabízíme k využití VIP salón s vlastní obsluhou a audiovizuální technikou.\nMusic club Axor je vybaven nejmodernější profesionální zvukovou a světelnou aparaturou. 6 kW soundsystému značky dB Technologies zaručuje věrnou zvukovou produkci s dostatečnou dynamickou rezervou. Světlený park tvoří LEDkové trubice, LEDkové stripy, reflektory LED PAR 64, stroboskopy scannery a barevné lasery. Videotechniku tvoří projekční plátno, čtyři plazmové obrazovky a LCD monitory.', '2017-04-10 08:11:56', '2017-04-21 15:11:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1600.00', '16.00', 7, b'1'),
(322, 385, 126, 126, 537, NULL, NULL, 5, 'Hostinec U Vacků', 'CZE', 'vratislavhampl58@seznam.cz', 'neni', '495534233', '775402607', 'Kutnohorská 45/14', 'Hradec Králové', '500 04', NULL, 16, '50.19278760', '15.77620120', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá i studená kuchyně, Wifi, Salónek', 'Provoz hostince. Nabídka teplých i studených jídel a nápojů. Možnost připojení k WiFi internetu. K dispozici je salónek.', '2017-04-10 08:15:13', '2017-04-21 15:18:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1800.00', '14.00', 12, b'1'),
(323, 386, 126, 126, 537, NULL, NULL, 2, 'Restaurace Cafe Bar Academic', 'CZE', 'davidekbb@gmail.com', 'www.hotelovydum.cz', '495511175', '792233721', 'Akademika Heyrovského 1177/4', 'Hradec Králové', '500 03', NULL, 16, '50.20138758', '15.83401291', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Zahrádka, Wifi, Big screen', 'Spolu s ubytováním můžete využít doplňkové služby u nás nebo v blízkém okolí našeho hotelového domu a posedět ve stylovém CafeBaru Academic s terasovou zahrádkou. K dispozici je zdarma WIFI, big screen TV, stolní hry, šipky a fotbálek. Kouří se pouze na venkovní terase. \nV CafeBaru je možnost pořádání svateb, uzavřených akcí, firemních večírků a dalších setkání i se zajištěním cateringu. Lze podávat i snídaně skupinám ubytovaným v hotelu od deseti osob výše.', '2017-04-10 08:19:08', '2017-04-21 15:23:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1100.00', '17.00', 9, b'1'),
(324, 387, 126, 126, 537, NULL, NULL, 2, 'Bar Mantichora', 'CZE', 'mantichorabarhk@gmail.com', 'https://www.facebook.com/Mantichora-Bar-1378890735678328/', '721877230', '721877230', 'Československé armády 364/3', 'Hradec Králové', '500 03', NULL, 16, '50.20810350', '15.82841750', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stylové prostředí', 'Africký bar Mantichora je příjemné místo, kde můžete posedět ve stylovém prostředí, přijít se ráno občerstvit ranní kávou a něčím dobrým, večer se pobavit na některé z námi nabízených akcí nebo se jen pobavit s přáteli.\n\nMimo jiné vám nabízíme: Možnost pořádání firemních akcí či věčírků. Možnost pořádání školních akcí jako např. stužkovacích věčírků, pomaturitních večírků. Pronájem prostor pro pořádání seminářů či přednášek.', '2017-04-10 08:22:32', '2017-04-21 15:27:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1200.00', '10.00', 6, b'1'),
(325, 388, 126, 126, 537, NULL, NULL, 1, 'Restaurace Terasa', 'CZE', 'matulovahk@centrum.cz', 'www.prima-obed.cz/restaurace-terasa', '495072382', '602152089', 'Náměstí 28. října 1610', 'Hradec Králové - Pražské předměstí', 'Hradec Krá', NULL, 16, '50.21319240', '15.81701110', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Samoobslužná nekuřácká restaurace, Letní terasa', 'RESTAURACE TERASA v OD Tesco (2. patro)– moderní samoobslužná nekuřácká restaurace s letní terasou.\nDenní široká nabídka domácí české kuchyně, lahůdek a dezertů z vlastní výrobny.  Jídlo s sebou samozřejmostí.', '2017-04-10 08:26:05', '2017-04-21 15:34:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1700.00', '19.00', 11, b'1'),
(326, 389, 126, 126, 537, NULL, NULL, 1, 'Restaurace Mexita', 'CZE', 'mexita-mk@seznam.cz', 'www.mexita.cz', '495512151', '775402607', 'Velké náměstí 148', 'Hradec Králové', '500 03', NULL, 16, '50.20957890', '15.83303990', NULL, 'Restaurace Mexita Hradec s.r.o.', 'Velká 304/76, Hradec Králové - Pouchov', '05487251', 'CZ05487251', '115-2579350227', '0100', 'Mexická a italská kuchyně, České grilované speciality', 'Restaurace Mexita se nachází v historickém jádru Hradce Králové na Velkém náměstí. Specializuje se na mexickou a italskou kuchyni, ale můžete si zde vychutnat také skvělé české grilované speciality.\nRestaurace má oddělený kuřácký a nekuřácký prostor a od jara do podzimu krytou zahrádku s výhledem na historické panorama města. \nNaše restaurace se od podzimu 2013 zvětšila o dalšch 60 míst. Nyní je pro Vás rozdělena následovně: vrchní část se 14 místy je nekuřácká, první spodní část restaurace s 60 místy je kuřácká, a nově navazující druhá spodní část, taktéž s 60 místy, je opět nekuřácká.', '2017-04-10 08:29:25', '2017-04-21 15:40:29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1400.00', '10.00', 5, b'1'),
(327, 390, 126, 126, NULL, NULL, NULL, 9, 'bistRAWveg', 'CZE', 'info@bistrawveg.cz', 'www.bistrawveg.cz', '775251010', '736501588', 'V . Nejedlého 1063', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21202050', '15.85331070', NULL, NULL, NULL, NULL, NULL, '986418349', '0800', 'raw food, raw jídlo, raw stravování, vegan restaurant, raw restaurant', 'Veganské bistro pro všechny nabízející úžasné RAW jídlo plné důležitých enzymů, vitamínů, minerálů, proteinů a vlákniny.\nPestrá nabídka dobrot z přírodních surovin. Bez lepku, laktózy, rafinovaného cukru a škodlivých aditiv. Polévky, hlavní jídla, dorty,\nkoláče a další sladké i slané chuťovky. U nás víte, co jíte. Přijďte ochutnat.', '2017-04-10 08:33:01', '2017-04-22 11:29:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*5F415013BA463D6236A55D9508AE9124918E8BBD', 1, 1, NULL, NULL, '180.00', '1000.00', '19.00', 11, b'1'),
(328, 391, 126, 126, 537, NULL, NULL, 1, 'Restaurace Kozlovka', 'CZE', 'kozlovka.hk@seznam.cz', 'www.kozlovka.wbs.cz', '602455605', '602455605', 'Tř. E. Beneše 598', 'Hradec Králové - Třebeš', '500 12', NULL, 16, '50.19175820', '15.84060050', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Domácí kuchyně, Zahrádka', 'Naše restaurace Kozlovka se nachází Hradci Králové na Moravském předměstí na třídě E. Beneše 598. Můžete se těšit na pěkné prostředí s příjemnou obsluhou a hlavně výbornou domácí kuchyní. S letním počasím je pro Vás připravená i zahrádka se slunečníky, takže netřeba se bát, že by do Vás pražilo slunce. Dále se tu nachází dvoje elektronické šipky, dva LCD televizory a velké plátno s projekcí pro možnost sledování sportovních utkání atd.', '2017-04-10 08:36:31', '2017-04-21 16:55:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1600.00', '11.00', 13, b'1'),
(329, 392, 126, 126, 537, NULL, NULL, 2, 'ATP bar', 'CZE', 'info@atpbar.cz', 'www.atpbar.cz', '495763614', '775402607', 'Na Kotli 1147', 'Hradec Králové', '500 09', NULL, 16, '50.20212520', '15.84453780', NULL, 'IPC Marketing, s.r.o.', 'Československé armády 543/29, Hradec Králové', '25954881', 'CZ25954881', '115-2579350227', '0100', 'Studenti, Studentské ceny', 'Jsme první bar v České republice (pravděpodobně i na světě) zaměřený vybavením, sortimentem a personálem především na studenty farmacie a medicíny, provozovaný rovněž studenty, v areálu kolejí Na Kotli. Hlavní výhodu našeho baru vidíme ve velmi příznivě nastavených studentských cenách, které jsou v Hradci Králové bezkonkurenční. \n      Uděláme vše, co je v našich silách, aby prostředí ATP baru bylo pro Vás skutečně tím studentským makroenergickým rájem, jak už naznačuje samotné motto. Pohodlně se usaďte a vybírejte z naší široké nabídky. Přejeme Vám příjemně strávené chvíle v našem baru.', '2017-04-10 08:39:01', '2017-04-21 17:01:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1100.00', '14.00', 5, b'1'),
(330, 393, 126, NULL, NULL, NULL, NULL, 1, 'Restaurace Pasta Cook & Look', 'CZE', 'testoviny@testovinyhk.cz', 'www.testovinyhk.cz', '773660067', '773660067', 'Velké náměstí 28', 'Hradec Králové', '500 03', NULL, 16, '50.20942190', '15.83455770', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Kuřácký kout, Domácí těstoviny, Příznivá cena', 'Nacházíme se na Velkém náměstí 28 v Hradci Králové v moderních nadčasových prostorech, jejichž neformální atmosféra nikdy neztratí svoje kouzlo. Jsme nekuřácká restaurace s kuřáckým koutem , kde se mohou najíst v klidu, bez formalit a za příznivou cenu všichni, kdo mají rádi italskou kuchyni. Podáváme skvělé domácí těstoviny v Hradci Králové.', '2017-04-10 11:10:48', '2017-04-21 17:06:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'nezájem - Lukáš Starý', NULL, '150.00', '1900.00', '18.00', 10, b'1'),
(331, 394, 126, 126, 537, NULL, NULL, 7, 'Jídelna Bazalka', 'CZE', 'johana.maskova@gmail.com', 'www.bazalkahk.cz', '723360721', '723360721', 'K. H. Máchy 747', 'Hradec Králové', '500 02', NULL, 16, '50.21117210', '15.82349040', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vegetariánská jídelna, BIO kvalita', 'Všechny námi nabízené výrobky jsou připravovány dle vlastních receptur a obsahují v maximálně možné míře čerstvé suroviny a pokud to nabídka dodavatelů umožní,  suroviny v bio kvalitě.\n \nZ pekařských výrobků lze na našich pultech najít koláče bez cukru nebo bez vajec, dále koláče bez mléka, ale také koláče z přirozeně bezlepkových surovin a speciálních bezlepkových směsí.\n \nOd roku 1992 nechybí v naší nabídce celozrnné pizzy s mnoha druhy náplní jak jemných, tak pikantních chutí. Vegetariánské pokrmy doplňují i jídla pro vegany a zákazníky s bezlepkovou dietou. Pokrmy jsou připravovány ze surovin běžně dostupných v našich prodejnách a mohou se stát rychlou inspirací pro vaše domácí vaření. Každodenní nabídku doplňuje několik druhů zeleninových salátů a salátů se sójovou majonézou, vegetariánské plněné bagety a sendviče, čerstvé celozrnné pečivo a drobné cukrářské výrobky. Ve stálé nabídce nechybí čaje, alternativní kávy, zeleninové šťávy a nealkoholické nápoje. Specialitou je nápoj ze zeleného ječmene.\n \nHotová jídla jsou od pondělka do pátku k dispozici od 10.30 hod a lze si je odnést i s sebou. Bez problémů jsou vydávány i poloviční porce hotových pokrmů. K placení lze použít stravenkové kupóny Accor Services CZ s.r.o., Sodexo Pass ČR a.s. a Le Cheque Dejeuner s.r.o. , avšak bez možnosti vrácení hotovosti.', '2017-04-10 11:15:13', '2017-04-21 17:28:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1400.00', '15.00', 9, b'1'),
(332, 395, 126, 126, 537, NULL, NULL, 3, 'Kavárna Artičok', 'CZE', 'renca.rybarova@seznam.cz', 'www.articok.cz', '608868202', '608868202', 'Třída Karla IV. 493', 'Hradec Králové', '500 02', NULL, 16, '50.21306250', '15.82388360', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Bohatý sortiment, Salónek', 'Kavárna nabízí italskou kávu Lucaffe, výběrová vína, pivní speciály a bohatý sortiment dalších nápojů. Ke kávě nabízíme dezerty. Součástí kavárny je kočičí salónek, jehož obyvatelé se starají o dobrou náladu dětí i dospělých.', '2017-04-10 11:18:59', '2017-04-21 17:34:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '17.00', 7, b'1'),
(333, 396, 126, 126, 537, NULL, NULL, 1, 'Hospůdka Jonáš & Prorock', 'CZE', 'vlasta.norek@seznam.cz', 'www.hospudka-prorock.cz', '774196774', '774196774', 'Gagarinova 840/17', 'Hradec Králové - Slezské Předměstí', '500 03', NULL, 16, '50.21972280', '15.84886190', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Srubový nábytek, Zahrádka', 'Příjemné prostředí se stylovým srubovým nábytkem a ochotnou obsluhou. Prostory jsou vhodné pro pořádání společenských akcí jako jsou svatby, pohřební hostiny, oslavy narozenin, promoce a podobných. Výzdoba a uspořádání dle vašeho přání. Hospůdka Jonáš je nekuřácká, Hospůdka Prorock nabízí kuřácký prostor a konají se zde koncerty. V obou hospůdkách jsou pro sledování sportovních a hudebních přenosů instalovány velkoplošné obrazovky. Od května je též k dispozici velká zahrádka s obsluhou a grilem. V hospůdce nabízí denní menu, speciality a grilované lahůdky. Ochutnávky z minipivovaru Mordýř. Pokaždé je na čepu jiný speciál z momentální nabídky.', '2017-04-10 11:23:53', '2017-04-21 17:41:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '17.00', 9, b'1'),
(334, 397, 126, 126, 537, NULL, NULL, 2, 'Bar Kondic', 'CZE', 'kondic39@seznam.cz', 'www.kondicbar.wbs.cz', '773249572', '773249572', 'Pouchovská 153/52', 'Hradec Králové - Věkoše', '500 03', NULL, 16, '50.21988630', '15.84117630', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Příjemný bar s příjemnou obsluhou, Terasa', 'Přijďte posedět s přáteli do příjemného baru s ještě více příjemnou obsluhou. Výběr z mnoha alkoholických i nealkoholických nápojů. Vhodné prostředí pro firemní i soukromé akce.', '2017-04-10 11:26:56', '2017-04-21 17:46:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1100.00', '15.00', 10, b'1'),
(335, 398, 126, 126, 537, NULL, NULL, 3, 'Kavárna Muzeum Hradec Králové', 'CZE', 'kavarna@muzeumhk.cz', 'www.kavarna.bylonaspet.cz', '723078664', '723078664', 'Eliščino nábřeží 465', 'Hradec Králové', '500 03', NULL, 16, '50.21146360', '15.82900460', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Jedinečný zážitek chuťový, kulturní i společenský', 'Co děláme, děláme s nadšením a láskou, od mytí nádobí po přípravu vypiplaného cappuccina. Smyslem naší práce je učinit Vám z každé návštěvy muzejní kavárny jedinečný zážitek chuťový, kulturní i společenský. Přijďte se sami přesvědčit, do jaké míry je naše snaha znát. \nJménem všech, kteří se na chodu kavárny Muzeum podílejí, Vám přeji příjemné surfování na našeb webu i mimo něj a těším se na brzkou shledanou.', '2017-04-10 11:29:39', '2017-04-21 17:54:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '14.00', 10, b'1'),
(336, 399, 126, 126, 537, NULL, NULL, 3, 'Mlsounova kavárna a vinárna', 'CZE', 'degustace@mlsoun.eu', 'www.mlsoun.eu', '725885596', '725885596', 'Tomkova 911/6', 'Hradec Králové', '500 03', NULL, 16, '50.20999860', '15.83226710', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Káva, Čokoláda', 'Káva, čokoláda', '2017-04-10 11:33:44', '2017-04-21 18:00:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1700.00', '18.00', 12, b'1'),
(337, 400, 126, 126, 537, NULL, NULL, 3, 'Kavárna pod Eliškou', 'CZE', 'posta@kavarnapodeliskou.cz', 'www.kavarnapodeliskou.cz', '604273303', '604273303', 'Eliščino nábřeží 310/21', 'Hradec Králové', '500 03', NULL, 16, '50.21019640', '15.82895880', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Denně čerstvě pražená káva, Čokoláda', 'Přijďte si odpočinout od každodenního shonu nebo jen tak posedět s přáteli nad denně čerstvě praženou kávou, oblíbenou čokoládou či dobrým vínkem.\nAť už se k nám vydáte dopoledne na obchodní schůzku nebo k večeru na posezení s přáteli, čeká Vás příjemné prostředí s odděleným  dětským koutkem a profesionální personál.\nNabídka drobného občerstvení a zákusků je u nás samozřejmostí.\nKavárna má přizpůsobený vstup pro dětské kočárky a vozíčkáře.', '2017-04-10 11:36:10', '2017-04-21 18:06:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1600.00', '15.00', 5, b'1'),
(338, 401, 126, 126, 537, NULL, NULL, 2, 'Holland Club', 'CZE', 'hollandbar@seznam.cz', 'www.hollandclub.cz', '608577321', '608577321', 'Františka Halase 12A', 'Hradec Králové', '500 09', NULL, 16, '50.19998800', '15.84948070', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Designový bar v holandském stylu', 'Snažíme se vám zajistit maximální pohodlí, abyste se u nás vždy cítili příjemně a dali zapomenout na všední starosti. Díky bez bariérovému provedení baru se snažíme vyjít vstříc všem hostům, kteří uvítají především nekuřácké prostory, volnou wi-fi síť, bezplatné parkování hned vedle budovy a široké množství zábavy. Proto k nám můžete bez obav zajít na sklenku dobrého pití, skvělé jídlo nebo si rovnou rezervovat stůl či salonek o kapacitě 20 lidí.', '2017-04-10 11:44:40', '2017-04-21 18:13:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1100.00', '14.00', 12, b'1'),
