(340, 403, 126, 126, 537, NULL, NULL, 1, 'Hotel a restaurant Zděná bouda', 'CZE', 'info@zdenaboudahk.cz', 'www.zdenabouda.cz', '774692345', '774692345', 'Hradečnice 633/1', 'Hradec Králové', '500 09', NULL, 16, '50.19280970', '15.86979336', NULL, 'CASTOR COMPANY s.r.o.', 'Dubinská 48, Hradec Králové - Svinary', '01565915', 'CZ01565915', '115-2579350227', '0100', 'Staročeská a česká kuchyně, Zahrádka', 'Snažíme se, aby všechny suroviny pro přípravu pokrmů byly maximálně čerstvé, a v tomto duchu jsou vybíráni i naši dodavatelé, zároveň si bylinky a část zeleniny pěstujeme sami. Kromě poledního menu zákazníkům přinášíme i víkendové a speciální měsíční menu. Inspiraci čerpáme převážně ve staročeské a české kuchyni.', '2017-04-10 11:52:06', '2017-04-21 18:23:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1800.00', '15.00', 6, b'1');
