(341, 404, 126, 126, 537, NULL, NULL, 5, 'Malšovická pivnice', 'CZE', 'mezei.richard@email.cz', 'https://www.facebook.com/Mal%C5%A1ovick%C3%A1-pivnice-573771556058769/timeline', '773683219', '773683219', 'Mrštíkova 1880', 'Hradec Králové', '500 09', NULL, 16, '50.19897439', '15.85755334', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Příjemná pivnice', 'Příjemná pivnice v HK Malšovicích. Čepujeme Lapák 11° a 12° , Gambrinus nepasterizovaná 10°, Kozel 10° a Radegast horká 12°.', '2017-04-10 12:01:09', '2017-04-21 18:30:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1700.00', '11.00', 10, b'1'),
