(343, 406, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Meran', 'CZE', 'rest.meran@seznam.cz', 'www.restauracemeran.cz', '603273805', '603273805', 'Kydlinovská 153/95', 'Hradec Králové', '500 02', NULL, 16, '50.21952920', '15.82095660', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Teplá i studená kuchyně, Wifi, Zahrádka', 'Provoz restaurace se zahrádkou. Nabízí jídla teplé i studené kuchyně. K dispozici je Wi-Fi připojení a vyhrazený nekuřácký prostor. V jídelním a nápojovém lístku naleznete také bezmasá a dietní jídla, minutky a polévky, piva, lihoviny a vína. Poskytují také možnost rozvozu.', '2017-04-10 12:08:54', '2017-04-22 14:37:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '15.00', 10, b'1'),
(344, 407, 126, 126, 537, NULL, NULL, 5, 'Pivní salon', 'CZE', 'vit.caslavka@gmail.com', 'www.pivnisalonhk.cz', '773165061', '773165061', 'Velké náměstí 17/27', 'Hradec Králové', '500 03', NULL, 16, '50.20973820', '15.83569090', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřáckém podniku s širokou nabídkou pivních speciálů', 'Pivní salon je stylový podnik, situovaný do dob, kdy se Hradec Králové pyšnil titulem Salon republiky. Narozdíl od počátku minulého století se ale u nás nekouří – můžete si tak vychutnat své pivo v příjemném klima, stejně tak, jako k nám můžete zavítat na odpolední kávu či obchodní schůzku. Pivní salon se nachází v samém srdci města – na historickém Velkém náměstí. Výhled z prosklených výloh tak dotváří příjemnou historickou atmosféru našeho podniku.', '2017-04-10 12:12:42', '2017-04-22 14:37:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1800.00', '13.00', 6, b'1'),
(345, 408, 126, 126, 152, NULL, NULL, 4, 'Restaurace Pizzeria Casa Mia', 'CZE', 'casamia@pizzeria.cz', 'casamia-pizza.webnode.cz', '495516021', NULL, 'Náměstí 28. října 1610', 'Hradec Králové', '500 02', NULL, 16, '50.21298030', '15.81770760', NULL, NULL, NULL, '0', '0', '0', '0000', 'pizza, příjemné posezení', 'Dobrý pizzerie. Příjemné posezení.', '2017-04-10 12:18:24', '2017-04-11 10:41:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1800.00', '14.00', 9, b'1'),
(346, 409, 126, 126, NULL, NULL, NULL, 3, 'Restaurace Al Cafetero', 'CZE', 'info@alcafetero.cz', 'www.alcafetero.cz', '777061161', '777 061 161', 'Blanická 24', 'Praha 2', '12000', NULL, 50, '50.07696030', '14.43950020', NULL, '0', '0', '0', NULL, '115-2579350227', '0100', 'výborná káva, 100% arabika, víno, sladké i slané dobroty', 'Malá rodinná kavárna v srdci Vinohrad připravuje 100% arabiku nejen jako espresso, ale jako první v Česku, také netradičními způsoby jako je vacuum pot, french press, drip nebo aeropress. Můžete si zde pochutnat na sladkých i  slaných dobrotách a vínu.', '2017-04-11 11:20:03', '2017-04-22 14:55:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '11.00', 11, b'1'),
(347, 410, 126, 126, 538, NULL, NULL, 1, 'Aromi', 'CZE', 'info@aromi.cz', 'www.aromi.cz', '222713222', '775402607', 'Náměstí Míru 6', 'Praha 2', '12000', NULL, 50, '50.07616320', '14.43636160', NULL, 'Catering AROMI s.r.o.', 'Kubelíkova 1189/29', '271 40 792', 'CZ271 40 792', '115-2579350227', '0100', 'italská restaurace a bistro, ryby a mořské plody, dětský koutek s chůvou, ocenění BIB Gourman Michelin, reprezentativní prostory', 'Aromi je skvělou volbou, pokud si přejete vychutnat si své první jídlo dne v klidu, v krásném prostředí a užít si kvalitní suroviny, ze kterých se snídaně této restaurace skládají. Vybrat si můžete z vaječných jídel, sladké ovesné kaše, ovocného salátu nebo zvolit "snídani Aromi", která obsahuje výběr salámů a sýrů, croissant a vajíčka dle vaší volby. Po devíti po sobě jdoucích letech od 2006 do 2014 získala ocenění BIB Gourman Michelin. V roce 2005 se restaurace Aromi umístila mezi 10 nejlepšími nově otevřenými restauracemi na světě. O vaše nejmenší se postará profesionální chůva v dětském koutku, který nabízí pestrý výběr hraček a možnost kreativního vyžití i pro ty nejmenší.', '2017-04-11 11:22:22', '2017-04-22 15:18:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1000.00', '16.00', 7, b'1'),
(348, 411, 126, 126, 538, NULL, NULL, 1, 'Arista', 'CZE', 'tomas.bohaboj@lepalaishotel.eu', 'www.lepalaishotel.eu', '234634111', '775402607', 'U Zvonařky 1', 'Praha 2', '12000', NULL, 50, '50.06973350', '14.43490500', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'Hotel, apartmány, wellness, restaurant, letní terasa, VIP služby', 'Luxusní restaurace Artista nabízí vskutku inovativní jídla a přímo láká k dalšímu objevování české i mezinárodní kuchyně. Celkovou atmosféru doplňuje nádherný výhled na Prahu jak z interiéru restaurace tak z letní terasy. Artista je ideálním místem pro všechny příležitosti a kulinářskou zkušeností i pro ty nejnáročnější gurmány. Okouzlující atmosféra pokojů a apartmánů vás překvapí vznešeným stylem a perfektní symbiózou historické elegance, moderní techniky a smyslu pro detail. Exkluzivní nabídka luxusně zařízených pokojů v hotelu vyniká kombinací prvotřídního designu a vysoce kvalitních materiálů. Můžete si vybrat Petite, Rendl, Prezidentský či Royal a další apartmány. Hotel nabízí skvělé wellness či umělecko-kulturní balíčky. Součástí hotelu je restaurant, letní terasa, lobby bar, knihovna i wellness. Hotel pořádá konference i svatby.', '2017-04-11 11:26:03', '2017-04-22 15:40:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1800.00', '18.00', 12, b'1'),
(349, 412, 126, 126, NULL, NULL, NULL, 1, 'Bad Jeffs barbeque', 'CZE', 'info@badjeffs.cz', 'www.badjeffs.cz', '774402235', '774402235', 'Americká 32', 'Praha 2', '12000', NULL, 50, '50.07344490', '14.43756740', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'BBQ, americký styl, grilování, gurmánský hamburger', 'Bad Jeffs barbeque, americké grilování, stylové BBQ. Fantastické jídlo a senzační služby. Šťavnaté lahodné pokrmy a gurmánský hamburger.', '2017-04-11 11:29:37', '2017-04-22 16:10:05', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1900.00', '11.00', 13, b'1'),
(350, 413, 126, 126, 538, NULL, NULL, 1, 'Beer & Burger U Čížků', 'CZE', 'info@ucizku.cz', 'www.ucizku.cz', '223003424', '775402607', 'Karlovo náměstí 34', 'Praha 2', '12000', NULL, 50, '50.07602040', '14.42111510', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřácká restaurace, hamburgery domácí výroby, čepování několika druhů piva', 'Nekuřácká restaurace se specializací na HAMBURGERY domácí výroby, s čerstvou zeleninou a domácím dipem v několika chuťových variantách. Pečivo dodávané ze sousední pekárny pana Zoulka, z Václavské pasáže na Karlově náměstí. V nabídce najdete také steaky, vepřové koleno nebo grilovaná křidélka a žebírka v marinádě a samozřejmě zeleninové saláty.\nSnídaňové menu, obědové menu, každý den čerstvá denní polévka.', '2017-04-11 11:33:04', '2017-04-22 16:16:16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1200.00', '10.00', 7, b'1'),
(351, 414, 126, 126, NULL, NULL, NULL, 1, 'Behsud restaurant', 'CZE', 'restaurant@behsud.cz', 'www.behsud.cz', '776808972', '776808972', 'V Tůních 14', 'Praha 2', '12000', NULL, 50, '50.07694690', '14.42689220', NULL, 'Rakin s.r.o.', 'Rybná 716/24, 110 00 Praha 1', '046 18 904', 'CZ04618904', '115-2579350227', '0100', 'afghánská jídla, rodinná restaurace, čerstvé a domácí, osobní přístup', 'Behsud je tradiční afghánská rodinná restaurace, nacházející se v srdci krásné a historické Prahy. Ochutnejte afghánskou kuchyni, která vezme Vaše chuťové buňky na exotickou cestu nádherných chutí a vůní. Nabízí kompletní menu různých čerstvých masitých, zeleninových a rýžových jídel. Více než 20 různých koření a bylinek je použito při přípravě vynikajících pokrmů, všechna jídla jsou připravována denně za čerstva.', '2017-04-11 11:36:03', '2017-04-23 04:56:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1400.00', '16.00', 11, b'1'),
(352, 415, 126, 126, 538, NULL, NULL, 3, 'Cafe Zanzibar', 'CZE', 'info@kavarnazanzibar.cz', 'www.kavarnazanzibar.cz', '222520315', '775402607', 'Americká 15', 'Praha 2', '12000', NULL, 50, '50.07216910', '14.43824160', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřácká kavárna, kvalitní káva, vína, polední menu, wi-fi', 'Zanzibar je útulná kavárna v poklidném prostředí Vinohrad. Nabízí kvalitní kávu, česká a francouzská vína, výběrový alkohol, široký výběr jídel mezinárodní kuchyně z poctivých surovin, polední menu. Kavárna je nekuřácká. Wi-fi pro zákazníky.', '2017-04-12 14:13:52', '2017-04-23 04:59:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '17.00', 13, b'1'),
(353, 416, 126, 126, NULL, NULL, NULL, 9, 'Javanka and Co.', 'CZE', 'bistrojavanka@gmail.com', 'www.javanka.eu', '734823519', '734 823 519', 'Máchova 22', 'Praha', '10100', NULL, 50, '50.07227970', '14.44286350', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'indonéská kuchyně, bistro', 'Máte rádi asijskou kuchyni? Dáváte přednost neformálnímu prostředí malého bistra před klasickou restaurací? Pohybujete se v okolí pražských Vinohrad? Ještě jste nebyli v Javánce? Chyba! V bistru Javánka není nic problém.', '2017-04-12 14:17:33', '2017-04-23 05:12:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1500.00', '14.00', 11, b'1'),
(354, 417, 126, 126, 538, NULL, NULL, 3, 'Kavárna Moment', 'CZE', 'info@momentcafe.cz', 'www.momentcafe.cz', '775431440', '775 431 440', 'Slezská 62', 'Praha 2', '12000', NULL, 50, '50.07611080', '14.44721950', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'veganské bistro a kavárna', 'Moment je veganské bistro a kavárna nejenom pro vegany, ale také pro všechny, kteří cítí lásku k zvířatům a jsou ochotni se podílet na ochraně životního prostředí, anebo prostě mají chuť na super veganskou dobrotu.', '2017-04-12 14:21:18', '2017-04-23 05:23:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '100.00', '1200.00', '12.00', 7, b'1'),
(355, 418, 126, 126, 538, NULL, NULL, 9, 'Plavecká polévka', 'CZE', 'plaveckapolevka@email.cz', 'www.plaveckapolevka.cz', '775301610', '736 722 911', 'Plavecká 4', 'Praha', '12800', NULL, 50, '50.06911760', '14.41534260', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'polévky, denní menu', 'Bistro Plavecká polévkárna. Denní menu.', '2017-04-12 14:24:55', '2017-04-25 11:12:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1500.00', '18.00', 8, b'1'),
(356, 419, 126, 126, NULL, NULL, NULL, 1, 'Blue Wagon', 'CZE', 'bluewagon@bluewagon.cz', 'www.bluewagon.cz', '702081251', '702 081 251', 'Uruguayská 19', 'Praha', '12000', NULL, 50, '50.07406570', '14.43822600', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřáká restaurace, gastronomie, velký výběr rakouských vín, čerstvé suroviny', 'Blue Wagon vám nabízí moderní gastronomii tak, jak má vypadat. Vaříme z kvalitních, čerstvých a "hlavně sezónních surovin", které zpracováváme šetrnými, zdravými metodami. K dobrému jídlu vám doporučíme vhodné víno – nabízíme nejen česká, francouzská či španělská, ale především vína rakouská, jejichž výběr máme největší v Praze. Rádi pro vás připravíme firemní setkání, jako jsou business obědy, pro teambuildingové aktivity nabízí řízené degustace s naším sommelierem nebo pro vás připravíme speciální akce na objednávku. Anebo přijďte jen na romantickou večeři... Restaurace je nekuřácká.', '2017-04-12 14:27:17', '2017-04-23 06:22:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1000.00', '18.00', 5, b'1'),
(357, 420, 126, 126, NULL, NULL, NULL, 1, 'Bruxx', 'CZE', 'info@bruxx.cz', 'www.bruxx.cz', '224250404', '775402607', 'Náměstí Míru 9', 'Praha', '12000', NULL, 50, '50.07550546', '14.43811886', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'belgická restaurace,čerstvé mušle, pivo, dětský koutek, DJ', 'Našim cílem je vytvořit místo, kde belgická gastronomie není jen „JAKO“, u nás je skutečná. Mušle jsou hlavním sortimentem našeho jídelního lístku a u nás si na nich opravdu zakládáme. Kromě originálních receptů dbáme na to, aby se k nám mušle dostaly vždy naprosto čerstvé a ve výborné kvalitě. Čerstvé mušle dovážíme 3x týdně. V BRUXXU najdete exkluzivně 8 druhů čepovaného belgického piva, které si sami dovážíme. Pro srovnání nabízíme jedno pivo z českých mini pivovarů. Na našem jídelním lístku najdete opravdu originální suroviny: belgické sýry, klobásu Boudin, ardenskou šunku či čokoládu Callebaut. V Bruxxu pamatujeme na všechny, kteří se chtějí nejen výborně najíst, ale také pobavit, proto u nás hraje od středy do soboty i DJ. Věříme, že i rodiče ocení náš velký dětský koutek s víkendovým profesionálním hlídáním.', '2017-04-12 14:29:40', '2017-04-23 05:49:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1400.00', '13.00', 9, b'1'),
(358, 421, 126, 126, 538, NULL, NULL, 3, 'Cafe AdAstra', 'CZE', 'info@cafeadastra.cz', 'www.cafeadastra.cz', '733748662', '733 748 662', 'Podskalská 8', 'Praha', '12800', NULL, 50, '50.06906580', '14.41574200', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'kavárna, Francie, vína, piva, obecně prospěšná společnost, týdenní menu', 'Café AdAstra je příjemné místo inspirované Francií. V nabídce najdete skvělá vína z Francie, tradiční české pivo Chotěboř a řadu skvělých jídel. Nechybí ani domácí dezerty a více druhů kvalitní kávy, a tak si každý přijde na své. Návštěvou této kavárny potěšíte nejen své chuťové buňky, ale také podpoříte dobrou věc! Kavárnu totiž provozuje obecně prospěšná společnost Zajíček na koni a pracují zde lidé s fyzickým, mentálním či socio-kulturním handicapem, kteří nemají uplatnění na běžném trhu práce a většinou své místo nemohou najít ani v chráněných pracovištích.', '2017-04-12 14:42:57', '2017-04-23 06:17:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1900.00', '17.00', 11, b'1'),
(359, 422, 126, 126, 538, NULL, NULL, 3, 'Cafe Amandine', 'CZE', 'katka@cafeamandine.cz', 'www.cafeamandine.cz', '222524305', '775402607', 'Na Moráni 17', 'Praha', '12000', NULL, 50, '50.07386380', '14.41779160', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'francouzské delikatesy, snídaňové menu, letní terasa, pořádání akcí, wi-fi, kuřácký koutek', 'Zavřete oči a vzpomínejte – na ranní procházku po Champs Elysées, na malebné kavárničky na Montmartre, umělecké skvosty ve Versailles, na Eiffelovku i majestátní Seinu. To vše a ještě mnohem víc je Paříž. Cítíte tu atmosféru, které se nic nevyrovná? Taková je Paříž. Takové je Café Amandine. Je tomu již přes 4 roky, kdy Café Amandine otevřelo svoji první pobočku na Praze 2, Na Moráni 17. V naší kavárně ve stylu třicátých let se podávají typické pokrmy francouzské kuchyně, které pro hosty připraví tým vyhlášených kuchařů v čele se Stanislavem Kladivou. Ten vystudoval prestižní kuchařský institut v Praze a vařil v těch nejlepších českých i zahraničních restauracích. V Café Amandine si můžete pochutnat na delikatesách, které pro vás připravil podle originálních francouzských receptur – v široké nabídce najdete např.: tartine, Boeuf bourgignon, konfitovaná kachní stehnna, ratatouille, plněné bagety, saláty, crêpes a blinis.', '2017-04-12 14:45:34', '2017-04-23 06:26:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '120.00', '1200.00', '16.00', 8, b'1'),
(360, 423, 126, 126, 538, NULL, NULL, 3, 'Cafe Faux Pas', 'CZE', 'hahn@seznam.cz', 'www.cafe-fauxpas.cz', '605374611', '605374611', 'Vinohradská 31', 'Praha', '12000', NULL, 50, '50.07804080', '14.43730600', NULL, 'Café Faux Pas', 'Vinohradská 1595/31, 12000 Praha', '66488745', 'CZ7709080610', '115-2579350227', '0100', 'kavárna, domácí zákusky, menu', 'Zveme Vás na příjemné posezení do kavárny Café Faux Pas. Ochutnejte naší kávu a domácí zákusky.', '2017-04-12 14:48:03', '2017-04-23 06:34:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '190.00', '1300.00', '12.00', 7, b'1'),
(361, 424, 126, 126, 538, NULL, NULL, 3, 'Cafe Nová galerie', 'CZE', 'info@novagalerie.cz', 'www.novagalerie.cz', '777422022', '777 515 515', 'Balbínova 26', 'Praha', '12000', NULL, 50, '50.07903510', '14.43561230', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'internetová kavárna, galerie', 'Otevřeli jsme kavárničku Café Nová galerie! Věříme, že Café Nová galerie se stane místem, kde si rádi dáme společně kávu, sklenku vína, pochválíme si vzájemně své obrazy a budeme se setkávat při pravidelných kulturních akcích.', '2017-04-12 14:50:31', '2017-04-23 08:26:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '120.00', '1700.00', '19.00', 8, b'1'),
(362, 425, 126, 126, 538, NULL, NULL, 1, 'Cellarius Budečská Wine bar', 'CZE', 'budecska@cellarius.cz', 'www.cellarius.cz/budecska-wine-bar-vinoteka', '222515243', '603 156 668', 'Budečská 29', 'Praha', '12000', NULL, 50, '50.07588490', '14.44176950', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'vinotéka, vinný sklípek, delikatesy, degustace, letní zahrádka', 'Přijďte na skleničku... Ve vinohradském Cellariu na Vás čeká opravdu široký výběr. A to nejen vín předních moravských (a českých) vinařů, ale také mnoho vín zahraničních. Všechna vína sami pečlivě vybíráme při našich cestách po světě a neustále přechutnáváme, a tak si vždy můžete být jisti jejich kvalitou. Jste nároční? Nevyberete-li si ze stávající nabídky, nevadí. Na přání Vám otevřeme jakékoliv víno z prodejny dle vlastního výběru. Přirážka (korkovné) činí 30% z ceny na vinotéce. Vinný sklípek, altánek nebo letní zahrádka...Vychutnejte si sklenku tam, kde je Vám to nejmilejší. Každý kout vinotéky má své kouzlo. Klimatizovaná vinný sklípek s kapacitou až 28 hostů, který slouží zároveň jako degustační místnost, je ideální pro vánoční večírky, oslavy, firemní akce apod. Využít můžete také projektor s plátnem. Posezení pod pergolou na naší zahrádce v tichém vnitrobloku oceníte zejména v létě. Nově zde také probíhají menší degustace, grilování nebo koncerty. Altánek je Vám k dispozici po celý rok.\n\nDegustace Pravidelně pro Vás pořádáme tématické řízené degustace. Ochutnejte zajímavá vína a zeptejte se sommeliera či přímo vinaře na všechno, co Vás zajímá. Kromě vinařů z Moravy se u nás můžete často setkat také s našimi zahraničními vinaři z různých koutů světa. Tyto degustace probíhají v angličtině. Přehled plánovaných akcí najdete na stránce níže. Rádi Vám nad rámec těchto degustací uděláme také soukromou ochutnávku na míru pro uzavřenou společnost. Soukromé večírky, firemní akce, oslavy Potřebujete pomoci s organizací Vaší akce? Vybrat správná vína, zajistit catering? Není problém. \n\nNěco k zakousnutí K vínu vám nabízíme nejrůznější dobroty dle denní nabídky - sýry, španělský jamón serrano, chorizo, francouzské paštičky, klobásky, olivy a další vážené delikatesy. Mále-li větší hlad, nahlédněte do našeho menu do sekce studených a teplých pokrmů. Sháníte opravdu pěkný dárek? S výběrem vhodného vína Vám rádi pomůžeme a samozřejmě dárkově zabalíme. Nebo radši zážitek? Věnujte dárkový voucher na víno nebo na degustaci.', '2017-04-12 14:52:55', '2017-04-23 09:34:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1900.00', '16.00', 5, b'1'),
(363, 426, 126, 126, 538, NULL, NULL, 11, 'Čajovna U Džoudyho', 'CZE', 'cajovna@udzoudyho.cz', 'www.udzoudyho.cz', '212341277', '730 101 225', 'Jugoslávská 7/670', 'Praha', '12000', NULL, 50, '50.07562510', '14.43136580', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'čajovna, klidné prostředí, venkovní zahrádka, umělecká galerie', 'Vážení milovníci čaje, čajovna U Džoudyho byla otevřena v dubnu 2006, dva roky po otevření knihkupectví U Džoudyho. Prostory čajovny byly navrhovány architektkou Terezou Podlešákovou, která do své práce zahrnuje prvky čínského feng šuej(feng shui), tedy učení o harmonickém uspořádání prostoru. V klidném prostředí plném světla a květin můžete posedět jak u stolečku na židli, tak i na měkkých polštářcích na zemi. Za pěkného počasí je navíc k dispozici i venkovní zahrádka, která nabízí tiché posezení přímo v centru města. Interiér čajovny se každým měsícem mění, neboť čajovna slouží zároveň i jako výstavní galerie.                                                                Přijďte ochutnat dobrý čaj a zklidnit svou mysl.', '2017-04-12 14:55:46', '2017-04-23 08:46:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1000.00', '10.00', 6, b'1'),
(364, 427, 126, 126, 538, NULL, NULL, 1, 'Demínka', 'CZE', 'info@deminka.com', 'www.deminka.com', '224224915', '775402607', 'Škrétova 1', 'Praha', '12000', NULL, 50, '50.07725900', '14.43143640', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'tradice, pivo, Pilsner Urquell Original Restaurant, Demínoviny', 'Když vstoupíte do restaurace Demínka, tak poznáte, že tradice nemusí být jen prázdný pojem. Pro nás je tradice Demínky vším a jsme pyšní na to, že můžeme rozvíjet odkaz mnoha předchozích generací restauratérů a kavárníků! Demínka byla založena už roku 1886 a patří mezi nejdéle fungující pražské podniky. Dodnes je zachován její unikátní a vzdušný prostor s vysokými stropy; secesní štuky, které na nich vidíte, jsou památkově chráněny. Ze zachované výzdoby dnešního salónku se zase lze přesvědčit, že tento prostor v minulosti sloužil jako šachová, kulečníková a karetní herna.\n\nV Demínce si zakládáme na kvalitním pivu i jídlu. Jsme hrdí na to, že jsme se stali součástí úzké výběrové skupiny Pilsner Urquell Original Restaurant, tedy nejlepších podniků, v nichž se čepuje plzeňské pivo a podává prvotřídní česká kuchyně. Jsme přesvědčení, že ať si z našeho jídelního lístku vyberte cokoliv, budete nadšeni! Dobře víme, že nejvyšší kvalitu pokrmů a nápojů pro vás zajistíme jen využitím prvotřídních vstupních surovin a poctivou prací s nimi. Tradice a historie se tak dnes v Demínce snoubí s nejmodernější technologií čepování tankového piva a s moderním pojetím gastronomie. \n\nAbychom paletu kulinárních zážitků ještě více rozšířili, začali jsme v posledních letech pořádat různé gastronomické akce. Jsou to například Bavorské týdny, Svatomartinské hody či zvěřinové hody; v roce 2015 poprvé slavíme i Masopust. Během těchto akcí můžete ochutnat jindy nedostupná jídla a speciální nabídku piv a vín. Chcete-li v Demínce uspořádat soukromou či firemní oslavu, nestojí vám nic v cestě. Kapacita restaurace je 130 hostů, pro dalších 50 hostů naleznete prostor v salónku; samozřejmostí je zajištění občerstvení z naší strany podle vašeho přání. Zároveň poskytujeme i cateringový servis. Jsme schopni zabezpečit na nejvyšší úrovni rauty, bankety, koktejly či zahradní slavnosti až pro 2000 hostů.\n\nNavštivte i vy Demínku a staňte se součástí její slavné historie. Těšíme se na vás!', '2017-04-12 15:01:13', '2017-04-23 14:20:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1700.00', '15.00', 7, b'1'),
(365, 428, 126, 126, 538, NULL, NULL, 9, 'Dish', 'CZE', 'info@dish.cz', 'www.dish.cz', '222511032', '775402607', 'Římská 29', 'Praha', '12000', NULL, 50, '50.07716500', '14.43618890', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'burger bistro', 'Burger bistro, burgery Dish, Savory, Tauro, Kahuna a další.', '2017-04-12 15:04:32', '2017-04-23 15:17:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1400.00', '15.00', 8, b'1'),
(366, 429, 126, 126, 538, NULL, NULL, 1, 'Dnister', 'CZE', 'dnister-restaurace@seznam.cz', 'www.restaurace-dnister.cz', '739020889', '774059788', 'Na Moráni 6', 'Praha', '12800', NULL, 50, '50.07324960', '14.41599630', NULL, '0', '0', '26749041', '0', '115-2579350227', '0100', 'česká, ukrajinská a ruská kuchyně', 'V naší restaurace najdete oblíbené pokrmy z evropské a slovanské kuchyně.', '2017-04-12 15:07:36', '2017-04-23 16:02:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1900.00', '18.00', 11, b'1'),
(367, 430, 126, 126, 538, NULL, NULL, 1, 'Dnister', 'CZE', 'equilibrista@equilibrista.cz', 'www.equilibrista.cz', '602228523', '724 386 476', 'Budečská 998/10', 'Praha', '12000', NULL, 50, '50.07389870', '14.44227030', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'italská kuchyně, vína, speciality, e-shop', 'Dvacet let prožitých v prosluněné italské Ligurii nám potvrdilo známé rčení, že v jednoduchosti je krása. Italská kuchyně je založená na kvalitě surovin, vůni bylinek, vyzdvižení chuti jednotlivých ingrediencí. Naším záměrem je se s vámi o tyto kulinářské zážitky podělit.\n\nMůžete se těšit na :\n- šťavnaté steaky z JOSPER grilu a voňavé zeleninové pokrmy;\n- široký výběr specialitek k vínu;\n- pečené nebo grilované mořské ryby;\n- lákavé domácí těstoviny;\n- nápaditou nabídku pro vegetariány;\n- vynikající italská vína, u kterých se plně  projevuje um každého z vinařů - užijte si degustaci díky velké nabídce vín  "na skleničku";\n- italské olivové oleje od našich vinařů.\n\nPro Equilibristu jsme projeli velkou část Itálie, vybrali jsme vynikající a oceněná vína z vinařství, kde nad kvalitou bdí sám vinař, případně enolog v přímé součinnosti s vinařem. \nEquilibrista nabízí posezení na baru, v restaurační části a v zimní zahradě s pohodovou atmosférou.  Sluníčko vykouzlí také barevné stolky na terase před restaurací.\nPřípravu delikates, které si objednáte, můžete sledovat přímo díky otevřené kuchyni. Aktuální nabídku vín naleznete na vinném lístku a na tabulích. Kompletní nabídku vám předložíme velké vinné kartě.', '2017-04-12 15:11:47', '2017-04-24 07:50:50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1400.00', '10.00', 7, b'1'),
(368, 431, 126, 126, 538, NULL, NULL, 1, 'Etnosvět', 'CZE', 'eliska@etnosvet.cz', 'www.etnosvet.cz', '226203880', '602 503 103', 'Legerova 40', 'Praha', '12000', NULL, 50, '50.07308840', '14.43066320', NULL, 'Etnosvět s.r.o.', 'Tyršova 1832/7, Nové Město, 120 00 Praha 2', '03957918', '0', '115-2579350227', '0100', 'denní menu, à la carte, veganská nabídka, zahrádka', 'Poznejte svět chutí, který nemá hranic!\n\nEtnosvět restaurace se nachází na Praze 2, jen pár kroků od I.P. Pavlova. Náš mezinárodní tým pod vedením francouzského šéfkuchaře Anthonyho Kulehsy pro Vás připravuje každý den pestré pokrmy z různých koutů světa. Přes den si můžete vybrat ze tří různých denních menu nebo nově i z à la carte. Večer si můžete vybrat jak z naší stálé nabídky (à la carte) tak i nově ze speciální veganské nabídky. Přípravu speciální nabídky můžete sledovat na vlastní oči v zadní části přízemí restaurace. Nechybí ani kvalitní nabídka vín či drinků.\n\nV případě pěkného počasí je možné posedět i na zahrádce ve vnitrobloku. Pro hosty restaurace jsou přímo před restaurací vyhrazena místa pro parkování.\n\nRestaurace Etnosvět získala ocenění od gastronomického portálu restu.cz:\n\nNejlepší vegetariánská restaurace 2016 a Skokan roku 2016', '2017-04-12 15:15:04', '2017-04-24 07:54:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, '', NULL, '170.00', '1100.00', '14.00', 13, b'1'),
(369, 432, 126, 126, 538, NULL, NULL, 12, 'Flavours wine & deli', 'CZE', 'info@flavours.cz', 'www.flavours.cz', '725888545', '725888545', 'Záhřebská 29', 'Praha', '12000', NULL, 50, '50.07267960', '14.43844430', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'vína, eshop', 'Vyberte si z naší nabídky více jak 1600 druhů prověřených a exklusivních vín z celého světa.', '2017-04-12 15:17:44', '2017-04-24 07:59:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1800.00', '17.00', 7, b'1'),
(370, 433, 126, 126, 538, NULL, NULL, 1, 'Giardino enoteca con cucina', 'CZE', 'giardino@email.cz', 'www.restgiardino.cz', '222513427', '774 455 243', 'Záhřebská 24', 'Praha', '12000', NULL, 50, '50.07196840', '14.43742400', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'středomořská kuchyně, čerstvé suroviny, vína, zahrádka', 'Vítejte v rodinné restauraci, která sídlí v klidné části pražských Vinohrad. Nabízí speciality středomořské kuchyně a inspiruje se zejména Itálií a Chorvatskem. Recepty jsou originální, jednoduché, vždy z čerstvých surovin zaměřené na ryby, masa a mořské plody.\n\nV jídelníčku naleznete široký výběr z italské kuchyně. Přijďte ochutnat denně čerstvé rybí speciality, těstoviny, risotta, domácí chléb a oblíbené domácí dezerty italského kuchaře. Vinotéka Restaurace se chlubí širokým výběrem světově známých vinařů.\n\nGiardino je rodinný podnik s velice příjemnou atmosférou. Prostředí Restaurace se stalo oblíbeným místem k pořádání rodinných oslav, rautů, večírků či firemních akcí.', '2017-04-12 15:32:42', '2017-04-24 08:02:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '180.00', '1300.00', '13.00', 13, b'1'),
(371, 434, 126, 126, 538, NULL, NULL, 1, 'Giger a Fred', 'CZE', 'manager@ginger-fred-restaurant.cz', 'www.ginger-fred-restaurant.cz', '221984160', '776 652 097', 'Jiráskovo náměstí 6', 'Praha', '12000', NULL, 50, '50.07545100', '14.41419440', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'Tančící dům, gastronomie, umělecká díla, speciality, zmrzliny', 'Vyzkoušejte kombinaci skvělé chuti, jedinečného výhledu a stylového interiéru. \n\n„Vycházím z francouzské kuchyně, ke které mám nejblíže. Menu restaurace Ginger & Fred je ale mezinárodní. Používáme hodně lokálních surovin a spolupracujeme hlavně s místními dodavateli,” říká šéfkuchař Rudolf Doležal.\n\nRestauraci Ginger & Fred najdete v 7. patře Tančícího domu. Originálně servírované pokrmy si vychutnáte ve společnosti děl moderního umění a výhledu na Hradčany. \n\nMenu 4x ročně obměňujeme a kromě stálého jídelního lístku nabízíme také denní speciality. V létě nesmíte vynechat široký výběr zmrzlin a sorbetů.\n\nGinger & Fred je ideálním místem pro pracovní i soukromý oběd, romantickou večeři nebo firemní party.\n\nPřijďte a zažijte spojení kvalitní gastronomie a jedinečného prostředí!', '2017-04-12 15:35:43', '2017-04-24 08:07:14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '16.00', 13, b'1'),
(372, 435, 126, 126, NULL, NULL, NULL, 1, 'Green Garden restaurant', 'CZE', 'provoz@greengarden.cz', 'www.greengarden.cz', '224261181', '775402607', 'Fügnerovo náměstí 1865/4', 'Praha', '12000', NULL, 50, '50.07158540', '14.43029330', NULL, 'Green Garden s.r.o.', 'Fügnerovo náměstí 1865/4', '26462524', 'CZ26462524', '115-2579350227', '0100', 'hotel, zimní zahrada, lobby bar', 'Restaurace hotelu Green Garden situovaná v malebné Zimní Zahradě je ideálním místem pro romantickou večeři při svíčkách. Originální interiér restaurace včetně květinové výzdoby vytváří neopakovatelnou atmosféru. Restaurace nabízí české i mezinárodní speciality včetně vynikajících steaků a domácích dezertů. Náš šéfkuchař připravuje všechna jídla z pečlivě vybraných místních surovin. V nabídce naleznete také širokou paletu nápojů, včetně vynikajících jakostních českých, italských a francouzských vín. Restaurace je otevřena denně od 11:00 do 22:30. \n\nPosaďte se a dopřejte si šálek kávy nebo chutný sendvič v hotelovém lobby baru. Naše menu nabízí široký výběr typických českých likérů a kvalitních vín z domácí i zahraniční provenience. Otevřen je denně od 10:00 do 23:00 (může se lišit v závislosti na ročním období).', '2017-04-12 15:37:57', '2017-04-25 05:17:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*9D3BE9D634A4048B873623D295B79480E688200C', 1, 1, NULL, NULL, '140.00', '1500.00', '15.00', 7, b'1'),
(373, 436, 126, 126, NULL, NULL, NULL, 1, 'Historie', 'CZE', 'restaurace-historie@seznam.cz', 'www.restaurace-historie.cz', '603897854', '603 897 854', 'Londýnská 52', 'Praha', '12000', NULL, 50, '50.07521810', '14.43370560', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'ležák z tanku, výborná jídla, věrnostní karta', 'Útulná restaurace sídlící v centru Prahy s pravým plzeňským ležákem z tanku!', '2017-04-12 15:40:59', '2017-04-24 15:27:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1300.00', '13.00', 13, b'1'),
