(375, 438, 126, 126, 538, NULL, NULL, 1, 'Indická restaurace Everest Praha', 'CZE', 'chatra22@seznam.cz', 'www.restauraceeverest.cz', '774788230', '774788230', 'Anny Letenské 5/1235', 'Praha', '12000', NULL, 50, '50.07732130', '14.43730860', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'indická restaurace, polední menu', 'Tradiční indická kuchyně.', '2017-04-12 18:08:11', '2017-04-24 15:03:54', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '100.00', '1900.00', '17.00', 10, b'1'),
(376, 439, 126, 126, 538, NULL, NULL, 3, 'Cafe Modi', 'CZE', 'petr@cafemodi.cz', 'www.cafemodi.cz', '732474759', '603 177 106', 'MYSLÍKOVA 32', 'Praha', '12000', NULL, 50, '50.07815850', '14.41914360', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'káva, čaje, víno, snídaně, internet', 'V naší kavárně máte možnost vychutnávat pravou chuť kávy za přítomnosti příjemné obsluhy, denního tisku a připojení k internetu. Čaje i vína z aktuální nabídky si u nás můžete také zakoupit. A protože nabídku pro vás neustále obměňujeme, nepřestávejte chodit pravidelně.', '2017-04-12 18:11:10', '2017-04-24 15:06:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1300.00', '13.00', 12, b'1'),
(377, 440, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Deserterie', 'CZE', 'reimitz@lacucinait.cz', 'www.deserterie.cz', '734573355', '734 573 355', 'Náměstí Míru 16', 'Praha', '12000', NULL, 50, '50.07441750', '14.43607380', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'káva, menu, dorty, sendviče', 'Vaše oblíbená kavárna na Vinohradech!', '2017-04-12 18:17:37', '2017-04-24 16:02:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*34A1EC02BBD108CB7606FC14A949525706446DBB', 1, 1, NULL, NULL, '160.00', '1000.00', '12.00', 14, b'1'),
(378, 441, 126, 126, NULL, NULL, NULL, 3, 'Kavárna Kafe v kufru', 'CZE', 'petrfoto@seznam.cz', 'http://gastro-booking.com/#/app/restaurant/378', '605246266', '605 246 266', 'Moravská 10', 'Praha', '12000', NULL, 50, '50.07430400', '14.44174140', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'kavárna, výstava, zahrádka', 'Designová kavárna v centru Vinohrad je klidným místem k posezení s přáteli. Kavárna každý měsíc připravujeme výstavu, kterou si můžete vychutnat v klidu domácího prostředí se skvělou domácí limonádou z čerstvého ovoce. Zahrádka ve dvoře nabízí klidné posezení s vůní bylinek a koření.', '2017-04-12 18:20:38', '2017-04-25 14:35:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '16.00', 11, b'1'),
(379, 443, 126, 126, 538, NULL, NULL, 3, 'Monolok Cafe', 'CZE', 'cafe@monolok.cz', 'www.monolok.cz', '739018195', '739018195', 'Moravská 1540/18', 'Praha', '12000', NULL, 50, '50.07426080', '14.44298100', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'Výborná káva, vlastní kávová směs, dezerty, denní menu', 'Káva nejvyšší kvality. Překonáme Vaše očekávání a podáme Vám kávu nejvyšší kvality. Klademe velký důraz na výběr kávy a její přípravu. Na kávovaru La Marzocco připravujeme espressa z vlastní kávové směsi z české pražírny CoffeeSource. Pokud jste příznivcem větších šálků, rádi Vám připravíme kávu filtrovanou, na Dripu, nebo Vacuum pot. \n\nDenně pro vás pečeme voňavé koláče a dorty. \n\nKáva nejvyšší kvality z českých i světových pražíren. \n\nČerstvé domácí snídaně, zdravé saláty a sendviče. \n\nVyberte si z pestré nabídky osvěžujících a kvalitních nápojů. Nabídka kvalitních bílých, červených a růžových vín.', '2017-04-14 10:41:00', '2017-04-25 06:43:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '160.00', '1200.00', '13.00', 5, b'1'),
(380, 444, 126, 126, 538, NULL, NULL, 1, 'Restaurace Klempírna', 'CZE', 'info@klempirna-restaurant.cz', 'www.klempirna-restaurant.cz', '222542800', '604849364', 'Záhřebská 19', 'Praha', '12000', NULL, 50, '50.07212430', '14.43696980', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřácká restaurace, dětský koutek, salonek', 'Nekuřácká restaurace. S dětským koutkem, salonkem, u  nás praženou kávou, obsluhou, která ráda plní vaše přání a rodinnou atmosférou.', '2017-04-14 10:43:30', '2017-04-25 06:54:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '130.00', '1300.00', '15.00', 13, b'1'),
(381, 445, 126, 126, 538, NULL, NULL, 1, 'Restaurace Kravín', 'CZE', 'kravin@restauracekravin.cz', 'www.restauracekravin.cz', '222540524', '702 015 054', 'Náměstí Míru 109/18', 'Praha', '12000', NULL, 50, '50.07461620', '14.43531490', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'tradice, pivní tanky, piva, koktejly, polední menu', 'Nově otevřená restaurace  Originál 1869 Kravín navazuje na bohatou tradici legendární vinohradské hospody. Pivo Gambrinus nepasterizovaný 10° se čepuje přímo z pivních tanků a hosté jej dostávají v té nejvyšší kvalitě. Také doporučujeme Gambrinus nefiltrovaný, pšeničné pivo Fénix, Cider Kingswood a černého Kozla. V našem sortimentu naleznete velký výběr koktejlů, vín z celého světa i těch šumivých z oblasti Prosecco. Vynikající káva Caffé del Doge (Venezia) stojí rozhodně za zmínku. Každý všední den, nabízíme od 11-15 hod. polední menu s polévkou od 98 Kč, výběr z 5 variant. Útulný, moderní interiér, výborná kuchyně a příjemný personál , to vše u nás naleznete. Rezervace doporučujeme.', '2017-04-14 10:46:04', '2017-04-25 09:21:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '160.00', '1800.00', '12.00', 10, b'1'),
(382, 446, 126, NULL, NULL, NULL, NULL, 0, 'La Loca Music Bar Restaurant', 'CZE', 'info@laloca.cz', 'www.laloca.cz', '221595364', NULL, '', '', '', NULL, 50, '0.00000000', '0.00000000', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', NULL, '', '2017-04-14 10:51:36', '2017-04-17 10:26:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'N', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1100.00', '10.00', 13, b'1'),
(383, 447, 126, 126, 538, NULL, NULL, 1, 'Restaurace Legenda', 'CZE', 'info@legendapraha.cz', 'www.legendapraha.cz', '224919056', '737 626 848', 'Legerova 39', 'Praha', '12000', NULL, 50, '50.07388090', '14.43018370', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace, music bar, polední nabídka, obložené mísy, rozvoz', 'RESTAURACE A MUSIC BAR.  RESTAURACE LEGENDA JE NEKUŘÁCKÁ PO CELÝ DEN. WI-FI PŘIPOJENÍ ZDARMA V CELÉM PODNIKU.', '2017-04-14 10:53:50', '2017-04-25 09:50:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '100.00', '1800.00', '19.00', 9, b'1'),
(384, 448, 126, 126, 538, NULL, NULL, 1, 'Restaurace Lemon Leaf', 'CZE', 'lemon@lemon.cz', 'www.lemon.cz', '224919056', '775402607', 'Myslíkova 14', 'Praha', '12000', NULL, 50, '50.07748910', '14.41660710', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'thajská kuchyně, lunch menu, Wi-Fi', 'Jsme na trhu již 14 let. Za tu dobu jste nás naučili co máte rádi, co vám chutná, jaké prostředí vám vyhovuje a my se to snažíme každý den plnit. Jen díky vám patříme k nejoblíbenějším thajským restauracím v Praze. Vaříme originální a poctivé thajské jídlo. Žádné náhražky u nás nehledejte! V nabídce máme také kontinentální kuchyni – pro ty z vás co to neradi ostré. Přes oběd se u nás nekouří. Přijďte vyzkoušet naše Lunch Menu.', '2017-04-14 10:55:50', '2017-04-25 10:08:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '100.00', '1900.00', '16.00', 8, b'1'),
(385, 450, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Mechanický Balet', 'CZE', 'info@mechanickybalet.cz', 'www.mechanickybalet.cz', '604978925', '604978925', 'Žitná 52', 'Praha', '12000', NULL, 50, '50.07703960', '14.43010830', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'denní menu, pivní speciály, domácí limonáda', 'Domácí atmosféra. Burgery a steaky. A k nim vyzkoušejte naše pivní speciály, desítky druhů rumů nebo domácí limonádu.', '2017-04-16 09:33:19', '2017-05-01 06:33:14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '170.00', '1700.00', '13.00', 9, b'1'),
(386, 451, 126, 126, 538, NULL, NULL, 1, 'Restaurace Merlin Irish Pub', 'CZE', 'info@merlin-pub.cz', 'www.merlin-pub.cz', '222522054', '775402607', 'Bělehradská 68a', 'Praha', '12000', NULL, 50, '50.07086640', '14.43334930', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'irish pub, dřevěný bar, zahrádka', 'Naši milí hosté, vítáme Vás v Merlinu!\nJsme tady již dvanáctým rokem a jsme nesmírně rádi, že jste na nás nezanevřeli.\nV horní části restaurace je stylový dřevěný bar s místy na sezení a velkými okny. Po schůdkách pak sestoupíte do druhé části, příjemné místnosti s dřevěnou podlahou a cihlovou klenbou. V této části nabízíme i možnost rautů, firemních večírků, svateb, promocí, apod. Celková kapacita restaurace je 70 míst.\nNabízíme Vám k příjemnému posezení několik druhů točeného piva -  Guinness, Pilsner Urquell, Velkopopovický Kozel, Volba sládků, Kingswood a řezané pivo. K pivečku máme výborné pečené kolínko, žebírka, křidélka, velký výběr steaků, a spoustu jiných dobrot k uspokojení všech mlsných jazýčků. Také Vám můžeme nabídnout velký výběr vín.\nOd pondělí do pátku nabízíme za nízké ceny polední menu se čtyřmi druhy jídel, najdete ho každý den na našich stránkách. V horní části se po dobu obědů nekouří do 15.00 hod. Platit je možné jak stravenkami, tak platebními kartami.\nV letních dnech můžete posedět i na příjemné zahrádce. Rezervace je možná pouze na tel. čísle 222 522 054.', '2017-04-16 09:41:07', '2017-04-25 14:08:23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '120.00', '1100.00', '18.00', 12, b'1'),
(387, 452, 126, 126, NULL, NULL, NULL, 1, 'Mibi´s Restaurant', 'CZE', 'restaurant.mibis@gmail.com', 'www.gastro-booking.com/#/app/restaurant/387', '603710645', '603710645', 'Štěpánská 9', 'Praha', '12000', NULL, 50, '50.07656700', '14.42420070', NULL, '0', '0', '0', '0', '2800533365', '2010', 'vietnamská kuchyně, denní menu', 'Autentická a moderní vietnamská kuchyně.', '2017-04-16 09:46:02', '2017-04-26 11:13:58', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*34A1EC02BBD108CB7606FC14A949525706446DBB', 1, 1, NULL, NULL, '130.00', '1300.00', '16.00', 8, b'1');
INSERT INTO `restaurant` (`id`, `ID_user`, `ID_user_data`, `ID_user_acquire`, `ID_user_active`, `ID_user_contract`, `ID_user_dealer`, `ID_restaurant_type`, `name`, `lang`, `email`, `www`, `phone`, `SMS_phone`, `street`, `city`, `post_code`, `address_note`, `ID_district`, `latitude`, `longitude`, `accept_payment`, `company_name`, `company_address`, `company_number`, `company_tax_number`, `account_number`, `bank_code`, `short_descr`, `long_descr`, `created_at`, `updated_at`, `deleted_at`, `car_park`, `truck_park`, `lounge`, `child_corner`, `wifi`, `clima`, `playground`, `darts`, `billiard`, `pool`, `bowling`, `horse_riding`, `swim_pool`, `lake`, `sauna`, `wellness`, `status`, `currency`, `password`, `show_phone`, `show_www`, `dealer_note`, `version`, `patron_minimal`, `patron_overtake`, `patron_promillage`, `patron_days`, `show_patron`) VALUES
(388, 453, 126, 126, 538, NULL, NULL, 3, 'Mimoichi Coffeteria', 'CZE', 'dennisa853@gmail.com', 'www.momoichi.cz', '721364002', '721 364 002', 'Římská 1199/35', 'Praha', '12000', NULL, 50, '50.07705620', '14.43682770', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'Kavárna, japonský styl, Alpha Dominche', 'Myšlenka na založení vlastní kavárny se v našich hlavách rodila postupně. Čím dál víc jsme si začali uvědomovat, že káva v pravém slova smyslu nemá být pro člověka cílem, ale spíše prostředkem. Prostředkem k vzájemnému setkávání, poznání anebo ke zklidnění a odpočinku. Není proto naší ambicí připravit kávu v co nejkratším čase, ale v co nejpříjemnější atmosféře. V naší kavárně se setkáte nejen se špičkovou kávou a technologií přípravy, ale především s nadstandardním servisem.\n\nSvou pohostinností a vstřícností nás inspirovalo Japonsko, které má vytříbenou čajovou kulturu sahající až do období Momoyama. Proto jsme naší kavárně dali jméno Momoichi odrážející filozofii klidu a vzájemného porozumění. Chceme kavárně navrátit její společenskou funkci – příběh kávy nepíší jen ti, kdo ji pěstují a praží, ale i ti, kdo ji připravují a pijí. Přejeme si, aby Momoichi byla takových příběhů plná.', '2017-04-16 09:49:03', '2017-04-25 14:42:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '180.00', '1100.00', '12.00', 13, b'1'),
(389, 454, 126, 126, 538, NULL, NULL, 1, 'Restaurace Olive Point', 'CZE', 'info@olivepoint.cz', 'www.olivepoint.cz', '607161672', '607161672', 'Americká 29', 'Praha', '12000', NULL, 50, '50.07338130', '14.43738530', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'středomořská kuchyně, delikatesy, Wifi, zahrádka, prostor pro soukromé akce, prostor pro nekuřáky', 'Olive Point je místem, kde se lidé setkávají, aby si ve skvělé atmosféře vychutnali středomořskou kuchyni a víno, dezerty, kávu nebo čaj. V poslední době podniky ve městě často působí dojmem zašlé kopie jeden druhého a jediné, čím se v nich pozdě odpoledne můžete osvěžit, je přeslazená alkoholická limonáda.\n\nRozhodli jsme se vám nabídnout něco jiného a jedinečného.Pro milovníky pravých hodnot, lahodných chutí a kvality existuje sofistikované místečko ve stylu luxusních podniků ze Sexu ve městě. Olive Point je místem středomořských pokladů. Jeho stylovou a živou atmosféru si můžete vychutnat v samém srdci Vinohrad.\n\nZ našeho malého, ale perfektně sestaveného menu si třeba k večeři můžete dopřát vynikající sendviče, saláty, mořské plody, pokrmy z masa, domácí dezerty a nejrůznější jiné středomořské delikatesy – společně se sklenkou vína z našeho exkluzivního vinného lístku.', '2017-04-16 09:52:03', '2017-04-25 14:57:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1100.00', '10.00', 12, b'1'),
(390, 455, 126, 126, 538, NULL, NULL, 1, 'Restaurace Pastička', 'CZE', 'pasticka@pasticka.cz', 'www.pasticka.cz', '222253228', '775402607', 'Blanická 25', 'Praha', '12000', NULL, 50, '50.07829170', '14.43952250', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'polední menu, vína, zahrádka', 'Dovolujeme si Vás přivítat v naší restauraci PASTIČKA s útulným a příjemně laděným interiérem.\n\nKaždý den si můžete vybrat z široké nabídky hotových jídel sestavených do cenově výhodných poledních menu.\n\nK dobrému jídlu patří pečlivě ošetřované točené pivo Bernard, moravská a světová vína i sortiment alkoholu či míchaných nápojů.\n\nK restauraci PASTIČKA patří příjemná ZAHRÁDKA ve dvoře, kde si můžete posedět do 22 hodiny pod korunami kaštanů.\n\nRádi pro Vás uspořádáme rauty, firemní večírky i akce, promoce, narozeninové oslavy či svatební hostiny.\n\nNaši restauraci najdete také na Facebooku, kde Vám přinášíme čerstvé informace ohledně akcí a novinek, které by neměli uniknout Vaší pozornosti.', '2017-04-16 10:45:29', '2017-04-25 15:01:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*F229ECCBE281259AD1003479990A6530BB5F59CE', 1, 1, NULL, NULL, '150.00', '1500.00', '18.00', 14, b'1'),
(391, 456, 126, 126, 537, NULL, NULL, 4, 'Pizza Coloseum Legerova', 'CZE', 'legerova@coloseum.cz', 'www.coloseum.cz', '222543519', '775402607', 'Legerova 802/64', 'Praha 2', '120 00', NULL, 50, '50.07533470', '14.43033540', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Coloseum pizzerie', 'Pizzerie Coloseum', '2017-04-16 10:47:32', '2017-04-26 03:02:23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1300.00', '17.00', 13, b'1'),
(392, 457, 126, 126, NULL, NULL, NULL, 1, 'Pizzerie Fresco Vento', 'CZE', 'frescovento.info@gmail.com', 'www.frescovento.cz', '224922887', '775402607', 'Rašínovo nábřeží 1571/62', 'Praha 2', '120 00', NULL, 50, '50.07338350', '14.41408550', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Domácí pizzy', 'Restaurace se vyznačuje, tak jak už napovídá sám název a tím se odlišuje od řady dalších čerstvými surovinami, vlastní výrobou famózní domácí pizzy připravované ve vlastní peci, domácí výrobou vlastních těstovin (spaghetti, fettucine, mezzelune,gnocci a další)  z výběrové italské mouky, čerstvými saláty a je proslulá vynikající italskou tiramisu z italských ingrediencí. Dále nabízíme italská rizota, masa a ryby. Nabídka vín v naší restauraci je vybírána z kvalitních italských vín a pro domácí fanoušky je v nabídce řada vín z Čech a Moravy. Od pondělí do pátku si u nás můžete dát polední menu. Samozřejmostí je poskytování hojně využívané služby „TAKE AWAY“ – jídlo, pití, pizza s sebou. Restaurace je rozdělena na kuřáckou a nekuřáckou část.\nV letních měsících naše restaurace nabízí po letní procházce po nábřeží  příjemné posezení na zahrádce pod slunečníky s výhledem na řeku Vltvavu.\nPro privátní skupiny, firemní setkání a další příležitosti jako jsou oslavy narozenin, svatby, promoce, hudební setkání nabízíme možnost po dohodě částečného uzavření nebo celkového uzavření restaurace s báječnou obsluhou.', '2017-04-16 10:51:10', '2017-04-26 03:02:48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1600.00', '18.00', 8, b'1'),
(393, 458, 126, 126, 537, NULL, NULL, 4, 'Pizzerie Redflower', 'CZE', 'redflower@atlas.cz', 'www.pizzerie-redflower.cz', '222253829', '775402607', 'Vinohradská 29/1596', 'Praha 2', '120 00', NULL, 50, '50.07810100', '14.43700700', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Skvělá kuchyně', 'Jsme jednou z nejstarších pražských pizzerií *1997.\nRádi bychom, aby jste se u nás cítili příjemně, o to se postarají naše  milé servírky, Vaše chuťové zážitky uspokojí skvělá kuchyně.\n                                                                                                                                                      Máme své hosty rádi.', '2017-04-16 10:53:42', '2017-04-26 03:03:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1000.00', '11.00', 12, b'1'),
(394, 459, 126, 126, NULL, NULL, NULL, 9, 'Restaurace Puro', 'CZE', 'info@bistropuro.cz', 'www.puroshop.cz', '731111119', '731111119', 'Vinohradská 44', 'Praha 2', '120 00', NULL, 50, '50.07701990', '14.44095700', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'veganské a raw food bistro', 'Puro je veganské a raw food bistro kousek od Náměstí Jiřího z Poděbrad a Riegrových sadů. Pro milovníky netradičních chutí a vůní je to trefa do černého. V denním menu najdete polévky, saláty, sendviče, dezerty i úžasnou zmrzlinu proslulou široko daleko. V bistru si také můžete osobně vyzvednout zboží z e-shopu Veganz.\nV restauraci Puro ochutnáte „pure vegan and raw food“, tedy čerstvé, zdravé a cruelty-free jídlo. Denní menu, které každý den obměňují, nabízí opravdu pestrou kombinaci chutí s vlivy mexické, indické, španělské, italské i japonské kuchyně.\nV Puro ochutnáte například výborný Puro burger, kokosové kari s rýží, fazolové burrito, musaku s lilkem, raw ravioli s keši krémem, pizzu i veganské sushi. Přestože je značka Puro mezinárodní, jídlo tu připravují z co nejvíc lokálně dostupných sezonních surovin.', '2017-04-16 10:56:46', '2017-04-26 03:03:53', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1700.00', '10.00', 7, b'1'),
(395, 460, 126, 126, NULL, NULL, NULL, 1, 'Restaurant U Emy Destinnové', 'CZE', 'uemydestinnove@seznam.cz', 'www.uemydestinnove.cz', '224918425', '775402607', 'Kateřinská 7', 'Praha 2', '120 00', NULL, 50, '50.07415490', '14.42487520', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Nejčerstvější ingredience', 'Používáme nejčerstvější ingredience, od mořských plodů, ryb až po Greater Omaha Black Angus', '2017-04-16 10:59:32', '2017-04-26 03:04:14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1700.00', '11.00', 9, b'1'),
(396, 461, 126, 126, NULL, NULL, NULL, 1, 'Restaurant U Kašpara', 'CZE', 'restaurantkaspar@restaurantkaspar.cz', 'www.restaurantkaspar.cz', '222562218', '775402607', 'Pod Nuselskými schody 139/1', 'Praha 2', '120 00', NULL, 50, '50.06849420', '14.43587460', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Stylový, netradičně a originálně zařízený restaurant', 'V restauraci podáváme jídla tradiční české kuchyně, v době oběda si můžete vybrat chutné pokrmy z denního menu za příznivé ceny (od 11,00 do 15,00 hod.). V nabídce máme také pokrmy vhodné pro vaše hladová dítka. Nezapomněli jsme ani na vegetariány – pro ně máme nachystaná vegetariánská jídla, pokrmy z ryb a také širokou nabídku zeleninových salátů.\nPo dobrém obědě vám jistě přijde vhod malý zákusek, či dobrá kávička, k pokrmům nabízíme čepované chlazené pivko, rozlévaná kvalitní vína, koktejly i nealko drinky.', '2017-04-16 11:14:41', '2017-04-25 17:02:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1800.00', '14.00', 9, b'1'),
(397, 462, 126, 126, 537, NULL, NULL, 1, 'Ristorante Sapory', 'CZE', 'info@ristorante-praha.cz', 'www.saporirestaurace.cz', '222523533', '775402607', 'Americká 20', 'Praha 2', '120 00', NULL, 50, '50.07266150', '14.43817210', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Italská kuchyně', 'V Sapori ochutnáte opravdovou a poctivou Itálii. Vaří tu z těch nejčerstvějších potravin, často v bio kvalitě. Dalšími trumfy jsou příjemné elegantní prostředí a špičkový servis.\n\nRyby a plody moře, těstoviny, saláty, rizota, masové speciality nebo výborné dezerty. V restauraci Sapori, která sídlí na příjemném vinohradském náměstíčku, poznáte chuť pravé Itálie. Podnik se pyšní bohatou nabídkou exkluzivních ovocných pálenek a grappy.', '2017-04-16 11:16:42', '2017-04-26 03:04:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '15.00', 6, b'1'),
(398, 463, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Samurai', 'CZE', 'info@topsushi.cz', 'www.restaurace-samurai.cz', '222515330', '774422217', 'Londýnská 73/379', 'Praha 2', '120 00', NULL, 50, '50.07612840', '14.43272440', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Japonská kuchyně, Sushi', 'Po náročné dvouleté rekonstrukci byla sushi restaurace Samurai v říjnu 2006 slavnostně otevřena a nabízí svým zákazníkům zcela nové zážitky v oblasti gastronomie. Japonská kuchyně Vás jistě nadchne a okouzlí. Samurai je v současné době největší a nejluxusnější sushi japonská restaurace v Praze.', '2017-04-16 11:19:52', '2017-04-26 03:05:03', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1100.00', '18.00', 11, b'1'),
(399, 464, 126, 126, 537, NULL, NULL, 3, 'Square cafe', 'CZE', 'dagmartimrova@gmail.cz', 'www.squarecafe.cz', '724795074', '724795074', 'Botičská 10', 'Praha 2', '120 00', NULL, 50, '50.06848370', '14.42018400', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Rodinná kavárna', 'Square Café je útulná rodinná kavárna o kapacitě zhruba 20 míst.\nNabízí k posezení klidné prostředí, kde si můžete vychutnat šálek kávy, sklenku vína, nebo něco dobrého k snědku...', '2017-04-16 11:22:34', '2017-04-26 03:05:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '19.00', 6, b'1'),
(400, 465, 126, 126, 537, NULL, NULL, 1, 'Summa Cum Laude', 'CZE', 'eat@summacumlaude.cz', 'www.summacumlaude.cz', '211155129', '775402607', 'Belgická 26', 'Praha 2', '120 00', NULL, 50, '50.07301360', '14.43617880', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Výtečné jídlo', 'Přidejte se k nám na naší cestě objevování nových způsobů, jak si vychutnat výtečné jídlo netradičně a přitom jednoduchým způsobem.\n„Summa Cum Laude je cíl, k jehož naplnění směřuje každý detail naší restaurace i každý, kdo v ní pracuje. Každá vaše návštěva je pro nás ,vyznamenání'' . Stejně vážené jako vyznamenání, kterého se dostává obvykle absolventům univerzit a vysokých škol, kteří dosáhli nejlepšího možného hodnocení v akademickém vzdělání.“\nVyzkoušejte a užijte si naši nabídku individualizovaných služeb, které vycházejí z místních kulinářských tradic i z moderního, městského a kosmopolitního způsobu vychutnávání jídla. Summa Cum Laude je místo, kde se vše stává skutečností. Právě teď.', '2017-04-16 11:29:49', '2017-04-25 17:56:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1300.00', '17.00', 9, b'1'),
(401, 466, 126, 126, NULL, NULL, NULL, 12, 'Restaurace Šenkovna Pub', 'CZE', 'info@senkovnapub.cz', 'www.senkovnapub.cz', '607888836', '607888836', 'Sokolská 60', 'Praha 2', '120 00', NULL, 50, '50.07615557', '14.42928873', NULL, 'Le Sabrage s.r.o.', 'Sokolská 1788/60, Praha 2 - Nové město', '05585970', 'CZ05585970', '115-2579350227', '0100', 'Letní zahrádka', 'Šenkovna je vinárna přímo v centru Prahy s výbornou dopravní dostupností. Místo určené pro obchodní setkání, romantické posezení ve dvou, či bouřlivý večírek. V letním období můžete posedět na letní zahrádce, která je v klidném vnitrobloku a není časově omezena nočním klidem. Vždy je otevřena dle otevírací doby.\nVšechna vína, chuťovky i suroviny pro přípravu pokrmů pro vás pravidelně vybíráme, ručíme za jejich čerstvost a rádi sdělíme jakou cestou k nám dorazily. Nejraději si vše vybíráme osobně přímo u dodavatelů.', '2017-04-16 11:45:35', '2017-04-25 17:59:50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1600.00', '12.00', 9, b'1'),
(402, 467, 126, 126, NULL, NULL, NULL, 1, 'Špajz restaurant', 'CZE', 'spajzrestaurant@atlas.cz', 'www.spajzrestaurant.cz', '222519968', '775402607', 'Vratislavova 1/21', 'Praha 2', '128 00', NULL, 50, '50.06635820', '14.41922750', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Denně čerstvá nabídka ze sezonních surovin', 'Jsme malá restaurace zakládající si na denně čerstvé nabídce ze sezonních surovin. Vaříme zajímavá a hlavně chutná jídla inspirovaná jižní kuchyní. Ochutnejte italská rizota, tradiční čerstvé těstoviny, rybí speciality nebo šťavnaté steaky. Pro lehčí verzi oběda si vyberete domácí poctivé polévky, mexické tortilly, slané koláče quiche, zeleninové saláty nebo dezerty z naší kuchyně.', '2017-04-16 11:47:47', '2017-04-26 03:06:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*881479A638D055B603E229BDF85651B8A69673F0', 1, 1, NULL, NULL, '120.00', '1000.00', '16.00', 12, b'1'),
(403, 468, 126, 126, 537, NULL, NULL, 1, 'Restaurace The Craft', 'CZE', 'info@thecraft.cz', 'www.thecraft.cz', '727895310', '727895310', 'Náměstí míru 4', 'Praha 2', '120 00', NULL, 50, '50.07618250', '14.43582500', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'burgery z nejlepšího českého masa', 'Milujeme maso a milujeme pivo. A víme, že je vždycky dobré, když se věci dělají vlastníma rukama a s vášní. Proto vyrábíme burgery z nejlepšího českého masa a vybíráme nejlepší minipivovary z České republiky, aby nás zásobily čerstvým řemeslným pivem.', '2017-04-16 11:50:20', '2017-04-26 03:06:34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1100.00', '13.00', 10, b'1'),
(404, 469, 126, 126, NULL, NULL, NULL, 1, 'Restaurace U Dobré myšlenky', 'CZE', 'info@dobramyslenka.cz', 'www.dobramyslenka.cz', '224914424', '775402607', 'Podskalská 27', 'Praha 2', '120 00', NULL, 50, '50.07084030', '14.41517760', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Moderní restaurace, Poctivá česká a vynikající mezinárodní kuchyně', 'Jsme moderní restaurace u Rašínova nábřeží s moderní, ale poctivou českou a vynikající mezinárodní kuchyní.\nNabízíme 140 míst k sezení, v letní sezóně pak posezení na zahrádce. Prostor  restaurace je členěn do čtyř částí, a to salonku pro až 25 osob zvaného kavárna, hlavní restaurační části pro 60 osob, královského salonku pro 15 osob a salonku pro 40 osob zvaného galerie. Restuarace je tedy vhodná k uspořádání rodinné oslavy, narozeninové párty, firemní akce, večírků, svateb, promocí, rautů, vánočních večírků. Rádi vám vše upravíme dle vašich požadavků, navrhneme menu, výzdobu, hudbu i popř. program akce.\nRestaurace je zcela nekuřácká, pro kuřáky máme místo před vchodem do restaurace. Pro děti  je dispozici prostorný dětský koutek a možností sledování pohádek na DVD.', '2017-04-16 14:42:08', '2017-04-26 03:07:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1900.00', '14.00', 5, b'1'),
(405, 470, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Havrana', 'CZE', 'rezervace@restauraceuhavrana.cz', 'www.restauraceuhavrana.cz', '608444034', '608444034', 'Hálkova 6', 'Praha 2', '120 00', NULL, 50, '50.07617240', '14.42856270', NULL, 'Miroslav ŽEMLIČKA', 'Habartická 499/50, Praha 9 - Střížkov', '86584791', NULL, '115-2579350227', '0100', 'Příjemné prostředí, Bohatá nabídka jídel a nápojů', 'Restaurace u Havrana vám nabízí příjemné prostředí, bohatou nabídku jídel a nápojů, příjemnou obsluhu a je vám k dispozici až do brzkých ranních hodin. Kapacita je 70 návštěvníků a po domluvě s dostatečným předstihem si lze pronajmout i celou restauraci. Vaše oblíbené TV přenosy, a to nejen sportovní, vám promítneme na velkoplošné projekci. V naší restauraci se můžete věnovat i práci a k internetu se bezplatně připojit prostřednictvím WI-FI. Restaurace se nachází cca 200m od stanice metra I.P.Pavlova, kde i v nočních hodinách je výborné spojení MHD.', '2017-04-16 14:45:13', '2017-04-26 03:07:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1800.00', '15.00', 6, b'1'),
(406, 471, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Houmra', 'CZE', 'rzuhoumra@centrum.cz', 'www.uhoumra.cz', '222510510', '775254298', 'Šumavská 20', 'Praha 2', '120 00', NULL, 50, '50.07486340', '14.44413580', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stylová restaurace, Nekuřácká restaurace', 'Stylová restaurace se nachází na královských Vinohradech v blízkosti náměstí Míru v Praze.', '2017-04-16 14:48:33', '2017-04-26 03:07:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1200.00', '10.00', 7, b'1'),
(407, 472, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Matějíčků', 'CZE', 'info@umatejicku.cz', 'www.umatejicku.cz', '224917136', '602246288', 'Náplavní 5', 'Praha 2', '120 00', NULL, 50, '50.07654030', '14.41508130', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Kuřácká i nekuřácká část', 'Naše restaurace se nachází v lokalitě Praha 2 na adrese Náplavní 5, v bezprostřední blízkosti Jiráskova náměstí. K příjemnému posezení je k dispozici bar, dva salonky pro 12 a 15 osob a dva stylové sklípky pro 2 x 20 osob. Prostory jsou rozděleny na kuřáckou a nekuřáckou část. K dobrému jídlu čepujeme Prazdroj a Kozla 10. V pracovních dnech si od 11:00 můžete vybrat z hotových jídel.', '2017-04-16 14:50:35', '2017-04-26 03:07:59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '10.00', 13, b'1'),
(408, 473, 126, 126, NULL, NULL, NULL, 4, 'Restaurace U Mlsného Bobra', 'CZE', 'petrchico@seznam.cz', 'www.mlsnybobr.wz.cz', '224942516', '775402607', 'Ječná 45', 'Praha 2', '120 00', NULL, 50, '50.07564790', '14.42881900', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Rodinná pizzerie', 'Zveme Vás k příjemnému posezení v pizzerii U Mlsného bobra v centru Prahy. Je to malá rodinná pizzerie s příjemnou atmosférou dostupná chůzí 2 minuty od stanice metra I.P. Pavlova. Podávají teplá a studená jídla po celý den. Přijďte k sem na oběd. Každý den si můžete vybrat jídlo z denního menu se zvýhodněnými cenami.', '2017-04-16 14:53:32', '2017-04-26 03:08:27', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1800.00', '15.00', 14, b'1'),
(409, 474, 126, 126, 537, NULL, NULL, 5, 'Restaurace U Růžového Sadu', 'CZE', 'restaurace@uruzovehosadu.cz', 'www.uruzovehosadu.cz', '222725154', '775402607', 'Mánesova 1407/89', 'Praha 2', '120 00', NULL, 50, '50.07800200', '14.44828600', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Dobré pivo, Polední menu', 'Jsme klasická pivnice zaměřená na dobré pivo, připravujeme pestré polední menu se zaměřením na českou kuchyni. Večer lahůdky k pivu, ale i nabídka minutkových jídel. \n \nSnažíme se jít cestou, že poctivá česká hospůdka se mezi všemi různými evropskými restauracemi neztratí', '2017-04-16 14:56:08', '2017-04-26 03:08:51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1400.00', '12.00', 12, b'1'),
(410, 475, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Sedlerů', 'CZE', 'info@usedleru.cz', 'www.usedleru.cz', '221986345', '775402607', 'Karlovo nám. 17', 'Praha 2', '120 00', NULL, 50, '50.07718430', '14.41906710', NULL, 'Dobrý obchod s.r.o.', 'Nad lesním divadlem 1353/8, Praha 4 - Braník', '775402607', 'CZ27649741', '115-2579350227', '0100', 'Tankové pivo, Česká kuchyně', 'Pilsner Urquell Z TANKU, česká kuchyně, hotová jídla, polední menu, sezonní speciality, točená limonáda, ovocné pálenky Žufánek\nnekuřácký salónek, WiFi, sportovní přenosy, rodinné oslavy, promoce, firemní večírky.', '2017-04-16 15:04:47', '2017-04-26 03:09:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1800.00', '13.00', 7, b'1'),
(411, 476, 126, 126, 537, NULL, NULL, 1, 'Restaurace U Šemíka', 'CZE', 'office@usemika.cz', 'www.usemika.cz', '221965637', '775402607', 'Vratislavova 36', 'Praha 2', '128 00', NULL, 50, '50.06572140', '14.42001390', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Kvalita pokrmů', 'Chloubou našeho hotelu je, mimo jiné i naše restaurace, která se stala vyhlášenou a vyhledávanou díky skvělé kvalitě pokrmů. Originální knihovna a zajímavě členěné prostory s klenutými stropy vytváří ojedinělou atmosféru, ve které můžete strávit příjemné chvíle se svými blízkými a vychutnat si naše speciality.\nV zimních měsících zpříjemní posezení v restauraci praskající oheň v krbu.\nV letních měsících Vás zveme k posezení na romantické zahrádce, kam se nese zvonkohra z nedalekého kostela Sv. Petra a Pavla. Nabízíme zde i možnost odděleného posezení u velké tabule, pro uzavřenou společnost až 30 osob.\nV zadní části naší restaurace si můžete prohlédnout naprosto ojedinělou, stálou expozici iluminací Kodexu vyšehradského, který je od roku 2005 prohlášen Národní kulturní památkou.\nKapacita restaurace je 70 míst, zahrádka nabízí 60 míst a předzahrádka 16. Formou rautu lze uspořádat restauraci pro 100 osob.\nNaše restaurace je nekuřácká!', '2017-04-16 15:07:23', '2017-04-26 03:09:29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '13.00', 10, b'1'),
(412, 477, 126, 126, NULL, NULL, NULL, 1, 'Underground restaurant', 'CZE', 'oliveratemelkovska@seznam.cz', 'www.underground-restaurant-a-bar.webnode.cz', '222240649', '775402607', 'Mánesova 52', 'Praha 2', '120 00', NULL, 50, '50.07764870', '14.44231100', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Balkánská a mediteránská kuchyně', 'Říká se, že láska prochází žaludkem. Proto věříme, že si naši restauraci zamilujete. Kromě profesionálně vyškoleného personálu se u nás můžete těšit na široký výběr balkánských specialit i mediteránských jídel a nápojů. V příjemném prostředí naší restaurace bude i pracovní oběd vždy příjemnou záležitostí a večeře s rodinou či přáteli radostným zážitkem. Uvítá Vás klidná, příjemná atmosféra a vstřícný personál s profesionálním přístupem. Na kvalitu jídla jsou u nás kladeny vysoké nároky a ke každé objednávce přistupujeme s maximální pozorností a péčí. To jsou hlavní ingredience, díky kterým se k nám budete rádi znovu a znovu vracet.\n\nPřijďte ochutnat to nejlepší z naší balkánské a mediteránské kuchyně.', '2017-04-16 15:10:40', '2017-04-26 03:10:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1700.00', '12.00', 12, b'1'),
(413, 478, 126, 126, 537, NULL, NULL, 1, 'Restaurace Viniční altán', 'CZE', 'info@vinicni-altan.cz', 'www.vinicni-altan.cz', '222516887', '775402607', 'Havlíčkovy sady 1369 - Gröbovka', 'Praha 2', '120 00', NULL, 50, '50.06865780', '14.44433390', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Viniční altan', 'Ve Viničním altánu pořádáme pravidelné degustace českých, moravských a zahraničních vín.', '2017-04-16 15:13:51', '2017-04-26 03:10:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1200.00', '15.00', 6, b'1'),
(414, 479, 126, 126, 537, NULL, NULL, 1, 'Restaurace Vinotéka Bacco', 'CZE', 'info@bacco.cz', 'www.bacco.cz', '723179242', '723179242', 'Bělehradská 28', 'Praha 2', '120 00', NULL, 50, '50.06842590', '14.43522820', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Interiér v pompejském stylu', 'Naše vinotéka se nachází na Praze 2 v ulici Bělehradská 28 přímo u zastávky tramvaje 11 a 13, Nuselské schody.  Autentický interiér je vytvořen v pompejském stylu a skvěle dokresluje zážitek z našich sardinských vín a kulinářský zážitek po ochutnání specifických sýrů a salamů.  Vinotéka nabízí posezení v restauraci  a nekuřácký salonek, kde je možné pohostit uzavřené společnosti.', '2017-04-16 15:16:24', '2017-04-26 03:10:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1000.00', '17.00', 9, b'1'),
(415, 480, 126, 126, 537, NULL, NULL, 1, 'Restaurace Zapomenutý Čas', 'CZE', 'restaurace@zapomenutycas.cz', 'www.zapomenutycas.cz', '222518159', '775402607', 'Anglická 658 / 23', 'Praha 2', '120 00', NULL, 50, '50.07637080', '14.43424440', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nekuřácká restaurace, Zimní zahrada', 'Nekuřácká restaurace s kapacitou 130 míst, kde nabízí např. čerstvé těstoviny, jehněčí kolínka, argentinské steaky, kvalitní francouzskou drůbež, hovězí a jehněčí burgery, velký výběr salátů, oceněná tuzemská vína. K posezení slouží i zimní zahrada (50 míst), kterou lze zarezervovat i pro soukromé nebo společenské akce.', '2017-04-16 15:26:42', '2017-04-26 03:11:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1600.00', '12.00', 9, b'1'),
(416, 481, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Zelena zahrada', 'CZE', 'zelena-zahrada@email.cz', 'www.zelena-zahrada.eu', '222518159', '775402607', 'Šmilovského 12', 'Praha 2', '120 00', NULL, 50, '50.07081700', '14.44279100', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Zimní i letní terasa', 'Jakmile vstoupíte do Zelené zahrady, obklopí vás pohoda a klid. Na zimní i letní terase si budete připadat přímo jako na dovolené, v zimě u romantického krbu, v létě pod slunečníky u jezírka s koi kapry. \nZelená zahrada představuje neotřelou fusion kombinaci svěží středomořské kuchyně s originální čínskou kuchyní jako byla ve Vodičkově ulici v letech 1958 – 1990. Na autentičnost číny dohlíží náš kamarád pan Malík, který vařil ve Vodičkově ulici v letech 1967 -1990. Bok po boku tak na menu mají své místo humři, které si můžete vylovit z aquária , grilovaná masa, švej-ču-žou, kung pao nebo kachna připravovaná originální čínskou recepturou. \nTěšíme se na vás.', '2017-04-16 15:30:08', '2017-04-26 03:11:25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1300.00', '19.00', 12, b'1'),
(417, 482, 126, 126, NULL, NULL, NULL, 1, 'Restaurace Zvonařka', 'CZE', 'info@restauracezvonarka.cz', 'www.restauracezvonarka.cz', '224251990', '608251989', 'Šafaříkova 1', 'Praha 2', '120 00', NULL, 50, '50.06996710', '14.43539090', NULL, 'PRAGUE PONT  s.r.o.', 'Šafaříkova 785/1, Praha 2 - Vinohrady', '25728041', 'CZ25728041', '115-2579350227', '0100', 'Letní terasa', 'V stylovém prostředí můžete ochutnat české i mezinárodní kuchařské speciality, masa na grilu, kvalitní vína z celého světa, širokou nabídku míchaných nápojů …\nPLZEŇSKÝ PRAZDROJ, \nnepasterizovaný Gambrinus,  černý Kozel, Apple Cider, Corona Extra a Frisco jest k mání !\n\nSalonek s tanečním parketem, barem, dataprojekcí, zvukovou a světelnou aparaturou je přímo ideální pro soukromé i firemní oslavy, prezentace a párty.', '2017-04-16 15:33:13', '2017-04-26 03:12:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1300.00', '18.00', 9, b'1'),
