(422, 487, 126, 126, 537, NULL, NULL, 2, 'Bar Albertov', 'CZE', 'miroslavbaudis@seznam.cz', 'https://www.facebook.com/bar.albertovtroyka', '606954217', '606954217', 'Na slupi 143/3', 'Praha 2', '128 00', NULL, 50, '50.06718550', '14.42137440', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stolní fotbálek, Jukebox', 'Provoz billiard baru se stolním fotbálkem a jukeboxem s kapacitou 70 míst. K dispozici je připojení k internetu prostřednictvím Wi-Fi i salonek. Nabízí zde alkoholické i nealkoholické nápoje a studenou kuchyni, 4 druhy piva - výborný Chodovar 11°,12°, černou 10° a Velkopopovický kozel 11°.', '2017-04-16 15:53:51', '2017-04-25 14:55:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1400.00', '19.00', 11, b'1'),
