(424, 489, 126, 126, 537, NULL, NULL, 2, 'Bar Dandy Prague', 'CZE', 'info@dandyprague.com', 'www.dandyprague.com', '605827981', '605827981', 'Anny Letenské 936/18', 'Praha 2', '120 00', NULL, 50, '50.07871100', '14.43851630', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Retro interiér', 'Stylový bar Dandy s retro interiérem zásobený skvělými signature koktejly a fenomenálním jídlem. Tady nikdo neřeší, zda jste černý, gay, tlustý nebo vychrtlý, starý nebo hipster - pohodová atmosféra vás prostě pohltí a všímavý personál už je jen třešničkou na dortu.', '2017-04-16 16:01:34', '2017-04-25 14:48:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1300.00', '16.00', 9, b'1'),
(425, 490, 126, 126, 537, NULL, NULL, 2, 'Golden WingZ', 'CZE', 'info@goldenwingz.cz', 'www.goldenwingz.cz', '773641411', '773641411', 'Polská 1560/7', 'Praha 2', 'Praha 2', NULL, 50, '50.07874980', '14.44613100', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Nabídka dobrého pití', 'Golden WingZ vás pohltí nabídkou dobrého pití, příjemné atmosféry a skvělé zábavy. Možnost uzavřené společnosti, rautu a limuzíny s řidičem.', '2017-04-17 07:29:41', '2017-04-25 14:43:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1500.00', '11.00', 8, b'1'),
(426, 491, 126, 126, 537, NULL, NULL, 2, 'Magister Kelley', 'CZE', 'chamil1@seznam.cz', 'www.magisterkelley.cz', '777864847', '777864847', 'Rejskova 3', 'Praha 2', '120 00', NULL, 50, '50.06691730', '14.43388090', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Magické místo, Neotřelý design, Dlouhá otevírací doba', 'MAGISTER KELLEY, magické místo, kde je každý večer alchymistickým zážitkem jako za časů Rudolfa II. Nabízíme 4 druhy piva, 13 rozlévaných vín, stovky alkoholických i nealko nápojů, skvělou zábavu, neotřelý design a dlouhou otevírací dobu.', '2017-04-17 07:32:45', '2017-04-25 14:39:49', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1300.00', '14.00', 6, b'1'),
(427, 492, 126, 126, 537, NULL, NULL, 2, 'Bar Nota', 'CZE', 'barnota@barnota.cz', 'www.barnota.cz', '775396456', '775396456', 'Štěpánská 9', 'Praha 2', '120 00', NULL, 50, '50.07656696', '14.42419758', NULL, 'Daniel Hanf', 'Dačického 1207/4, Praha 4 - Nusle', '05792274', '', '115-2579350227', '0100', 'Skvělé jídlo v moderní formě tapas, Letní zahrada', 'Vstupte do stylového prostoru baru Nota, který Vás uchvátí skvělým jídlem v moderní formě tapas, lahodnou kávou Moak a širokou nabídkou koktejlů. Nota je pro Vás otevřena celý den: ráno nabídne něco sladkého včetně denního tisku, během dne příjemné a nerušené posezení a v noci unikatní atmosféru. Bar Nota v minimalistickém designu interieru a příjemnou letní zahradou, která je otevřena dlouho do noci (diky svému umístění ve vnitrobloku nezavírá již ve 22hod jako jiné zahrádky) nabídne taktéž idealní prostor pro uspořádání narozeninových oslav, firemních večírků a jiných soukromých akcí. Notu najdete v těsné blízkosti Václavského náměstí, ve Štěpánské ulici.', '2017-04-17 07:35:08', '2017-04-25 14:36:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1000.00', '19.00', 8, b'1'),
(428, 493, 126, 126, 537, NULL, NULL, 1, 'Dhaba Beas vegetarian', 'CZE', 'dhaba@beas-dhaba.cz', 'www.beas-dhaba.cz', '773644561', '773644561', 'Bělehradská 90', 'Praha 2', '120 00', NULL, 50, '50.07335220', '14.43337230', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Vegetariánská restaurace', 'Naším záměrem je nabídnout široké veřejnosti jídlo připravované s maximálně etickým přístupem k okolnímu světu, které by přitom bylo chutné, výživné, zdravé a finančně dostupné všem.\n \nPři přípravě jídel vycházíme z tradiční indické vegetariánské kuchyně, tzn. nepoužíváme maso, ryby, vejce ani produkty, které je obsahují.\n \nKaždý den vaříme od základů, bez polotovarů a se zodpovědností.', '2017-04-17 07:40:53', '2017-04-25 14:31:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1100.00', '16.00', 12, b'1'),
(429, 494, 126, 126, 537, NULL, NULL, 9, 'Bistro Balbín', 'CZE', 'info@bistrobalbin.cz', 'www.bistrobalbin.cz', '737377447', '737377447', 'Balbínova 23a', 'Praha 2', '120 00', NULL, 50, '50.07910500', '14.43537200', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Bohaté zkušenosti', 'Zkušenosti v gastronomii máme více než 20 let. Nemáme rádi přežité postupy, proto jdeme složitější cestou a ladíme pro Vás nové chutě.', '2017-04-17 07:46:30', '2017-04-25 14:25:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1500.00', '19.00', 5, b'1'),
(430, 495, 126, 126, 537, NULL, NULL, 9, 'Bistro Famagusta', 'CZE', 'info@famagusta.cz', 'www.famagusta.cz', '222543860', '775402607', 'Vyšehradská 53', 'Praha 2', '128 00', NULL, 50, '50.07334840', '14.41826550', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Rychlé a kvalitní občerstvení, Příznivé ceny', 'Koncept Famagusty - freshfoodu, rychlého a kvalitního občerstvení za příznivé ceny, se zrodil v hlavě Jakuba Hnidáka již v roce 2010. Od nutkavé myšlenky k realizaci nebylo tak daleko, a tak na podzim téhož roku opustil teplé místečko marketingového managera a pustil se do vlastního podnikání.\nJít do všeho po hlavě pro něj nebylo nic nového, jako sportovec tělem i duší ví, že když člověk něco opravdu chce, musí si za tím jít a nehledět na překážky. Asi není žádným tajemstvím, že v roce 2010, tak trochu předběhl svou dobu. Trh nebyl na koncept zdravého fastfoodu připravený a Jakub se potýkal s nejednou potíží a komplikací. Naštěstí na to nebyl sám, za tu dobu se z něj stal manžel a také otec a z Famagusty se stal tak trochu rodinný podnik.\nKdyž ti něco nejde, vrať se na začátek a zkus to znovu. Všechno má svůj čas a vývoj a tak po pěti letech fungování, na podzim roku 2015 zažívá Famagusta svůj velký refresh. Nejsme dalším bistrem v řadě, nejsme pouze kavárna, jsme freshfood se svou historií, který vypráví příběh čerstvého a svěžího jídla z kvalitních surovin. Pro všechny, kterým záleží na tom, co jí.', '2017-04-17 07:48:53', '2017-04-25 14:22:11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1700.00', '17.00', 7, b'1'),
(431, 496, 126, 126, 537, NULL, NULL, 9, 'Bistro Herbivore', 'CZE', 'info@herbivore.cz', 'www.herbivore.cz', '606085425', '606085425', 'Rašínovo nábřeží 34', 'Praha 2', '128 00', NULL, 50, '50.06852680', '14.41506960', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Zdravá výživa', 'Prvotní myšlenkou bylo čistě otevření obchodu se zdravou výživou a neživočišnými produkty. To nám, tady na Výtoni, dost chybělo. Pak jsme si ale uvědomili, že chceme jíst zdravě, bez živočišných produktů, pokud možno zajímavě a rozličně a ještě ke všemu chutně :-) A i když jsme našli různé možnosti zdravého a vegetariánsko/veganského stravování, stále nám chyběl výběr většího množství zeleninových jídel na různé způsoby, které navíc opravdu chutnají...A tak k plánovanému obchodu s veganskými produkty vznikl i nápad salátového baru/bistra. \n​\nNáš obchod pro nás není jen zaměstnáním, máme ho opravdu rádi a práce nás naplňuje. Vždy se na Vás upřímně těšíme!', '2017-04-17 07:51:20', '2017-04-25 14:18:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1200.00', '15.00', 5, b'1'),
(432, 497, 126, 126, 537, NULL, NULL, 4, 'Pizza Roma', 'CZE', 'mail@romauno.cz', 'www.romauno.cz', '222714154', '606908742', 'Jagellonská 16', 'Praha 3', '130 00', NULL, 50, '50.07952730', '14.45391690', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Jedinečný gastronomický zážitek', 'Návštěva Pizzerie Roma Uno je jedinečným gastronomickým zážitkem. Každý pokrm je snoubení čerstvých a originálních italských surovin s tradiční rodinnou recepturou.  \n \nJídelní lístek obsahuje 39 druhů kvalitní italské pizzy, připravované v klasické, dřevem vytápěné peci. Každý den Vám také nabízíme polední menu od 11:00 do 15:00.\nPochutnat si na vynikající pizze a výborných jídlech můžete od 10:00 do 07:00. V těchto hodinách Vám rozvoz přiveze jídlo domů nebo do práce.\n  \n    Kromě pizzy a steaků, ochutnejte pravou Itálii v podobě místních specialit, salátů, těstovin a pokrmů z kuřecího masa a ryb. K posezení u výborné kávy nabízíme široký výběr dezertů dle aktuální nabídky. \n​\n     Na milovníky vín čeká široký sortiment světových a moravských vín z naší vinotéky. Bohatý nápojový lístek obsahuje i míchané nápoje, točené pivo a široký výběr z alkoholických i nealkoholických nápojů. \n​\n     Abychom podpořili Váš jedinečný prožitek z návštěvy Pizzerie Roma Uno jsou pro Vás připraveny oddělené prostory pro nekuřáky. \n​\n     Naše pizzerie je otevřená NON-STOP a je nám potěšením být s Vámi již 20 let každý den.', '2017-04-17 07:59:15', '2017-04-25 14:13:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1300.00', '14.00', 9, b'1'),
(433, 498, 126, 126, 537, NULL, NULL, 9, 'Bistro Saltn´n´ Pepa', 'CZE', 'zuzanajajcajova@gmail.com', 'https://www.facebook.com/SaltnPepa-Kitchen-Shop-1078195022240997/timeline', '605432104', '605432104', 'Rumunská 16', 'Praha 2', '120 00', NULL, 50, '50.07383250', '14.43211470', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Burgery', 'Salt''n''Pepa Foodtruck se změnil v bistro, kde si můžete pochutnat nejen na burgerech rozličných chutí a masových či bezmasých variací.', '2017-04-17 08:02:42', '2017-04-25 14:09:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1200.00', '12.00', 10, b'1'),
(434, 499, 126, 126, 537, NULL, NULL, 9, 'Bistro WingHaus', 'CZE', 'eat@winghaus.cz', 'www.winghaus.cz', '725955195', '725955195', 'Vinohradská 1215/32', 'Praha 2', '120 00', NULL, 50, '50.07755200', '14.43803000', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Křupavá kuřecí křidýlka', 'Bistro specializující se na křupavá kuřecí křidýlka (k dispozici ve třech variantách). Plus pečené brambory, dipy a pivo z malých pivovarů.', '2017-04-17 08:05:21', '2017-04-25 14:05:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1400.00', '11.00', 10, b'1'),
(435, 500, 126, 126, NULL, NULL, NULL, 3, 'Bistro Zahrada', 'CZE', 'info@bistrozahrada.cz', 'www.bistrozahrada.cz', '222518689', '734266315', 'Belgická 33', 'Praha 2', '120 00', NULL, 50, '50.07399200', '14.43546070', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Vlastní jídlo a zákusky, Bio obchod', 'Motto: "Vytváříme pohodu, kterou naši hosté šíří do celého světa."\nBistro Zahrada (předtím Bio Zahrada) spojuje lásku k dobrému jídlu a pití s přátelskou atmosférou a kouzelnou zahradou ve vnitrobloku. Najíte se u nás od snídaně, přes oběd až po skvělou večeři. Jsme bistro s vlastním jídlem a zákusky, ale i bio obchod, catering a e-shop... Naše práce je pro nás potěšením a ta radost se přenáší i na naše hosty. Přijďte nás ochutnat.', '2017-04-17 08:07:18', '2017-04-25 10:40:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1100.00', '11.00', 8, b'1'),
