(439, 504, 126, 126, NULL, NULL, NULL, 9, 'By The Way Bistro', 'CZE', 'info@btwbistro.cz', 'www.btwbistro.cz', '725849484', '725849484', 'Rašínovo nábř. 382/60', 'Praha 2', '120 00', NULL, 50, '50.07145000', '14.41441580', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Stylové italsko-francouzské bistro', 'Stylové italsko-francouzské bistro. Těšit se můžete na pokrmy z čerstvých sezónních surovin a domácí produkty.', '2017-04-17 08:33:08', '2017-04-25 10:21:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1200.00', '19.00', 6, b'1'),
(440, 505, 126, 126, 537, NULL, NULL, 1, 'Burgercafe Oldstar', 'CZE', 'info@oldstarcafe.cz', 'www.burgercafe.cz', '775447820', '775447820', 'Sarajevská 25', 'Praha 2', '128 00', NULL, 50, '50.06737885', '14.43502286', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Burgery', 'Jeden z nejznámějších myslitelů své doby řekl, "klidné prostředí je to, co tvoří naší pozitivní mysl pro budoucí klidná rozhodnutí". Ve své podstatě tím řekl, podle nás, otevři kavárnu a na světě bude jen mír a klid.\nVěříme, že pro Vás dokážeme připravit nejlepší burger v Praze. A pokud nevěříte těmto slovům, tak neváhejte a přijďte se přesvědčit.;-)', '2017-04-17 09:01:41', '2017-04-25 18:43:12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*34A1EC02BBD108CB7606FC14A949525706446DBB', 1, 1, NULL, NULL, '180.00', '1700.00', '11.00', 9, b'1'),
(441, 506, 126, 126, 537, NULL, NULL, 3, 'Cafe bar Elysium', 'CZE', 'cafebarelysium@gmail.cz', 'www.cafebarelysium.cz', '773689874', '773689874', 'Na bojišti 8', 'Praha 2', '120 00', NULL, 50, '50.07322460', '14.42783010', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Odpočinek od celodenního shonu', 'Cafe bar Elysium je přizpůsoben všem, kteří mají rádi dobré pití, chuťovky a rádi si odpočinou během celodenního shonu.\nOdpoledne vás přivítá kavárna s dobrou kávou, dortíky a dalšími lákadly, večer bar s nabídkou drinků a studenou kuchyní. Kávu máme samozřejmě i večer a drinky i odpoledne.\nCafé bar Elysium disponuje oddělenými prostorami pro kuřáky a nekuřáky. Každé úterý je celý podnik vyhlášen nekuřáckým.\nKromě setkání s přáteli nabízíme též možnost posezení nad nejrůznějšími deskovými hrami, jež jsou u nás k zapůjčení.\nPokud jste milovníci dobrého pití, rádi Vás přivítáme.', '2017-04-17 09:05:57', '2017-04-25 10:13:14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1700.00', '14.00', 14, b'1'),
(442, 507, 126, 126, 537, NULL, NULL, 2, 'Cafe bar Jakara', 'CZE', 'info@jakara.cz', 'www.jakara.cz', '605177755', '605177755', 'U Kanálky 4', 'Praha 2', '120 00', NULL, 50, '50.07746060', '14.44633800', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Bohatá nabídka nápojů', 'JAKARA Vinohrady vznikla jako propojení café-baru a čajovny zároveň. Z bohaté nabídky si každý jistě vybere to své – čaj, kávu, alko i nealko, míchané nápoje nebo třeba dobré čepované pivo. Samozřejmě nemůže chybět vodní dýmka. Prostory se skládají ze čtyř místností. První velká je vyhrazená nejen pro kouření vodních dýmek, nýbrž si zde můžete zapálit i cigaretu. Dvě další spíše čajmenské místností jsou vyhrazeny ke kouření jen vodních dýmek a jsou zde vyvýšené podesty, kde si můžete pohodlně sednout či lehnout do polštářů nebo se uvelebit do ratanových křesílek. Poslední místnost salónek pojme cca 12-15 lidí a je vyhrazen k běžnému sezení nebo pořádání uzavřených oslav a večírků. V této místnosti si můžete dát vodní dýmku, cigaretu však ponechte v krabičce (nezapálenou) :-)\nPřejeme Vám příjemné posezení u nás.', '2017-04-17 09:09:10', '2017-04-25 09:50:31', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1900.00', '17.00', 14, b'1'),
(443, 508, 126, 126, 537, NULL, NULL, 2, 'Cafe Bar Andromeda', 'CZE', 'petr.bruna@volny.cz', 'http://www.mistokdesikazdyprijdenasve.cz/', '773666952', '773666952', 'Podskalská 408/6', 'Praha 2', '128 00', NULL, 50, '50.06882940', '14.41588630', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Široká nabídka pivních speciálů', 'Nabízíme vám široký sortiment alkoholických i nealkoholických nápojů. \nNaší doménou je široká nabídka pivních speciálů. Osvědčené druhy piva míváme pravidelně, a nové čepujeme každý týden. Můžete si u nás také dát míchané nápoje, ať s alkoholem či bez. Upečeme Vám italskou pizzu nebo připravíme nakládaný hermelín, tousty či jiné drobné pochutiny. \nS přáteli si v našem suterénu můžete zahrát stolní fotbálek, posedět v klidu nebo si pustit písničku z jukeboxu, který obsahuje pestrou škálu interpretů. \n\nNabízíme Vám několik osvědčených i nevšedních příchutí vodních dýmek. Na nabídku se můžete zeptat obsluhy, ráda vám doporučí příchuť tabáku, a dýmku připraví.', '2017-04-17 09:18:07', '2017-04-25 09:37:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '11.00', 5, b'1'),
(444, 509, 126, 126, 537, NULL, NULL, 3, 'Restaurace Cafeterapie', 'CZE', 'info@cafeterapie.cz', 'www.cafeterapie.cz', '224916098', '775402607', 'Na Hrobci 3', 'Praha 2', '12800', NULL, 50, '50.06836800', '14.41545230', NULL, NULL, NULL, '', NULL, '115-2579350227', '0100', 'Příjemné posezení pár kroků od nábřeží Vltavy', 'Hledáte příjemné posezení pár kroků od nábřeží Vltavy? Rádi si po krmení labutí dáte zaslouženou kávu, Čaj a něco na zub? \n\nNebo si jen chcete zajít na oběd do příjemného nekuřáckého prostředí? Pak jste u nás správně! \n\nNabízíme pestrou paletu studených i teplých nejen vegetariánských specialit inspirovaných řeckou a italskou kuchyní osvěženou denním poledním menu a domácími deserty, inspirativní nabídku vín a v neposlední řadě skvělé kávové speciality. \n\nZastavte se za námi v CAFETERAPII na svou denní dávku pohody !', '2017-04-17 09:21:00', '2017-04-25 09:33:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1100.00', '10.00', 14, b'1'),
(445, 510, 126, 126, 537, NULL, NULL, 3, 'Restaurace Koubkova', 'CZE', 'controloflife@gmail.com', 'neni', '776445050', '776445050', 'Koubkova 685/16', 'Praha 2', '120 00', NULL, 50, '50.07197360', '14.43315450', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', 'Venkovní posezení', 'Provozujeme kavárnu s nabídkou různých druhů kávy a jiných nealkoholických nápojů s možností venkovního posezení.', '2017-04-17 09:26:42', '2017-04-25 09:29:24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1500.00', '18.00', 9, b'1'),
(446, 511, 126, 126, 537, NULL, NULL, 3, 'Celebrity Cafe', 'CZE', 'celebritycafe@celebritycafe.cz', 'www.celebritycafe.cz', '222511343', '775402607', 'Vinohradská ulice 40', 'Praha 2', '120 00', NULL, 50, '50.07714500', '14.44005800', NULL, 'CELEBRITY CAFE s.r.o.', 'Vinohradská 1789/40, Praha 2 - Vinohrady', '28869753', 'CZ28869753', '115-2579350227', '0100', 'Rozmanitá nabídka', 'Celebrity Café je stále zářící hvězdou mezi kavárnami na pražských Vinohradech.\nSvé příznivce si získává řadu let především díky rozmanité nabídce, která uspokojí každého hosta, osobitému interiéru, výjimečné poloze a v neposlední řadě přátelskému a vždy usměvavému personálu.\nZakládáme si na spokojenosti každého z vás, což z nás činí místo, na které se budete vždy rádi vracet.', '2017-04-17 09:34:15', '2017-04-25 09:25:04', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1300.00', '15.00', 9, b'1'),
