(595, 666, 628, 628, 538, NULL, NULL, 1, 'Ranč Milovice', 'CZE', 'ranc.milovice@gmail.com', 'www.rancmilovice.cz', '602604121', '602604121', 'Milovice 74', 'Soběsuky', '76802', NULL, 31, '49.22446510', '17.35532590', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'ranč, penzion, konírna, nekuřácká restaurace, zastřešená terasa', 'Součástí ranče Milovice je stylová nekuřácká restaurace s kapacitou 40 míst a zastřešenou terasou. Restaurace je uzpůsobena k pořádání firemních akcí,soukromých večírků, narozenin či svateb.V restauraci nabízíme široký výběr alko i nealko nápojů, exkluzivní kávu značky Manuel café.', '2017-04-26 06:21:36', '2017-04-27 08:09:24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'call kdykoli,slečna oznámí reg.majiteli', NULL, '160.00', '1900.00', '17.00', 13, b'1'),
(596, 667, 628, 628, 538, NULL, NULL, 1, 'Restaurace Cukrovar', 'CZE', 'info@restauracecukrovar.cz', 'www.restauracecukrovar.cz', '773744392', '773 744 392', 'Palackého 162', 'Holešov - Všetuly', '76901', NULL, 30, '49.32457340', '17.54450480', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'tradiční česká jídla, steaky Qualivo, zahrádka, dětský koutek, nekuřácká restaurace', 'Srdečně Vás zveme do příjemného a moderního prostředí restaurace Cukrovar. Přijďte k nám posedět s rodinou, přáteli nebo jen tak na pivo. V naší restauraci si můžete vychutnat tradiční česká jídla, ale i steaky z prémiové značky QUALIVO a to jak vepřové tak hovězí. Naším cílem je nabídnout Vám, našim hostům, příjemné posezení v útulném prostředí. Není pro nás nic důležitějšího, než Vaše spokojenost a že se k nám s potěšením rádi budete vracet i se svými přáteli.\n\nRestaurace Cukrovar Vám nabízí příjemnou atmosféru v moderním prostředí s celkovou kapacitou 87 osob. Restaurace se nachází v areálu bývalého všetulského cukrovaru - odtud pochází její název. Naši hosté mají k výběru posezení v samotné nekuřácké restauraci, v pivnici, v užším kruhu je pak k dispozici salónek a nebo si můžete jen tak vychutnat pivo na baru. V letních měsících pro Vás bude připravena venkovní zahrádka, jejíž součástí je, stejně jako u restaurace, dětský koutek. Mezi naše služby patří možnost zajištění závodního stravování v našich prostorách, pořádání rodinných i společenských oslav, večírků, rautů, firemních seminářů a školení. V případě velké oslavy jsme připraveni restauraci uzavřít pouze pro Vaši společnost.\n\nNekuřácká restaurace\nPro nekuřáky nebo rodiče s dětmi je vyhrazena celá hlavní část restaurace Cukrovar s kapacitou 45 osob.\n\nPivnice\nKuřácká část restaurace pro 30 osob. Zde si můžete vychutnat točené pivo značky Bernard.\n\nSalónek\nSalonek nabízí klidné posezení v kruhu přátel nebo obchodních partnerů. Přijďte k nám uspořádat své rodinné oslavy, svatby, promoce, narozeninové párty, firemní akce, obchodní jednání, rauty apod. Kapacita salónku je až 17 osob.\n \nLetní zahrádka\nV letním období je pro Vás připravena venkovní zahrádka se samostatným výčepem a specialitami přímo z grilu. Součástí zahrádky je i dětský koutek. To vše je doplněno zmrzlinou a mraženými pochoutkami dle vlastního výběru. Kapacita zahrádky je 70 osob.', '2017-04-26 06:52:22', '2017-04-27 08:15:22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1900.00', '13.00', 11, b'1'),
(597, 668, 628, 628, 538, NULL, NULL, 1, 'Restaurace U Cebrka', 'CZE', 'ucebrka@seznam.cz', 'www.ucebrka.funsite.cz', '723091778', '723 091 778', 'Rataje 37', 'Rataje', '76812', NULL, 30, '49.27062756', '17.33680044', NULL, '0', '0', '46999221', '0', '115-2579350227', '0100', 'nekuřácká restaurace, zahrádka, gril, točená zmrzlina', 'Vítáme Vás na stránkách Restaurace U Cebrka. Děkujeme za Vaši návštěvu a věříme, že zde najdete informace, které hledáte.\n\nPřipravili jsme pro Vás příjemné posezení v nekuřácké restauraci, k dispozici je i venkovní zastřešené posezení na zahrádce. Máme pro Vás připraven i gril, ohniště na opékání špekáčků, výbornou kuchyni, stánek rychlého občerstvení i točenou zmrzlinu.\n\nRestaurace U Cebrka se může stát příjemnou zastávkou na Vašich cyklistických toulkách i rodinných výletech.', '2017-04-26 07:05:47', '2017-04-27 14:24:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '110.00', '1700.00', '13.00', 8, b'1'),
