(600, 671, 628, 628, 538, NULL, NULL, 1, 'Restaurace U Nemocnice', 'CZE', 'pepin-kromeriz-o@seznam.cz', 'www.restauraceunemocnicekm.cz', '731806433', '607 40 50 40', 'Havlíčkova 593/63', 'Kroměříž', '76701', NULL, 30, '49.29409230', '17.38232630', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace a penzion, polední menu, příznivé ceny', 'Je jen málo míst, kde se člověk cítí opravdu uvolněně a dobře, naše restaurace k nim bezesporu patří, jak svým prostředím, tak kvalitou a profesionalitou celého personálu.\nRestaurace U nemocnice se nachází na okraji Kroměříže, a ačkoliv je u cesty, je kousek od Květné zahrady.\nDostanete se k nám jak autobusem, pěšky, tak autem, které můžete zaparkovat na parkovišti u nemocnice kde je dostatek parkovacích míst.\nNavíc v době poledního menu, vám při konzumaci jídla, bude proplacen parkovací lístek.\nJídelní prostory jsou denně po dobu obědů do 14:00 hodin nekuřácké.\nKaždý den nabízíme výběr z poledního menu ve velice příznivých cenách.\nJste natolik vytížení, že nemáte čas přijít, nevadí, mi vám oběd dovezeme.', '2017-04-26 07:46:49', '2017-04-27 14:47:50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'email majiteli,je to pizzerie', NULL, '130.00', '1600.00', '13.00', 10, b'1'),
