(618, 690, 628, 628, 538, NULL, NULL, 1, 'Restaurace Centrál', 'CZE', 'restaurace.central@centrum.cz', 'www.restaurace-central-km.cz', '731525442', '731525442', 'Velké náměstí 37/19', 'Kroměříž', '76701', NULL, 30, '49.29900430', '17.39252190', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'salonek, kavárna, hudba', 'Restaurace CENTRÁL nabízí pro své návštěvníky velmi příjemné posezení v prostorách restaurace s počtem 52 míst, jídelně, která pojme 44 návštěvníků a salonku, kde je možno obsloužit 44 hostů. Zejména v reprezentativních prostorách jídelny a salonku je možné pořádat různé setkání, svatby, stravování zájezdů apod. Všechny tyto prostory se nacházejí v přízemí restaurace. V prvním poschodí je pro návštěvníky k dispozici útulné prostředí kavárny s možností taneční a poslechové hudby ve večerních hodinách. Hosté však i v odpoledních hodinách ocení překrásný výhled na kroměřížské Velké náměstí.', '2017-04-28 10:35:14', '2017-04-28 11:45:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1300.00', '16.00', 5, b'1');
