(619, 691, 628, 628, 538, NULL, NULL, 1, 'Restaurace Hvězdička', 'CZE', 'restaurace.hvezdicka@seznam.cz', 'www.restauracehvezdicka.cz', '775143956', '775143956', 'Stavbařů 317', 'Vážany', '76701', NULL, 30, '49.28249010', '17.38611370', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'kuřácká, nekuřácká, tři druhy denního menu, nekuřácké salonky', 'V restauraci je 50 míst k sezení kde můžete příjemně strávit čas posezením u krbu. Restaurace je rozdělena na nekuřáckou a kuřáckou.Ve všední dny podáváme od 11 do 14 hod. tři druhy denního menu. V jídelním lístku máme velký výběr teplých i studených pokrmů, kuřecích a vepřových specialit, hovězí steaky, ryby, těstoviny, bezmasá jídla a zeleninové saláty. Vždy vaříme z čerstvých a kvalitních surovin. Vaříme každý den do 21.00 hod. V nabídce máme vína z oblasti Lechovice.\n\nSoučástí restaurace jsou dva nekuřácké salonky - jeden s kapacitou 60 osob a druhý  pro 45 osob. Ve zmíněných saloncích je možnost pořádat :  svatební a smuteční hostiny, firemní školení, reklamní akce, stužkovací večírky, obchodní jednání a další.', '2017-04-28 10:37:23', '2017-04-28 11:54:07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1700.00', '17.00', 9, b'1'),
(620, 692, 628, 628, 538, NULL, NULL, 1, 'Restaurace Kanada', 'CZE', 'restauracekanada@centrum.cz', 'www.restauracekanada.cz', '573396362', '734 314 025', 'Zlínská 1416', 'Holešov', '76901', NULL, 30, '49.32710060', '17.58626070', NULL, 'ANNFI Company a.s.', 'náměstí 14. října 1307/2 150 00  Praha 5 - Smíchov', '24853194', 'CZ 24853194', '115-2579350227', '0100', 'kuřáci, nekuřáci, letní terasa, speciality, 6 druhů točených piv, rozvoz', 'Restaurace Kanada v Holešově má pevně oddělené prostory pro kuřáky a nekuřáky. V kuřácké části je 80 míst a v nekuřácké 50 až 65 míst. Tuto kapacitu doplňuje letní terasa s 50 až 60 místy k sezení v pohodlných křesílkách. V nekuřácké části zabezpečujeme uzavřené akce např. různé oslavy, svatby, abiturientská setkání atd. a přitom pro ostatní stálé i náhodné návštěvníky zůstává restaurace v běžném provozu.\n\nNabízíme rozsáhlou škálu specialit, minutek, těstovin, ryb, salátů apod. vyrábíme 32 druhů různých pizz a ve všední dny vaříme menu za velmi přijatelné ceny. To vše doplňuje 6 druhů točených piv z koncernu Plzeňského Prazdroje včetně nealkoholického Birellu, čepované kofoly , různých nealkoholických nápojů , destilátů, likérů, archivních vín atd.\n\nCelý sortiment jídel a pizz rozvážíme po Holešově , ale i do okolních vesnic i blízkých měst / Hulín /.', '2017-04-28 10:42:27', '2017-04-28 11:58:46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'chce jen tu základní prezentaci, volat kdykoli', NULL, '190.00', '1400.00', '12.00', 12, b'1'),
(621, 693, 628, 628, 538, NULL, NULL, 1, 'Restaurace Koruna', 'CZE', 'koruna.krom@volny.cz', 'www.gastro-booking.com/#/app/restaurant/621', '606172640', '775402607', 'Kojetínská 1444', 'Kroměříž', '76701', NULL, 30, '49.30220380', '17.38468200', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'zahrádka, internet', 'Provoz restaurace s kapacitou 40 míst. Nabízí zde teplé pokrmy a hotová jídla. K dispozici je bezdrátové připojení k internetu. Možnost posezení na zahrádce.', '2017-04-28 10:45:01', '2017-04-28 12:06:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'nemají webovky', NULL, '130.00', '1200.00', '13.00', 12, b'1'),
(622, 694, 628, 628, 538, NULL, NULL, 7, 'Moravská jídelna', 'CZE', 'dispo.km@seznam.cz', 'www.moravskajidelna.cz', '775177415', '775177415', 'Velké náměstí 111/59', 'Kroměříž', '76701', NULL, 30, '49.29809450', '17.39378120', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'rozvoz, catering', 'Rozvážíme obědy po celé Kroměříži. Firmám nabízíme rozvoz obědů do jejich provozoven. Získejte u nás firemní přihlašovací údaje a objednávejte jídlo pro všechny Vaše zaměstnance.  Zařídíme jídlo pro Vaši akci. Dáváme Vám možnost uspořádat ji i v našich prostorách.', '2017-04-28 10:46:43', '2017-04-28 12:13:16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1800.00', '11.00', 8, b'1'),
(623, 695, 628, 628, NULL, NULL, NULL, 1, 'Restaurace  R-Club', 'CZE', 'rclub@rclub.cz', 'www.rclub.cz', '736760659', '736 760 659', 'Krátká 435', 'Holešov', '76901', NULL, 30, '49.32397430', '17.54438580', NULL, 'JAVERA group s.r.o.', 'Kubelíkova 1224/42 130 00, Praha 3 - Žižkov', '026 94 590', '0', '115-2579350227', '0100', 'catering, moderní restaurace, zahrádka', 'R-CLUB Holešov provozovaný společností JAVERA GROUP s.r.o. je nejen restaurace a diskotéka. Jsme také cateringová společnost, která pro Vás udělá akci na klíč - rauty, svatby, párty atd. Zajistíme jídlo, stany, hudbu a vše, co si budete přát.\nPro vaši akci je k dispozici příjemná a moderně laděná restaurace. Uspořádání stolů připravíme dle vašich potřeb a vizí.\nPřed podnikem se nachází rozlehlá zahrádka s dostatečným množstvím stolů a židlí, grilem a udírnou. Ideální pro letní oslavu pod širým nebem.', '2017-04-28 10:50:59', '2017-04-28 14:16:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'zaslat info o rozšíř.,nabízí catering', NULL, '120.00', '1900.00', '12.00', 10, b'1'),
(624, 696, 628, 628, 538, NULL, NULL, 1, 'Restaurace Sportareál Kvasice', 'CZE', 'karel.kunovsky@seznam.cz', 'www.sportarealkvasice.tode.cz', '605703376', '605703376', 'Tlumačovská 681', 'Kvasice', '76821', NULL, 30, '49.24798490', '17.47342250', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace, ubytování', 'Restaurace ve Sportareálu Kvasice.', '2017-04-28 10:52:50', '2017-04-29 04:33:57', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1800.00', '12.00', 11, b'1'),
(625, 697, 628, 628, 538, NULL, NULL, 5, 'Pivnice u Lva', 'CZE', 'pivnice-ulva@seznam.cz', 'www.u-lva.net', '608730085', '608 730 085', 'Velehradská 4248/24a', 'Kroměříž', '76701', NULL, 30, '49.29003690', '17.39060260', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'deset druhů piva na čepu, speciály, venkovní posezení', 'Jsme pivnice s deseti druhy piva na čepu, hlavně nefiltrovaná, nepasterizovaná z menších pivovarů.Pravidelně nabízíme nějaký speciál jako, kvasnicové, IPA, ALE, pšeničné.Pro ty, kteří pivu tolik neholdují máme v nabídce kvalitní vína ze znojemské oblasti vinných sklepů Lechovice.', '2017-04-28 10:54:51', '2017-04-29 04:37:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'možná jiný název restaurace,nezeptala jsem se', NULL, '160.00', '1000.00', '12.00', 8, b'1'),
(626, 698, 628, 628, 538, NULL, NULL, 1, 'Restaurace V Podzámčí', 'CZE', 'majir.sro@seznam.cz', 'www.restauracevpodzamci.cz', '571892209', '776867789', 'Masarykova 65', 'Holešov', '76901', NULL, 30, '49.33182860', '17.58066870', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'zahrádka, kuřáci i nekuřáci, Wifi, 3 polední menu, pizza z unikátního těsta', 'Najdete zde prostorami oddělenou část pro kuřáky i nekuřáky a klidné posezení na zahrádce. Možnost konání firemních akcí , večírků , oslav a svateb. Ve všech prostorách restaurace, včetně zahrádky, možnost připojení WIFI.\nNabízíme Vám nejen denní výběr ze tří poledních menu, ale i bohatou nabídku minutkových jídel z české, moravské i světové kuchyně.', '2017-04-28 10:56:31', '2017-04-29 04:40:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1100.00', '17.00', 14, b'1'),
(627, 699, 628, 628, NULL, NULL, NULL, 1, 'Restaurace Zlobice', 'CZE', 'recepce@penzionzlobice.cz', 'www.penzionzlobice.cz', '724794224', '724794224', 'Zlobice 45', 'Zlobice', '76831', NULL, 30, '49.30178652', '17.31268405', NULL, 'Goneza, s.r.o.', 'Zlobice 45, 76831 Zlobice', '25341243', 'CZ25341243', '115-2579350227', '0100', 'salonek, společenský sál, bowling', 'Restaurace  je umístěná v nádherném prostředí stejnojmenného penzionu v centru vesnice Zlobice ležící 5km od města Kroměříže, nazývaného "Hanáckými Athénami", které se nachází v geografickém i historickém středu Moravy.\nNynější majitel provedl v letech 2009 - 2011 kompletní moderní rekonstrukci celé budovy a jejího okolí. \nRestaurace disponuje nově rekonstruovaným salonkem s 30 místy, s celodenním provozem, ve kterém může zákazník posnídat,  poobědvat či povečeřet. Tento salonek je k dispozici také pro pořádání různých akcí – svateb, oslav, rautů, pracovních setkání, schůzí, školení atd. V přízemí budovy se nachází veliký společenský sál pro 150 osob s všestranným využitím – např. pro koncerty, firemní akce a školení, předváděcí akce, divadla, plesy, karnevaly, dětská odpoledne, promítání filmů, večírky, taneční zábavy, diskotéky apod. V tomto sále vám můžeme uspořádat svatební či jinou hostinu, setkání absolventů a různé oslavy. Personál restaurace pro vás na objednávku zařídí grilování či domácí zabijačku, zajistí hudbu apod.\nNaši restauraci Vám nabízíme jako místo pro uspořádání Vaší svatby – pořádání svatebních hostin. Připravíme pro Vás svatební hostinu podle Vaší představy – ať už se jedná o svatební oslavu finančně úspornou, stejně tak můžeme připravit i hostinu pro ty nejnáročnější klienty. Připravíme pro Vás libovolný raut i jiné gastronomické zážitky. Vyberete si u nás z vícero  druhů pokrmů.  Naše kuchyň používá k přípravě pokrmů jen kvalitní suroviny z místních zdrojů. Samozřejmostí je kvalifikovaný personál a zkušený šéfkuchař.', '2017-04-28 10:58:03', '2017-04-29 04:51:25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, 'domluveno s provozní', NULL, '170.00', '1700.00', '15.00', 9, b'1'),
(628, 700, NULL, NULL, NULL, NULL, NULL, 1, 'Zlomený pes', 'CZE', 'matyldaval@seznam.cz', 'www.jpol.cz', '774372781', '+420774372781', 'jížní 69', 'Antarktida', '69696', 'Unnamed Road, Fortín Sgto Cabral, Antarktida', NULL, '-63.39523659', '-57.01352767', NULL, 'led pro eskymaky a.s.', 'polní 6969', '666', '6666969', '696966669', '0696', 'Pivo, teplé a studene pokrmy, zima', 'Sauna, bazen, masáže, ledová zahrádka', '2017-04-30 10:08:23', '2017-04-30 10:14:42', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*2FDDC627F4A12FCAEF960F191B2D75EC974E5742', 1, 1, NULL, '0.3.3', '150.00', '1300.00', '13.00', 11, b'1'),
(629, 702, 701, 701, 538, NULL, NULL, 1, 'Na kopečku', 'CZE', 'lukackova@centrum.cz', 'www.nakopecku.cz', '777118572', '777118572', 'Velké Karlovice 911', 'Velké Karlovice', '75606', NULL, 8, '49.36898950', '18.35856490', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'penzion, domácí kuchyně, letní a zimní terasa', 'Penzion se nachází v turisticky atraktivním, ale přitom klidném místě Velkých Karlovic. Návštěvníkům této části Valašska penzion nabízí ubytování, stravu ve vyhlášené hospodě s domácí kuchyní, posezení na letní a zimní terase a další služby spojené s ubytováním (úschovna kol a lyží, sauna apod.). V jídelním lístku je možné si vybrat z klasických českých jídel,  ale samozřejmě i valašských specialit. Kapacita oddělených místností je podle uspořádání cca 25 osob.', '2017-05-01 12:25:23', '2017-05-01 12:42:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1500.00', '16.00', 10, b'1'),
(630, 703, 701, 701, 538, NULL, NULL, 1, 'Hostinec staré časy', 'CZE', 'ostrov@hostinec-stare-casy.cz', 'www.hostinec-stare-casy.cz', '516412321', '775402607', 'Ostrov u Macochy č. p. 6', 'Ostrov u Macochy', '679 14', NULL, 3, '49.38228590', '16.76244270', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'salonek, venkovní terasa', 'Hostinec "Staré časy" v městysi Ostrov u Macochy najdete v srdci Moravského krasu, nedaleko jeskyně Balcarka, propast Macocha je vzdálená asi 3 km. Hostinec Staré časy po zásadní rekonstrukci v roce 2013 nabízí velmi milé prostředí hlavního sálu s krbovým kamny, zadní části restaurace, kterou lze využít pro soukromé oslavy nebo stravování turistických skupin, a salonku pro menší oslavy. Celková kapacita hostince je až 110 míst. Venkovní terasa pak vybízí k příjemnému posezení pro cca 40 návštěvníků.', '2017-05-01 12:47:43', '2017-05-02 06:32:43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1600.00', '15.00', 5, b'1'),
(631, 704, 701, NULL, NULL, NULL, NULL, 0, 'U hastrmana', 'CZE', 'milankeprt@seznam.cz', 'wwwuhastrmana.cz', '602841020', NULL, '', '', '', NULL, 3, '0.00000000', '0.00000000', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', NULL, '', '2017-05-01 13:08:55', '2017-05-01 13:08:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'N', 'Kč', NULL, 1, 1, 'nesouhlasí', NULL, '150.00', '1400.00', '14.00', 7, b'1'),
(632, 705, 701, NULL, NULL, NULL, NULL, 0, 'Blue Queen', 'CZE', 'david.mokry@seznam.cz', 'www.facebook.com/Restaurace-Blue-Queen-166482283547850', '731074927', NULL, '', '', '', NULL, 3, '0.00000000', '0.00000000', NULL, NULL, NULL, NULL, NULL, '115-2579350227', '0100', NULL, '', '2017-05-01 13:38:38', '2017-05-01 13:38:38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'N', 'Kč', NULL, 1, 1, 'nesouhlasí', NULL, '180.00', '1200.00', '10.00', 6, b'1'),
(633, 706, 701, 701, 538, NULL, NULL, 1, 'Restaurace Myslivna', 'CZE', 'lubossekanina@seznam.cz', 'www.facebook.com/Myslivna', '774915910', '723621976', 'Horní Palava 101/40', 'Blansko', '67801', NULL, 3, '49.36772400', '16.65912250', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace, menu', 'Co si budeme povídat, přísloví "náš host, náš pán" pomalu uvadá, tedy až na výjimku. Snažíme se pro vás připravit kvalitní zázemí, ať už na vaši pracovní schůzku, rodinnou oslavu nebo romantickou večeři, zkrátka vše, co vám na očích uvidíme. Náš personál se o vás postará, aby jste se cítily, jako v bavlnce a naši kuchaři se budou snažit o váš gastronomický zážitek. Navštivte nás a přesvědčte se sami.', '2017-05-01 14:07:04', '2017-05-02 07:31:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1000.00', '13.00', 10, b'1'),
(634, 707, 701, 701, 538, NULL, NULL, 1, 'Restaurace 29', 'CZE', 'restaurace29@seznam.cz', 'ww.restaurace29.cz', '776060049', '776060049', 'Kpt. Jaroše 100/29', 'Boskovice', '68001', NULL, 3, '49.48774830', '16.66240880', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'sklepní posezení, salonek, bar, steaková restaurace, rauty', 'Příjemné posezení v restauraci29 uvítáte při romantických schůzkách, obchodních večeřích a nebo pokud si chcete jen popovídat s přáteli u sklenice vína či dobře vychlazeného piva. Bohatý výběr jídel uspokojí i ty nejnáročnější labužníky a milovníky dobrého jídla. Prostředí restaurace je situované do sklepní podoby. Příjemné osvětlení umocněné smrkovým obložením jen podporuje příjemnou pohodu ať ji trávíte s kýmkoli. Restaurace má k dispozici 26 míst a 15 míst v salónku. Pokud máte rádi posezení u baru i to je samozřejmě možné. Máte rádi poctivé "flákoty" masa? Pak je pro vás připravena naše steaková restaurace. Propečené, středně propečené, málo propečené, ale vždy šťavnaté. Pořádáme rauty šité každému zákazníku na míru. Prohlédněte si fotografie z pořádaných rautů. V případě potřeby nás pak kontaktujte.', '2017-05-01 14:25:25', '2017-05-02 07:35:03', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1200.00', '18.00', 10, b'1'),
(635, 708, 701, 701, 538, NULL, NULL, 1, 'Restaurace a kavárna pod dubem', 'CZE', 'restauracepoddubem@seznam.cz', 'www.restauracepoddubem.cz', '605255616', '605255616', 'nám. Svobody 7', 'Svitávka', '67932', NULL, 3, '49.50273010', '16.59572420', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace, kavárna, nekuřácké, gril, pizza, wifi', 'VÁŽENÍ HOSTÉ,\n\nrádi vás přivítáme v RESTAURACI A KAVÁRNĚ POD DUBEM, která se nachází nedaleko VELKÉ A MALÉ Löw-Beer vily ve Svitávce.Její NEKUŘÁCKÉ PROSTŘEDÍ vás jistě zaujme svou nabídkou jídelního a nápojového lístku. Restaurace je vhodná na POŘÁDÁNÍ RODINNÝCH OSLAV, PODNIKOVÝCH AKCÍ, SVATEB, SMUTEČNÍCH HOSTIN, ČI ŠKOLNÍCH VEČÍRKŮ.\n\nV letní sezoně je pro Vás otevřeno posezení ve dvoře se specialitami na grilu a pizza pečená ve dřevem vytápěné peci. Pro uživatele internetu, BEZDRÁTOVÉ PŘIPOJENÍ WIFI V CELÉ RESTAURACI ZDARMA.\n\nVěříme, že na chvíle strávené u nás budete dlouho a mile vzpomínat. Na vaši návštěvu se těší celý kolektiv restaurace a kavárny POD DUBEM.', '2017-05-01 14:44:10', '2017-05-02 07:39:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1800.00', '18.00', 10, b'1'),
(636, 709, 701, 701, 538, NULL, NULL, 1, 'Restaurace repete', 'CZE', 'repete-boskovice@email.cz', 'www.repete-boskovice.cz', '723933284', '723933284', 'Havlíčkova 44', 'Boskovice', '68001', NULL, 3, '49.49437320', '16.66306220', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřácké, dětský koutek, tradiční česká kuchyně, sportovní přenosy', 'Vážení hosté,\n\nzavítejte do nové stylové restaurace v Boskovicích, blízko Westernového městečka a s vlastním parkovištěm přímo u hlavní silnice. Zaujme Vás příjemný a nadčasový interiér, nekuřácké prostředí, pohodlné sezení a pro Vaše zlatíčka zařízený dětský koutek.\nPo celé restauraci je pro Vás k dispozici bezplatné WiFi připojení. Restaurace má bezbariérový přístup pro kočárky a invalidy, včetně WC pro invalidy. Pro ty nejmenší  je k dispozici dětská jídelní stolička.\nRestaurace je zaměřena na tradiční českou kuchyni, domácí porce a přijatelné ceny. Vše vaříme z čerstvých surovin bez chemických náhražek. Nabídneme  Vám nabídku denních menu z kvalitních čerstvých surovin, a to vše za bezkonkurenční ceny.\nPodáváme snídaňová menu a zajišťujeme dlouhodobý a pravidelný rozvoz obědů.  Samozřejmostí jsou další vynikající pokrmy z našeho jídelního lístku.\nPořádáme sportovní přenosy či firemní prezentace na velkém plátně s HD projektorem a dvou plazmových TV. Naše prostory jsou Vám také k dispozici pro oslavy, firemní večírky, soukromé akce nebo svatby s kapacitou cca 70 osob.\nVěříme, že u nás budete spokojeni a od Vašeho stolu se bude ozývat výrazné "re-pe-te".\n\nNa Vaši návštěvu se těší  kolektiv restaurace REPETE.', '2017-05-01 15:19:53', '2017-05-02 11:16:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1800.00', '16.00', 13, b'1'),
(637, 710, 701, 701, 538, NULL, NULL, 1, 'Hostinec U kovařiku', 'CZE', 'v.makar@seznam.cz', 'www.gastro-booking.com/#/app/restaurant/637', '775526761', '775526761', 'Sloup 46', 'Sloup v Moravském Krasu', '67913', NULL, 3, '49.41465360', '16.73989830', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'česká kuchyně, společenské akce', 'Restaurace nabízí českou kuchyni a nealkoholické i alkoholické nápoje. V hostinci je možné uspořádání nejrůznějších společenských akcí, jako jsou oslavy narozenin, svatby, promoce, abiturientské srazy, firemní večírky nebo setkání zahrádkářů či jiných zájmových skupin.', '2017-05-02 07:07:58', '2017-05-02 11:27:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '15.00', 12, b'1'),
(638, 711, 701, 701, 538, NULL, NULL, 1, 'U Golema', 'CZE', 'restaurace@ugolema.cz', 'www.ugolema.cz', '608707625', '608707625', 'Svitavská 28', 'Blansko', '678 01', NULL, 3, '49.35470750', '16.64543580', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'pivo, denní menu, letní zahrádka, pivnice', 'Výběr z více jak 100 jídel\nČepujeme Pilsner Urquell, Gambrinus\nRestaurace je klimatizována\nOd pondělí do pátku v době od 10,45 do 13,30 podáváme také denní menu (polévka + hlavní jídlo)\nNa požádání zasíláme "denní menu" e- mailem (restaurace@ugolema.cz)\nMáme vlastní parkoviště\nBezbarierový přístup pro tělesně postižené', '2017-05-02 07:12:35', '2017-05-02 11:40:24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1000.00', '19.00', 10, b'1'),
(639, 712, 701, 701, 538, NULL, NULL, 1, 'Aquapark', 'CZE', 'zby.zboril@centrum.cz', 'www.gastro-booking.com/#/app/restaurant/639', '603502717', '603502717', 'Mlýnská 1828/17', 'Blansko', '67801', NULL, 3, '49.36371820', '16.63868700', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'restaurace', 'Nově otevřená Restaurace Aquapark v Blansku, kterou najdete přímo v areálu Zimního stadionu s výhledem na Aquapark.', '2017-05-02 08:27:56', '2017-05-02 12:46:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '100.00', '1700.00', '13.00', 12, b'1'),
(640, 713, 701, 701, 538, NULL, NULL, 1, 'U Filků', 'CZE', 'martinaff@seznam.cz', 'www.gastro-booking.com/#/app/restaurant/640', '516418829', '775402607', 'Dolní Lhota 70', 'Blansko', '678 01', NULL, 3, '49.38440170', '16.63324740', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'denní menu, zahrádka', 'Podávání denního menu. S možností parkování ve dvoře.  Pořádání soukromých akcí, svateb, plesů. V létě možnost posezení na zahrádce s grilováním.', '2017-05-02 08:46:52', '2017-05-02 12:49:06', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '130.00', '1700.00', '16.00', 14, b'1'),
(641, 714, 701, 701, 538, NULL, NULL, 1, 'restaurace Rudka', 'CZE', 'info@hotelrudka.cz', 'www.hotelrudka.cz', '539083405', '722 947 994', 'Rudka 220', 'Kunštát', '67972', NULL, 3, '49.51704600', '16.51065660', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'ubytování, restaurace, týdenní obědové menu', 'Restaurace s mimořádnou nabídkou, týdenní obědové menu.', '2017-05-02 09:16:37', '2017-05-02 12:52:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '170.00', '1800.00', '11.00', 14, b'1'),
(642, 715, 701, 701, 538, NULL, NULL, 1, 'Restaurace Zlatá růže', 'CZE', 'zlata.ruze@email.cz', 'www.zlata-ruze.cz', '602543040', '602543040', 'Kpt. Jaroše 3', 'Boskovice', '68001', NULL, 3, '49.48907030', '16.65970770', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'nekuřácká, dětský koutek, zahrádka', 'Restaurace Zlatá růže je restaurace rodinného typu. Byla založena roku 1991 panem Ladislavem Kostíkem. V současné době se o provoz starají jeho synové Tomáš a Ladislav. Restaurace je nekuřácká, orientovaná spíše na rodiny s dětmi.\nCelý interiér je motivován vozítkem Velorex, jehož je rodina Kostíků velkým fandou.\nNajdete zde dobové fotografie, fotografie ze srazů, které pořádáme v Boskovicích pravidelně od roku 1997 a také fotografie z expedic. V dětském koutku je skutečný velorex určený pro hru dětí i dospělých.\n\nRestaurace je umístěna v centru města a je u ní velké parkoviště. V provozu je celoročně, sedm dní v týdnu. K restauraci patří i prostorná zahrádka s obsluhou.\nKvalitní kuchyně nabízí v pracovní dny 4-5 druhů menu, obsáhlý stálý jídelní lístek se zajímavými specialitami, dětská jídla a 25 druhů Pizzy.\nKompletní sortiment včetně menu je možné objednat s rozvozem po Boskovicích zdarma.\nMimo Boskovice jezdíme za zajímavé ceny a při větší objednávce také zdarma.\nPersonál restaurace ochotně ohřeje stravu nejmenším návštěvníkům, k dispozici je i dětská židlička.', '2017-05-02 09:27:12', '2017-05-02 12:56:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1500.00', '12.00', 12, b'1'),
(643, 716, 701, 701, 538, NULL, NULL, 1, 'Restaurace Hájovna', 'CZE', 'dusanpadalik@centrum.cz', 'www.hajovna.com', '606339507', '606339507', 'Hájovna 61', 'Dolní Věstonice', '69129', NULL, 7, '48.88627721', '16.63961464', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'pestrá nabídka, gril, zahrada', 'V budově penzionu můžete navštívit naši výbornou restauraci, která nabízí pestrou nabídku z masa, zeleniny, ryb a specialit na grilu.\nV nově zařízené restauraci s kapacitou 45-60 míst je možnost pořádat podnikové večírky, svatby, rodinné oslavy a jiné společenské akce.\nV letní sezóně je možné využít zahradu ke grilování či opékání selete.', '2017-05-02 10:50:11', '2017-05-02 14:49:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '190.00', '1300.00', '11.00', 8, b'1'),
(644, 717, 701, 701, NULL, NULL, NULL, 1, 'Restaurace U hájků', 'CZE', 'hana-hajkova@seznam.cz', 'www.ubytovaniuhajku.cz', '724840900', '724840900', 'Křepice 10', 'Křepice u Hustopečí', '69165', NULL, 7, '48.99964300', '16.71964584', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'penzion, nekuřácký salonek, ručně dělaná pizza, zimní zahrada, tradiční speciality', 'K penzionu patří také restaurace která je hned vedle. Otevřeno máme po celý týden od 11:00 do 22:00 a v pátek a sobotu do 24:00. Restaurace disponuje sto třiceti místy uvnitř, z čehož 45 míst je v salonku, kde se pořádají oslavy, svatby a další akce. Salonek je nekuřácký. Dalších 60 míst najdete v zimní zahradě, kde máte například možnost pořádání oslavy v uzavřené společnosti, v letních měsících se zimní zahrada mění v letní.  Zde se po celé léto  konají taneční večery s živou hudbou.\nKuchyň je klasická česká a několikrát do roka pořádáme tradiční speciality jako například Svatomartinské husy,  Josefovský košt slivovice s domácí zabijačkou, zvěřinové, steakové,  nebo rybí speciality. Téměř celé léto připravujeme maso a ryby na venkovním grilu. Denní menu se skládá z 5 výběrů jídel a sestavujeme nově každým týdnem. Jeho aktuální složení najdete po kliknutí v pravém horním rohu na “Doporučujeme: Menu na tento týden”.\nDobrou chuť a těšíme se na Vaši návštěvu.', '2017-05-02 11:13:15', '2017-05-02 14:58:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1700.00', '11.00', 10, b'1'),
(645, 718, 701, 701, 538, NULL, NULL, 1, 'Aquarium relax', 'CZE', 'restaurace@aquariumrelax.cz', 'www.aquariumrelax.cz', '519324605', '775402607', 'Pavlovská 40', 'Mikulov', '69201', NULL, 7, '48.81033670', '16.64212690', NULL, 'KONDICE s.r.o.', 'Pavlovská 527/40, 692 01 Mikulov', '46960856', 'CZ46960856', '115-2579350227', '0100', 'tři akvária, nekuřácká restaurace, speciality, vína, kavárna, dětský koutek, letní terasa', 'Vítejte v rodinné stylové restauraci Aquariumrelax. Proč Aquarium? Přímo v restauraci se nachází tři obří akvária, která jsou osazena druhy ryb z celého světa (například z afriky, amazonie a jiné).\nNaše restaurace se nachází v Mikulově na Moravě ve městě kultury, vína a tradic. Restaurace je plně nekuřácká. Kapacita je 50 míst, proto je restaurace vhodná i pro společenské akce (svatby, večírky, rauty, atd..) nabízíme široký výběr pokrmů a specialit, denní a obědové menu. K jídlu na objednávku “frťan“ medoviny zdarma. Vaši žízeň jsou zde připraveny uhasit tři druhy točeného piva – Plzeň 12°, Gambrinus 10° a pro řidiče Radegast birell. Příznivci vína jistě ocení široký výběr špičkových vín z Mikulova a blízkého okolí. Restaurace je také vybavena projektorem, signálem wifi (internet) a oddělenými prostory, například pro (školení, prezentaci, živou hudbu a jiné).\nSoučástí restaurace je i kavárna o kapacitě 16 míst. Zde Vám můžeme nabídnout vždy čerstvou kávu, dezerty, míchané nápoje, denní tisk a pro ty nejmenší jsou zde nachystány omalovánky.\nSlunná Morava a kopce Pálavy nabízí rozmanité vyžití, proto i my jsme schopni sloužit. Velká letní terasa o kapacitě 40 míst nabízí příjemné posezení pod slunečníky. Pro cyklisty vítaná úschovna kol. Pro děti malý dětský koutek. Na letní terase se také konají různé akce jakou jsou například (domácí zabíjačky, degustace vína, aj.) Sledujte proto naše stránky s aktuálními informacemi.', '2017-05-02 11:18:04', '2017-05-02 15:04:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '140.00', '1200.00', '11.00', 5, b'1'),
(646, 719, 701, 701, 538, NULL, NULL, 1, 'Keltská středověká krčma', 'CZE', 'avalon.valtice@seznam.cz', 'www.avalonvaltice.com', '721095111', '721095111', 'Příční 46', 'Valtice', '69142', NULL, 7, '48.74103700', '16.75445100', NULL, 'Luděk Vokáč', 'Valtice, U vodojemu 946, PSČ 69142', '757 495 30', 'CZ757 495 30', '115-2579350227', '0100', 'starobylé receptury, čajovna, restaurace, zahrádka', 'Milí hosté,\nvítáme Vás v naší netradiční keltské středověké krčmě Avalon. V prvním patře se nachází čajovna.  Legenda praví, že Avalon je ostrov, na kterém se rozprostírá keltský ráj. Je to místo klidu, kam odešel král Artuš po své smrti.Místo, kde je ukryt Svatý Grál, zdroj veškerého poznání. Je zde dostatek potravy pro tělo i duši, dokonalá harmonie, kde není žádných nemocí ani jiných strastí. Tento dům jehož původ sahá do dávného středověku, o čemž svědčí původní kamenné zdi a středověká studna na zahrádce, nám 5.6.2003 odkryl své tajemství. V místech, kde právě sedíte, jsme při výkopových pracích nalezli velké množství 2 500 let starých keltských střepů, které zde můžete vidět. To nás inspirovalo k tomu, abychom přiblížili naše historické kořeny i Vám, a to stylizací restaurace do tohoto období našich dějin. Keltové patřili k prapůvodním obyvatelům Střední Evropy a položili základy naší duchovní kultury, o kterých se obecně mnoho neví. Avalon je místem, kde se člověk kromě zážitku z lahodné krmě povznese na duši, uvědomí si krásu života, jeho podstatu a smysl.  V naší středověké restauraci  Vám předkládáme jídla šetrná k Vašemu zdraví, s minimálním množstvím tuku, kdy většina z nich je připravovaná z výhradně čerstvých surovin. Solíme mořskou solí, která je známa svými blahodárnými účinky, sladíme přírodním, hnědým, nerafinovaným cukrem nebo medem a používáme další suroviny z oblasti zdravé výživy, jako například jáhly a pohanku. Mnohé z jídel či nápojů pro Vás připravujeme dle originálních starobylých receptur. Ve druhém patře je prostor věnovaný osobnímu růstu, zdraví a sebepoznání. Probíhají zde semináře, kurzy a přednášky zaměřené na léčení, zdravý způsob života, psychologii a filozofii. Poskytuje také možnost setkání se zajímavými lidmi a uměleckými zážitky v podobě výstav a koncertů. Naše čajovna Vám chce umožnit odpoutat se od každodenního shonu a přenést se tak trošku do jiného světa bez starostí a stresu. Je situována do symboliky čtyř živlů – oheň, voda, země a vzduch, jejichž všudypřítomnost nás provází na každém kroku.   Čajovna Vám poskytne možnost relaxace a odpočinku a vzbudí ve Vás schopnost naladit se na svět vnitřního ticha. Uvolněte se, pozvedněte šálek čaje, vdechněte jeho vůni a nechte se unášet…. Nechť Vám posezení u nás přinese chvilku odpočinku a pohody, zároveň s nevšedním gastronomickým zážitkem.  Dobrou chuť a netradiční gastronomický zážitek Vám za celý kolektiv Avalonu přejí\n\nAndrea a Luděk Vokáčovi.', '2017-05-02 11:46:25', '2017-05-02 15:09:32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1000.00', '11.00', 14, b'1'),
(647, 720, 701, 701, 538, NULL, NULL, 1, 'Amande restaurant', 'CZE', 'info@centro.cz', 'www.centro.cz/amande', '774615605', '774615607', 'Husova 8', 'Hustopeče', '693 01', NULL, 7, '48.94154780', '16.73597790', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'francouzská gastronomie', 'Restaurant Amande v sobě spojuje několik unikátních konceptů, které poskytnou vaším smyslům dokonalé zážitky. Obklopeni mandloňovými sady ze 17. století servírujeme vrcholnou gastronomii jižní Moravy s prvky té francouzské. Ne každý ví, že Francouzi zanechali na jižní Moravě nesmazatelnou historickou stopu.', '2017-05-02 12:00:11', '2017-05-03 04:00:36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1100.00', '11.00', 9, b'1'),
(648, 721, 701, 701, 538, NULL, NULL, 1, 'Irish pub Baroko', 'CZE', 'irishpub.baroko@seznam.cz', 'www.irishpub-breclav.cz', '519326426', '775402607', 'Nár. odboje 706/1', 'Břeclav', '690 02', NULL, 7, '48.75542060', '16.88718460', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'irská restaurace, zahrádka, zvěřinové speciality, pivo Podlužan a Břeclavský Kanec', 'Restaurace Irish Pub Baroko si vás dovoluje pozvat do stylové irské restaurace, kde vám nabídneme široký výběr z irské, krajové i tradiční kuchyně a obsáhlou nabídku alkoholických i nealkoholických nápojů. Mimo výše zmíněné nabídku u nás můžete po celý rok  ochutnat speciality ze zvěřiny. Nově můžete u nás ochutnat piva z místního pivovaru Podlužan – Delegát 10°, Podlužan 11° a Břeclavský Kanec 12°. Dále čepujeme Starobrno 11°, Starobrno řezané a Zlatopramen nealkoholický. Z lahvových piv jsou to vedle českých piv i piva Irská a Holandská.', '2017-05-02 12:04:50', '2017-05-03 04:07:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '180.00', '1700.00', '12.00', 6, b'1'),
