(651, 724, 701, 701, 538, NULL, NULL, 1, 'Vinařský dvůr U Mlýnku', 'CZE', 'info@umlynku.cz', 'www.umlynku.cz', '604927138', '604927138', 'Hlavní 555', 'Dolní Dunajovice', '691 85', NULL, 7, '48.85628030', '16.59099660', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'penzion a vinný sklep, vína, moravské speciality, letní terasa', 'Restaurace Vinařského dvora nabízí širokou nabídku místních i tradičních moravských specialit a pestrý výběr bílých i červených vín jak vlastní produkce tak i od dalších předních výrobců Mikulovské vinařské oblasti. Nabídku doplňují různé nealkoholické i alkoholické nápoje, točené pivo Starobrno, kvalitní káva Britt Costarica a v horkých letních dnech též osvěžující koktejly.\n\nKapacita restaurace je 45 míst. K dispozici je i letní terasa pro dalších 30 osob. Pro ubytované klienty je v prostorách restaurace podávána též snídaně formou bufetových stolů (8:00-10:00).\n\nVinný sklep se nachází v těsné blízkosti restaurace a je s ní propojen skrze vinnou banku. Kapacita sklepa je 170 míst a nabízí tak prostor pro větší akce (svatby, firemní večírky, teambuildingové akce). Pro soukromé akce menšího rozsahu je připraven sklepní salonek s kapacitou 20 míst.\n\nSklepní prostory jsou dále využity pro archivaci vína a ležení červených vín v barrique sudech. V těchto prostorách probíhají také řízené degustace včetně ochutnávek přímo ze sudu, to vše za zvuku tradiční živé cimbálové hudby. Již zmíněná banka vín pak slouží k trvalému uložení Vašeho vinného „pokladu“, který tak má zaručeně ideální podmínky pro dlouhodobé uskladnění a zrání.', '2017-05-02 13:37:22', '2017-05-03 04:13:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '160.00', '1800.00', '19.00', 7, b'1'),
(652, 725, 701, 701, 538, NULL, NULL, 1, 'Restaurace Bonsai', 'CZE', 'hotel@hotelbonsai.cz', 'www.hotelbonsai.cz/restaurace', '724920576', '608 113 205', 'Republikánské obrany 912/10', 'Mikulov', '69201', NULL, 7, '48.80152210', '16.63150710', NULL, 'Michal Kovařík', 'Republikánské obrany 912/10 Mikulov', '70479313', '0', '115-2579350227', '0100', 'menu, speciality, hotelová terasa', 'Přijďte si k nám pochutnat na vynikajícím jídle, nebo si jen posedět s přáteli u dobrého vínka místní produkce, nebo kávy a dezertu v příjemném  prostředí naší restaurace. \nNabízíme jídla podle pečlivě sestaveného jídelního lístku, menu podle aktuální denní nabídky s ohledem na přání našich hostů, a také speciality všeho druhu v průběhu roku: zvěřinové hody, kuřecí speciality, řecká nebo italská kuchyně, Sushi atd. V letních měsících pořádáme večerní grilování, k dispozici je hotelová terasa a bonsajová zahrádka v japonském stylu.', '2017-05-02 13:45:47', '2017-05-03 04:22:47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '120.00', '1600.00', '14.00', 7, b'1'),
