(654, 727, 701, 701, 538, NULL, NULL, 1, 'Restaurace Maděřič', 'CZE', 'info@penzionmaderic.cz', 'www.penzionmaderic.cz', '605241340', '605241340', 'Chalúpky 1', 'Moravský Žižkov', '69101', NULL, 7, '48.83418980', '16.93211070', NULL, '0', '0', '0', '0', '115-2579350227', '0100', 'penzion, nekuřácká restaurace, vinárna, letní terasa', 'Nabízíme jedinečný zážitek z návštěvy vinařství, pod jednou střechou ubytování, skvělé víno a vybrané jídlo. Ubytování ve dvou až pěti lůžkových pokojích v klidné vinařské obci. Půjčovnu a úschovnu kol, velké hlídané parkoviště. Nekuřáckou restauraci a vinárnu, letní terasu. Celá budova je přizpůsobena pro rodiny s dětmi.', '2017-05-02 14:49:01', '2017-05-03 04:48:50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', NULL, 1, 1, NULL, NULL, '150.00', '1600.00', '14.00', 9, b'1'),
